INSERT INTO `benefit_translations` (`id`, `title`, `benefit_id`, `description`, `icon`, `lang`, `created_at`, `updated_at`) VALUES
(1, 'Hussle-free and flexible options Cloud', 1, '<p>Offers a virtual machine with managed service solution to automatically size the storage and is equipped with a flexible resource pool that can help you to create, delete, and edit the virtual machine as required.</p>', 'imgs/products/feature-products/011-operation.svg', 'en', '2021-05-10 22:42:00', '2021-05-10 22:42:00'),
(2, 'Cloud Bebas rumit dan sesuai dengan kebutuhan', 1, '<p>Virtual Machine akan terkelola dan mengatur ukuran penyimpanan secara otomatis serta Resource Pool yang fleksibel dapat membantu Anda untuk membuat, menghapus, dan mengedit Virtual Machine sesuai dengan kebutuhan.</p>', 'imgs/products/feature-products/011-operation.svg', 'id', '2021-05-10 22:42:00', '2021-06-04 10:52:47'),
(3, 'Simple Deployment', 2, '<p>Comes with a fixed package for the virtual machines so there is no need to configure vCPU or vRAM anymore.</p>', 'benefit/7k7CKXAbU4w8eAeiwXfPp8bF1vXBFppxx23A7K0N.svg', 'en', '2021-05-19 07:57:16', '2021-05-19 07:57:16'),
(4, 'Deployment sederhana', 2, '<p>Dilengkapi dengan paket fixed untuk Virtual Machine sehingga tidak perlu lagi mengonfigurasi vCPU atau vRAM.</p>', 'benefit/7k7CKXAbU4w8eAeiwXfPp8bF1vXBFppxx23A7K0N.svg', 'id', '2021-05-19 07:57:16', '2021-06-04 11:01:23'),
(5, 'No More Bandwidth Metering', 3, '<p>Free shared Internet up to 1 Gbps IIX and 200 Mbps IX or you can choose Lintasarta Internet Dedicated or Lintasarta Metro Ethernet for faster and more stable connections.</p>', 'benefit/tZub2MZYpLBsLZhzzQ4sSlns0C06Ek4klvtWVd6w.svg', 'en', '2021-05-19 07:57:16', '2021-05-19 07:57:16'),
(6, 'Tanpa pengukuran bandwidth', 3, '<p>Gratis jaringan Internet yang dapat digunakan antar sesama pengguna dengan bandwidth hingga 1 Gbps IIX dan 200 Mbps IX atau terdapat pilihan jaringan Lintasarta Internet Dedicated atau Lintasarta Metro Ethernet untuk menjaga koneksi lebih stabil.</p>', 'benefit/tZub2MZYpLBsLZhzzQ4sSlns0C06Ek4klvtWVd6w.svg', 'id', '2021-05-19 07:57:16', '2021-06-04 11:01:23'),
(7, 'Cloud At No Cost', 4, '<p>No additional cost is imposed for egress/ingress and port hourly, unless for the bandwidth from Internet Dedicated or Metro Ethernet.</p>', 'benefit/BLgwm2NYwwZZxkR0txpqZF4rJtb7oZQ0exDzZ03r.svg', 'en', '2021-05-19 07:57:16', '2021-05-19 07:57:16'),
(8, 'Hemat biaya', 4, '<p>Tidak ada biaya tambahan untuk egress/ingress dan port kecuali bandwidth dari jaringan Internet Dedicated atau Metro Ethernet.</p>', 'benefit/BLgwm2NYwwZZxkR0txpqZF4rJtb7oZQ0exDzZ03r.svg', 'id', '2021-05-19 07:57:16', '2021-06-04 11:01:23'),
(9, 'Backup All You Want', 5, '<p>Protect and backup all data in the virtual machine from Cloud Premium or Cloud Lite by Lintasarta Cloudeka, or from your own private Cloud and server.</p>', 'benefit/K1t568kmO3qPqjUDTRpxKsfr5Dhm28cd1ByUnAnd.svg', 'en', '2021-05-21 07:55:59', '2021-05-21 07:55:59'),
(10, 'Backup seluruh data', 5, '<p>Lindungi dan backup seluruh data yang ada pada <em>Virtual Machine</em> baik di Deka Prime (PX1) atau Deka Flexi (FX2) milik Lintasarta Cloudeka, maupun di <em>Private Cloud</em> atau server fisik milik Anda.<br />\r\n&nbsp;</p>', 'benefit/K1t568kmO3qPqjUDTRpxKsfr5Dhm28cd1ByUnAnd.svg', 'id', '2021-05-21 07:55:59', '2021-07-21 09:48:40'),
(11, 'Disaster On Cloud', 6, '<p>Part of the Disaster Recovery Plan that will manage the last copy of data from a virtual machine in your cluster or Lintasarta Cloudeka. With this service, all problems can be resolved quickly and return to normal and immediately restore the virtual system.</p>', 'benefit/TUwH0a2qqBTMwIUp4W1XQ3P4GckgBTQSFg3e2qUe.svg', 'en', '2021-05-21 07:55:59', '2021-05-21 07:55:59'),
(12, 'Disaster on Cloud', 6, '<p>Bagian dari Disaster Recovery Plan yang mengelola salinan data terakhir dari <em>Virtual Machine</em> di cluster milik Anda atau Lintasarta Cloudeka. Dengan layanan ini, seluruh permasalahan dapat diatasi dengan cepat dan kembali normal serta segera memulihkan sistem virtual.<br />\r\n&nbsp;</p>', 'benefit/TUwH0a2qqBTMwIUp4W1XQ3P4GckgBTQSFg3e2qUe.svg', 'id', '2021-05-21 07:55:59', '2021-07-21 09:48:40'),
(13, 'Comprehensive management', 7, '<p>Available in two options that will suit your needs. Fully managed by Lintasarta&rsquo;s professional teams for backup, restore, and failover. Self-managed for more flexibility in managing retention times, restore, and other needs.</p>', 'benefit/iBJG9QPmpAfjUKdOglVNmH7vudzm8xu8AmxI83uW.svg', 'en', '2021-05-21 07:55:59', '2021-05-21 07:57:07'),
(14, 'Pengelolaan andal', 7, '<p>Dua pilihan yang sesuai dengan kebutuhan Anda, yaitu Fully Managed oleh tim profesional Lintasarta untuk backup, restore, dan failover, atau Self-managed untuk lebih fleksibel dalam mengatur waktu retention, restore, dan kebutuhan lainnya.&nbsp;</p>', 'benefit/iBJG9QPmpAfjUKdOglVNmH7vudzm8xu8AmxI83uW.svg', 'id', '2021-05-21 07:55:59', '2021-06-04 12:19:57'),
(15, 'No More Bandwidth Metering', 8, '<p>Free shared Internet up to 1 Gbps IIX and 200 Mbps IX or you can choose Lintasarta Internet Dedicated or Lintasarta Metro Ethernet for faster and more stable connections.</p>', 'benefit/lQ4JxscARbzKVI8Ru3QmRFz8Zo3A0RXBolNjIdyo.svg', 'en', '2021-05-21 08:02:10', '2021-05-21 08:03:25'),
(16, 'Tanpa pengukuran bandwidth', 8, '<p>Gratis jaringan Internet yang dapat digunakan antar sesama pengguna dengan bandwidth hingga 1 Gbps IIX dan 200 Mbps IX atau terdapat pilihan jaringan Lintasarta Internet Dedicated atau Lintasarta Metro Ethernet untuk menjaga koneksi lebih stabil.</p>', 'benefit/lQ4JxscARbzKVI8Ru3QmRFz8Zo3A0RXBolNjIdyo.svg', 'id', '2021-05-21 08:02:10', '2021-06-04 10:52:47'),
(17, 'Cloud At No Cost', 9, '<p>No additional cost is imposed for egress/ingress and port hourly, unless for the bandwidth from Internet Dedicated or Metro Ethernet.</p>', 'benefit/weaSNa8A3o3zC7brW1HbC0LW6tUcg09sGVypNptT.svg', 'en', '2021-05-21 08:02:10', '2021-05-21 08:03:25'),
(18, 'Bebas biaya tambahan', 9, '<p>Tidak ada biaya tambahan untuk egress/ingress dan port kecuali bandwidth dari jaringan Internet Dedicated atau Metro Ethernet.</p>', 'benefit/weaSNa8A3o3zC7brW1HbC0LW6tUcg09sGVypNptT.svg', 'id', '2021-05-21 08:02:10', '2021-06-04 10:52:47'),
(19, 'The Best Choice For Your Needs', 10, '<p>You can choose a device partner based on your company&rsquo;s needs. Specifically for baremetal devices, you will have the opportunity to choose two different partners.</p>', 'benefit/B16NaBNGAb4xIfdYoCc0emh0VCQLPbOBfPdhZzQQ.svg', 'en', '2021-05-21 10:26:54', '2021-05-21 10:26:54'),
(20, 'Pilihan terbaik sesuai kebutuhan', 10, '<p>Anda dapat memilih partner perangkat sesuai kebutuhan perusahaan. Khusus perangkat baremetal, Anda memiliki kesempatan untuk memilih dua partner berbeda.&nbsp;<br />\r\n&nbsp;</p>', 'benefit/B16NaBNGAb4xIfdYoCc0emh0VCQLPbOBfPdhZzQQ.svg', 'id', '2021-05-21 10:26:54', '2021-06-04 12:32:48'),
(21, 'Integrated With Lintasarta Services', 11, '<p>Deka Premium can be integrated with other Lintasarta Services such as network, security, etc., or with other service providers.</p>', 'benefit/VA6EJg9JUKIsHnkTc4FdS4CzuNNqCe5rpi9ekaw5.svg', 'en', '2021-05-21 10:26:54', '2021-07-21 09:53:55'),
(22, 'Terintegrasi dengan Layanan Lintasarta', 11, '<p>Deka Premium dapat diintegrasikan dengan Layanan Lintasarta lain seperti jaringan, keamanan, dan lain-lain, atau dengan penyedia jasa lain.<br />\r\n&nbsp;</p>', 'benefit/VA6EJg9JUKIsHnkTc4FdS4CzuNNqCe5rpi9ekaw5.svg', 'id', '2021-05-21 10:26:54', '2021-07-21 09:54:50'),
(23, 'Simple And Fully Managed', 12, '<p>Lintasarta Cloudeka&rsquo;s professional technician team will manage all levels from hardware to the Cloud platform. You can also choose Lintasarta Enterprise on Advance Professional Services (Lintasarta IT Outsourcing) for other IT infrastructure management.</p>', 'benefit/YpBLyWo1lVYq8CJF0Ahtdmmnhfwc4voPb86ryeRW.svg', 'en', '2021-05-21 10:26:54', '2021-05-21 10:26:54'),
(24, 'Mudah dan terkelola sepenuhnya', 12, '<p>Tim teknisi profesional Lintasarta Cloudeka akan mengelola seluruh tingkatan dari perangkat keras hingga ke platform Cloud. Anda juga dapat memilih layanan Lintasarta Enterprise on Advance Professional Services (Lintasarta IT Outsourcing) untuk pengelolaan infrastruktur IT lainnya.<br />\r\n&nbsp;</p>', 'benefit/YpBLyWo1lVYq8CJF0Ahtdmmnhfwc4voPb86ryeRW.svg', 'id', '2021-05-21 10:26:54', '2021-06-04 12:32:49'),
(25, 'Fast And Flexible Performance', 13, '<p>Deka Premium&nbsp;has various deployment options such as at the customer site, at the Lintasarta Data Center, or integrated into Lintasarta Cloudeka&#39;s Deka Prime (PX1) / Deka (FX2) (Public Cloud) via a private network or Metro Ethernet.</p>', 'benefit/Qp5owKYFLAxz5D1CgFPibj3sO4ctQS8Gp0FF9W53.svg', 'en', '2021-05-21 10:26:54', '2021-07-21 09:53:55'),
(26, 'Cepat dan berkinerja fleksibe', 13, '<p>Deka Premium memiliki berbagai opsi deployment seperti di lokasi pelanggan, di Lintasarta Data Center, atau diintegrasikan ke Deka Prime (PX1)/Deka Flexi (FX2) (Public Cloud) milik Lintasarta Cloudeka melalui jaringan privat atau Metro Ethernet.</p>', 'benefit/Qp5owKYFLAxz5D1CgFPibj3sO4ctQS8Gp0FF9W53.svg', 'id', '2021-05-21 10:26:54', '2021-07-21 09:54:50'),
(27, 'Easily manage and control data', 14, '<p>You can configure by using a dedicated webportal, manage replication between multisite, and provide users access to buckets.</p>', 'benefit/UhORy2jOMVaajHV2kFuhOGWDfY5KT3VeDcci8RYn.svg', 'en', '2021-05-21 10:51:04', '2021-05-21 10:51:04'),
(28, 'Mudah mengelola dan mengontrol data', 14, '<p>Anda dapat melakukan konfigurasi melalui webportal yang didedikasikan ke satu pelanggan dan dapat mengelola kebutuhan replikasi antar lokasi serta memberikan akses pengguna ke bucket.&nbsp;<br />\r\n&nbsp;</p>', 'benefit/UhORy2jOMVaajHV2kFuhOGWDfY5KT3VeDcci8RYn.svg', 'id', '2021-05-21 10:51:04', '2021-06-04 12:52:55'),
(29, 'High-Performance Cloud Storage', 15, '<p>Equipped with SSD storage on the backend for optimal performance.</p>', 'benefit/3crhNjuWDzTGZaHklYZrWr23yEQIXDzZzhMqvduX.svg', 'en', '2021-05-21 10:51:04', '2021-05-21 10:51:04'),
(30, 'Bekinerja tinggi penyimpanan Cloud', 15, '<p>Dilengkapi dengan SSD Storage pada backend untuk performa yang lebih optimal.&nbsp;<br />\r\n&nbsp;</p>', 'benefit/3crhNjuWDzTGZaHklYZrWr23yEQIXDzZzhMqvduX.svg', 'id', '2021-05-21 10:51:04', '2021-06-04 12:52:55'),
(31, 'Cost-effective', 16, '<p>No additional cost is imposed for egress/ingress and port hourly, and free shared Internet up to 1 Gbps IIX and 200 Mbps IX.</p>', 'benefit/4DwX9wVcU5uYIEyl8LO0B304wXhnH0IZ1QOPnf7y.svg', 'en', '2021-05-21 10:51:04', '2021-05-21 10:51:04'),
(32, 'Terjangkau dan sesuai kebutuhan', 16, '<p>Tidak ada biaya tambahan untuk egress/ingress dan port, serta gratis jaringan Internet yang dapat digunakan antar sesama pengguna dengan bandwidth hingga 1 Gbps IIX dan 200 Mbps IX</p>', 'benefit/4DwX9wVcU5uYIEyl8LO0B304wXhnH0IZ1QOPnf7y.svg', 'id', '2021-05-21 10:51:04', '2021-06-04 12:52:55'),
(33, 'Simple Deployment', 17, '<p>Deka Harbor offers convenience in deploying applications, which is as simple as login and deploy. This solution also supports Continuous Integration (CI) and Continuous Delivery (CD) processes, so that the Deka Harbor service can perform testing, debugging, and updating application versions easily and quickly.</p>', 'benefit/gbUood6YcVlIKzTAbBSPLZ2MEG567UUtYZ3eU9XZ.svg', 'en', '2021-05-21 10:57:11', '2021-06-05 05:57:50'),
(34, 'Deployment sederhana', 17, '<p>Deka Harbor menawarkan kemudahan dalam men-<em>deploy </em>aplikasi, yaitu sesederhana <em>login </em>dan <em>deploy</em>. Solusi ini juga mendukung proses <em>Continuous Integration</em> (CI) dan <em>Continuous Delivery</em> (CD), sehingga layanan Deka Harbor dapat melakukan pengujian, <em>debugging</em>, dan <em>update </em>versi aplikasi secara mudah dan cepat.<br />\r\n&nbsp;</p>', 'benefit/gbUood6YcVlIKzTAbBSPLZ2MEG567UUtYZ3eU9XZ.svg', 'id', '2021-05-21 10:57:11', '2021-07-21 10:16:31'),
(35, 'Flexibel Configuration', 18, '<p>The autoscaling service process can be implemented via a horizontal pod auto-scaler. Also, the auto-recovery system will start working once a problematic pod is found.</p>', 'benefit/spcH3tzNI2gcpWNbpOfCcbVOzD1fltTMqPklB8ll.svg', 'en', '2021-05-21 10:57:11', '2021-05-21 10:57:11'),
(36, 'Konfigurasi fleksibel', 18, '<p>Proses layanan <em>autoscalling </em>dapat diimplementasikan melalui <em>horizontal pod autoscaller</em>. Selain itu, sistem pemulihan akan secara otomatis berfungsi jika ditemukan <em>pod</em> yang bermasalah.<br />\r\n&nbsp;</p>', 'benefit/spcH3tzNI2gcpWNbpOfCcbVOzD1fltTMqPklB8ll.svg', 'id', '2021-05-21 10:57:11', '2021-07-21 10:16:31'),
(37, 'Optimal Management', 19, '<p>The platform and infrastructure will be fully managed by Lintasarta Cloudeka professional technicians team who hold international certifications.</p>', 'benefit/D100nXAYk8IGKczMFMeX7IbjM8niXp7sAsAGuxeQ.svg', 'en', '2021-05-21 10:57:11', '2021-05-21 10:57:11'),
(38, 'Pengelolaan optimal', 19, '<p><em>Platform </em>dan infrastruktur akan dikelola sepenuhnya oleh tim teknisi profesional Lintasarta Cloudeka yang telah bersertifikasi internasional.<br />\r\n&nbsp;</p>', 'benefit/D100nXAYk8IGKczMFMeX7IbjM8niXp7sAsAGuxeQ.svg', 'id', '2021-05-21 10:57:11', '2021-07-21 10:16:31'),
(39, 'No More Bandwidth Metering', 20, '<p>Free shared Internet up to 1 Gbps IIX and 200 Mbps IX or you can choose Lintasarta Internet Dedicated or Lintasarta Metro Ethernet for faster and more stable connections.</p>', 'benefit/U2we5jgYruFNhGFDvZgKiscE9qXyBNzwC4TPOfwo.svg', 'en', '2021-05-21 10:57:11', '2021-05-21 10:57:11'),
(40, 'Tanpa pengukuran bandwidth', 20, '<p>Gratis jaringan Internet yang dapat digunakan antar sesama pengguna dengan bandwidth hingga 1 Gbps IIX dan 200 Mbps IX atau terdapat pilihan jaringan Lintasarta Internet Dedicated atau Lintasarta Metro Ethernet untuk menjaga koneksi lebih stabil.</p>', 'benefit/U2we5jgYruFNhGFDvZgKiscE9qXyBNzwC4TPOfwo.svg', 'id', '2021-05-21 10:57:11', '2021-06-04 13:19:14'),
(41, 'The Best Choice For Your Needs', 21, '<p>Track, detect and monitor all mentions about your brands on digital platforms, conduct competitor analysis, and learn about market trends that suit your business area and field.</p>', 'benefit/ZN6WnET3NmCp3L19b89xjvYZiBFV1BLDdAYxsaGG.svg', 'en', '2021-05-21 11:05:46', '2021-05-21 11:05:46'),
(42, 'Dari pemasaran brand hingga pengelolaan reputasi', 21, '<p>Lacak, deteksi, dan pantau semua hal yang menyebut merek Anda di platform digital, lakukan analisis pesaing, dan pelajari tren pasar yang sesuai dengan area dan bidang bisnis Anda.<br />\r\n&nbsp;</p>', 'benefit/ZN6WnET3NmCp3L19b89xjvYZiBFV1BLDdAYxsaGG.svg', 'id', '2021-05-21 11:05:46', '2021-07-21 10:23:24'),
(43, 'A Must-Have Data Analysis', 22, '<p>Offers a complete analysis ranging from social media and online media analysis, competitor analysis, trend analysis, spatial analysis, sentiment analysis, and influence analysis.</p>', 'benefit/Go0gzHTDOQ9a5rElhvkDEuLm5vl0Rw54YxO8Ko3G.svg', 'en', '2021-05-21 11:05:46', '2021-05-21 11:05:46'),
(44, 'Analisis data semua yang dibutuhkan', 22, '<p>Menawarkan paket analisis lengkap mulai dari analisis media sosial dan media online, analisis pesaing, analisis tren, analisis spasial, analisis sentimen, dan analisis influence.<br />\r\n&nbsp;</p>', 'benefit/Go0gzHTDOQ9a5rElhvkDEuLm5vl0Rw54YxO8Ko3G.svg', 'id', '2021-05-21 11:05:46', '2021-06-04 13:27:11'),
(45, 'Security And Compliance', 23, '<p>Deployed in PCI DSS-certified Cloud which will be annually audited. PCI DSS is a reference to high-quality Service Level Agreement (SLA) and security of crucial customer data that is securely stored on a Cloud server.</p>', 'benefit/BmenQIqz3MnZsU1a7zbtm86UXdygFJ5bxEkvcl0U.svg', 'en', '2021-05-21 11:05:46', '2021-05-21 11:05:46'),
(46, 'Keamanan dan kepatuhan', 23, '<p>Diterapkan dalam Cloud bersertifikat PCI DSS yang akan diaudit setiap tahun. PCI DSS adalah referensi Service Level Agreement (SLA) berkualitas tinggi dan keamanan data pelanggan yang disimpan dengan aman di server Cloud.</p>', 'benefit/BmenQIqz3MnZsU1a7zbtm86UXdygFJ5bxEkvcl0U.svg', 'id', '2021-05-21 11:05:46', '2021-06-04 13:27:11'),
(47, 'Meticulous Monitoring', 24, '<p>Lintasarta IVA is supported by the National Institute of Standards &amp; Technology (NIST) that can recognize 10.000 different people. Its distributed architecture enables the efficient processing of the live video. Furthermore, it can run in inexpensive GPUs, unlike the other software.</p>', 'benefit/mEalKv7Gu1EdYujdjC3GYhmAeoe6KwRsQY5IRcrP.svg', 'en', '2021-05-21 11:15:17', '2021-06-05 06:02:43'),
(48, 'Pemantauan yang akurat', 24, '<p>Lintasarta IVA didukung oleh <em>National Institute of Standards &amp; Technology</em> (NIST) yang dapat mengenali 10.000 orang berbeda. Arsitekturnya yang terdistribusi memungkinkan pemrosesan video langsung yang efisien. Selain itu, ia dapat berjalan di GPU yang murah, tidak seperti perangkat lunak lainnya.</p>', 'benefit/mEalKv7Gu1EdYujdjC3GYhmAeoe6KwRsQY5IRcrP.svg', 'id', '2021-05-21 11:15:17', '2021-07-21 10:27:05'),
(49, 'Capture All Moments', 25, '<p>Lintasarta IVA has all your needs covered from e-Tilang/e-TLE, Tax Violation, Public Area Security, Resource Management, Visitor Management, Retail, Public Transportation, and Traffic Design Reengineering.</p>', 'benefit/2Rmoloy0oRDhoUPrutXMCuAm26Uuw9X7LGbWNbY2.svg', 'en', '2021-05-21 11:15:17', '2021-06-05 06:02:43'),
(50, 'Pantau segala situasi', 25, '<p>Penuhi kebutuhan Anda dengan Lintasarta IVA, mulai dari e-Tilang/e-TLE, Pelanggaran Pajak, Keamanan Area Publik, Manajemen Sumber Daya, Manajemen Pengunjung, Ritel, Transportasi Umum, dan Rekayasa Ulang Desain Lalu Lintas.<br />\r\n&nbsp;</p>', 'benefit/2Rmoloy0oRDhoUPrutXMCuAm26Uuw9X7LGbWNbY2.svg', 'id', '2021-05-21 11:15:17', '2021-06-04 13:33:46'),
(51, 'Flexible', 26, '<p>Lintasarta IVA can be hosted on-premises or in the Cloud, and its compact size makes it the best solution for embedded or edge deployments. Half-in cloud type allows detection to be handled near the camera location.</p>', 'benefit/qegVCmpQFHONt909ZYv9yGB8XSjJ8RtqpgVbtBLg.svg', 'en', '2021-05-21 11:15:17', '2021-05-21 11:15:17'),
(52, 'Fleksibel', 26, '<p>Lintasarta IVA dapat dihosting di lokasi (<em>on-premise</em>) atau di Cloud, dan ukurannya yang kecil menjadikannya solusi terbaik untuk dipasang di mana saja. Jenis Cloud half-in memungkinkan pendeteksian ditangani dari dekat lokasi kamera.<br />\r\n&nbsp;</p>', 'benefit/qegVCmpQFHONt909ZYv9yGB8XSjJ8RtqpgVbtBLg.svg', 'id', '2021-05-21 11:15:17', '2021-07-21 10:27:05'),
(53, 'Security And Compliance', 27, '<p>Deployed in PCI DSS-certified Cloud which will be annually audited. PCI DSS is a reference to high-quality Service Level Agreement (SLA) and security of crucial customer data that is securely stored on a Cloud server.</p>', 'benefit/iYVeiHBWvnfAaFLBwIIffHgngQLQTa0P2xcOJKWV.svg', 'en', '2021-05-21 11:15:17', '2021-05-21 11:15:17'),
(54, 'Keamanan dan kepatuhan', 27, '<p>Diterapkan dalam Cloud bersertifikat PCI DSS yang akan diaudit setiap tahun. PCI DSS adalah referensi Service Level Agreement (SLA) berkualitas tinggi dan keamanan data pelanggan yang disimpan dengan aman di server Cloud.</p>', 'benefit/iYVeiHBWvnfAaFLBwIIffHgngQLQTa0P2xcOJKWV.svg', 'id', '2021-05-21 11:15:17', '2021-06-04 13:33:46'),
(55, 'Threat Prevention', 28, '<p>Protects your network by providing multiple layers of prevention, confronting threats at each phase of the attack. In addition to traditional intrusion-prevention capabilities, we provide the unique ability to detect and block threats on any and all ports.</p>', 'benefit/tL1va6RL7baBRHDwZfUcPhxlkBC0VuGXCA8HgyrK.svg', 'en', '2021-05-21 11:25:24', '2021-05-21 11:25:24'),
(56, 'Pencegah ancaman', 28, '<p>Melindungi jaringan Anda dengan menyediakan beberapa lapis keamanan untuk menghadapi ancaman di setiap fase serangan siber. Selain kemampuan pencegahan serangan tradisional, Lintasarta menyediakan kemampuan unik untuk mendeteksi dan memblokir ancaman di setiap jenis dan semua port.</p>', 'benefit/tL1va6RL7baBRHDwZfUcPhxlkBC0VuGXCA8HgyrK.svg', 'id', '2021-05-21 11:25:24', '2021-06-05 02:55:08'),
(57, 'URL Filtering', 29, '<p>URL filtering limits access by comparing web traffic against a database to prevent employees from accessing harmful sites, such as phishing pages.</p>', 'benefit/4CSj3djqAnTXHbx8BbylScy0zPtgnl17NQ1Kd4MZ.svg', 'en', '2021-05-21 11:25:24', '2021-05-21 11:25:24'),
(58, 'Pemfilteran URL', 29, '<p>Pemfilteran URL membatasi akses dengan membandingkan lalu lintas web dan database untuk mencegah karyawan yang akan mengakses situs berbahaya, seperti halaman phishing.<br />\r\n&nbsp;</p>', 'benefit/4CSj3djqAnTXHbx8BbylScy0zPtgnl17NQ1Kd4MZ.svg', 'id', '2021-05-21 11:25:24', '2021-06-05 02:55:08'),
(59, 'Application Identification', 30, '<p>Application Identification enables you to see the applications on your network and learn how they work, their behavioral characteristics, and their relative risk.</p>', 'benefit/CQdiXHvQVyFLUQCOZFXzxhbBFvhSXQjwHct3u7Ox.svg', 'en', '2021-05-21 11:25:24', '2021-05-21 11:25:24'),
(60, 'Identifikasi aplikasi', 30, '<p>Fitur ini membantu untuk melihat aplikasi di jaringan Anda dan mempelajari cara kerja, karakteristik perilaku, dan risiko relatifnya.<br />\r\n&nbsp;</p>', 'benefit/CQdiXHvQVyFLUQCOZFXzxhbBFvhSXQjwHct3u7Ox.svg', 'id', '2021-05-21 11:25:24', '2021-06-05 02:55:08'),
(61, 'WildFire', 31, '<p>A Cloud-based service that provides malware sandboxing and fully integrates with the vendor&rsquo;s on-premises or Cloud-deployed NGFW line. The NGFW detects anomalies and then sends data to the Cloud service for analysis.</p>', 'benefit/PiqVYsxSBAQFtbUIcBLLH4j8vbstXsVW3BjoaWvH.svg', 'en', '2021-05-21 11:25:24', '2021-05-21 11:25:24'),
(62, 'WildFire', 31, '<p>Layanan berbasis Cloud yang menyediakan sandboxing malware dan sepenuhnya terintegrasi dengan jalur NGFW di lokasi atau yang di-deploy di Cloud milik Anda. NGFW mendeteksi anomali dan kemudian mengirimkan data ke layanan Cloud untuk dianalisis.<br />\r\n&nbsp;</p>', 'benefit/PiqVYsxSBAQFtbUIcBLLH4j8vbstXsVW3BjoaWvH.svg', 'id', '2021-05-21 11:25:24', '2021-06-05 02:55:08'),
(63, 'Economics Revolution', 32, '<p>By paying monthly, you will be free from capital cost to buy the NGFW hardware and software or license and support every year.</p>', 'benefit/po5hPzLQEtxXS0AjnT6jCPDATQ8zQTHEp7VBfFJV.svg', 'en', '2021-05-21 11:25:24', '2021-05-21 11:25:24'),
(64, 'Economics Revolution', 32, '<p>Dengan membayar bulanan, Anda akan terbebas dari biaya modal untuk membeli hardware dan software NGFW atau lisensi dan support setiap tahun.<br />\r\n&nbsp;</p>', 'benefit/po5hPzLQEtxXS0AjnT6jCPDATQ8zQTHEp7VBfFJV.svg', 'id', '2021-05-21 11:25:24', '2021-06-05 02:55:08'),
(65, 'Monthly Report Analysis', 33, '<p>The report will show you the source and target of the attack, severity level from each kind of the attack, most visited applications, and any other analytical report to support you from not getting hacked.</p>', 'benefit/yGndKQwasfKawsJkElJuq56TMaKOJbdsOByjVz9e.svg', 'en', '2021-05-21 11:25:24', '2021-05-21 11:25:24'),
(66, 'Analisis laporan bulanan', 33, '<p>Laporan bulanan akan menunjukkan sumber dan target serangan, tingkat keparahan dari setiap jenis serangan, aplikasi yang paling sering dikunjungi, dan laporan analisis lainnya untuk mendukung Anda agar tidak diretas.<br />\r\n&nbsp;</p>', 'benefit/yGndKQwasfKawsJkElJuq56TMaKOJbdsOByjVz9e.svg', 'id', '2021-05-21 11:25:24', '2021-06-05 02:55:08'),
(67, 'Reliable Management', 34, '<p>With application traffic management, you can have the ability to perform statically and dynamically load balancing to eliminate points of failure. The application proxy will provide an awareness protocol in controlling critical application traffic.</p>', 'benefit/o2Im2LJtWeNmUElStvijpQdvdtKKHJuCDwWcY9s0.svg', 'en', '2021-05-21 11:32:57', '2021-05-21 11:32:57'),
(68, 'Pengelolaan andal', 34, '<p>Dengan pengelolaan lalu lintas aplikasi, Anda dapat memiliki kemampuan untuk melakukan pembagian beban kerja yang seimbang secara statis dan dinamis untuk menghilangkan titik kegagalan. Proxy aplikasi akan memberikan protokol pemberitahuan dalam mengontrol lalu lintas aplikasi kritikal.</p>', 'benefit/o2Im2LJtWeNmUElStvijpQdvdtKKHJuCDwWcY9s0.svg', 'id', '2021-05-21 11:32:57', '2021-06-05 03:01:36'),
(69, 'Optimal Delivery', 35, '<p>Application delivery optimization can significantly improve page load times and user experience by using the HTTP / 2 protocol, caching, compression, F5 TCP Express &trade;, and F5 OneConnect &trade;.</p>', 'benefit/xE0kbUvFj1v5t4lm6CY4QDRuQDK614jWVtCQ478z.svg', 'en', '2021-05-21 11:32:57', '2021-05-21 11:32:57'),
(70, 'Pengiriman optimal', 35, '<p>Optimisasi pengiriman aplikasi dapat secara signifikan meningkatkan waktu pemuatan halaman dan pengalaman pengguna dengan menggunakan protokol HTTP/2, caching, kompresi, F5 TCP Express&trade;, dan F5 OneConnect&trade;.<br />\r\n&nbsp;</p>', 'benefit/xE0kbUvFj1v5t4lm6CY4QDRuQDK614jWVtCQ478z.svg', 'id', '2021-05-21 11:32:57', '2021-06-05 03:01:36'),
(71, 'Fast And Reliable', 36, '<p>Optimizing web-based applications with HTTP / 2 to ensure that customers and application users will always have access to the applications they need at any time.</p>', 'benefit/mmlcHunNyeAgrviDdQvTzc4Wg1orO6YKQjJhd3Yg.svg', 'en', '2021-05-21 11:32:57', '2021-05-21 11:32:57'),
(72, 'Cepat dan andal', 36, '<p>Mengoptimalkan aplikasi berbasis web dengan HTTP/2 untuk memastikan bahwa pelanggan dan pengguna aplikasi akan selalu memiliki akses ke aplikasi yang mereka butuhkan kapan pun.<br />\r\n&nbsp;</p>', 'benefit/mmlcHunNyeAgrviDdQvTzc4Wg1orO6YKQjJhd3Yg.svg', 'id', '2021-05-21 11:32:57', '2021-06-05 03:01:36'),
(73, 'Programmable Infrastructure', 37, '<p>Perform application control, from connection and data traffic to do configuration and management, with the F5 iRules LX, which is the next evolution of network programmability using the Node.js language on the BIG-IP platform.</p>', 'benefit/GII2HaZroQ2SpYKNEm72EhuhIQi0svMtIQK7ujaa.svg', 'en', '2021-05-21 11:32:57', '2021-05-21 11:32:57'),
(74, 'Infrastruktur yang dapat diprogram', 37, '<p>Melakukan kontrol aplikasi, mulai dari koneksi dan lalu lintas data hingga konfigurasi dan manajemen, dengan F5 iRules LX, yang merupakan evolusi berikutnya untuk programabilitas jaringan menggunakan bahasa Node.js pada platform BIG-IP.<br />\r\n&nbsp;</p>', 'benefit/GII2HaZroQ2SpYKNEm72EhuhIQi0svMtIQK7ujaa.svg', 'id', '2021-05-21 11:32:57', '2021-06-05 03:01:36'),
(75, 'Easy Implementation', 38, '<p>Facilitates the implementation and management process, and provides complete visibility into the application.</p>', 'benefit/KnVKbTlOeat2Vyja8rpyxffI5lBkEBtVSXJUPqRB.svg', 'en', '2021-05-21 11:32:57', '2021-05-21 11:32:57'),
(76, 'Implementasi mudah', 38, '<p>Memudahkan dalam proses implementasi dan pengelolaan, serta menyediakan visibilitas yang lengkap ke dalam aplikasi.<br />\r\n&nbsp;</p>', 'benefit/KnVKbTlOeat2Vyja8rpyxffI5lBkEBtVSXJUPqRB.svg', 'id', '2021-05-21 11:32:58', '2021-06-05 03:01:36'),
(77, 'Monthly Report Analysis', 39, '<p>You can view metrics for the application, virtual server, member pool, URL, specific country, and additional detailed statistics about application traffic traveling through the system.</p>', 'benefit/0nJe7Yghz59Ki4OBiwtqwAvb3tQUkV0FLzo18Ncq.svg', 'en', '2021-05-21 11:32:58', '2021-05-21 11:32:58'),
(78, 'Analisis laporan bulanan', 39, '<p>Anda dapat melihat metrik untuk aplikasi, virtual server, pool member, URL, negara tertentu, dan statistik terperinci tambahan tentang lalu lintas aplikasi yang berjalan melalui sistem.</p>', 'benefit/0nJe7Yghz59Ki4OBiwtqwAvb3tQUkV0FLzo18Ncq.svg', 'id', '2021-05-21 11:32:58', '2021-06-05 03:01:36'),
(79, 'Proactive Bot Protection', 40, '<p>Proactively protects applications against bots and various other attack tools. Prevents L7 DDoS attacks, web scraping, and brute-force attacks. Assist in identifying and reducing attacks before causing any damages to the application.</p>', 'benefit/4y3D4dC8mK9kLfYgCWId3A6RpIY1xkiiswq6zHjR.svg', 'en', '2021-05-21 11:38:25', '2021-05-21 11:38:25'),
(80, 'Perlindungan Bot Proaktif', 40, '<p>Secara proaktif melindungi aplikasi terhadap serangan bot dan berbagai alat serangan lainnya. Mencegah serangan DDoS L7, web scraping, dan serangan brute-force. Membantu dalam melakukan identifikasi dan mengurangi serangan sebelum menyebabkan kerusakan pada aplikasi.<br />\r\n&nbsp;</p>', 'benefit/4y3D4dC8mK9kLfYgCWId3A6RpIY1xkiiswq6zHjR.svg', 'id', '2021-05-21 11:38:25', '2021-06-05 06:14:45'),
(81, 'DataSafe', 41, '<p>Protects sensitive information by encrypting data from the time it is in the browser. DataSafe can encrypt data at the application layer to protect against malware and keylogger attacks.</p>', 'benefit/A6SqCPuIY0a7U0bJOEtbYKJ8Y272yx4Bg8JL62Q3.svg', 'en', '2021-05-21 11:38:25', '2021-06-05 06:11:36'),
(82, 'DataSafe', 41, '<p>Melindungi pencurian informasi sensitif dengan melakukan enkripsi data sejak masih di browser. DataSafe dapat melakukan enkripsi data di layer aplikasi untuk melindungi serangan malware dan keylogger.<br />\r\n&nbsp;</p>', 'benefit/A6SqCPuIY0a7U0bJOEtbYKJ8Y272yx4Bg8JL62Q3.svg', 'id', '2021-05-21 11:38:25', '2021-06-05 03:16:00'),
(83, 'Behavioral DoS', 42, '<p>Behavioral DoS can provide automatic protection against DDoS attacks by analyzing data traffic behavior using Machine Learning and data analysis.</p>', 'benefit/rYCvRNPC2I0kiB5CcuHykuBePV6yErNFAQ6Ncrv7.svg', 'en', '2021-05-21 11:38:25', '2021-06-05 06:16:14'),
(84, 'Behavioral DoS', 42, '<p>Behavioral DoS dapat memberikan perlindungan secara otomatis terhadap serangan DDoS dengan menganalisis perilaku lalu lintas data dengan menggunakan Machine Learning dan analisis data.&nbsp;<br />\r\n&nbsp;</p>', 'benefit/rYCvRNPC2I0kiB5CcuHykuBePV6yErNFAQ6Ncrv7.svg', 'id', '2021-05-21 11:38:25', '2021-06-05 06:14:45'),
(85, 'Maximum Application Protection', 43, '<p>Simplify security systems with security policy templates that have been provided, and offer thousands of attack signatures to prevent various types of attacks that exist.</p>', 'benefit/pUDBVVP8gwRjbPkrGvGtoJmfpBoIqxaOJ2ENvpSE.svg', 'en', '2021-05-21 11:38:25', '2021-06-05 06:11:36'),
(86, 'Perlindungan Aplikasi Maksimal', 43, '<p>Menyederhanakan keamanan dengan template kebijakan keamanan yang telah disediakan, dan menyediakan ribuan attack signatures untuk mencegah berbagai jenis serangan yang ada.<br />\r\n&nbsp;</p>', 'benefit/pUDBVVP8gwRjbPkrGvGtoJmfpBoIqxaOJ2ENvpSE.svg', 'id', '2021-05-21 11:38:25', '2021-06-05 06:14:45'),
(87, 'Multiple Security Applications', 44, '<p>Get a comprehensive level of security against attacks at layer 7, cover threats not detected by traditional WAF, and ensure application compliance with existing application standards.</p>', 'benefit/Xwj013FKoyAjPMmmQimdMUthel1I5yzaEBKrYmhR.svg', 'en', '2021-05-21 11:38:25', '2021-05-21 11:38:25'),
(88, 'Keamanan Ganda Aplikasi', 44, '<p>Mendapatkan tingkat keamanan yang komprehensif terhadap serangan di layer 7, menutup ancaman yang tidak terdeteksi oleh WAF tradisional, dan memastikan kesesuaian aplikasi dengan standar aplikasi yang ada.<br />\r\n&nbsp;</p>', 'benefit/Xwj013FKoyAjPMmmQimdMUthel1I5yzaEBKrYmhR.svg', 'id', '2021-05-21 11:38:25', '2021-06-05 06:14:45'),
(89, 'Monthly Report Analysis', 45, '<p>You can view metrics for the application, virtual server, member pool, URL, specific country, and additional detailed statistics about application traffic traveling through the system.</p>', 'benefit/NVrJaKjdtW31gdohz8cGwRYyvPcBVGbkEH6zQ7tm.svg', 'en', '2021-05-21 11:38:25', '2021-05-21 11:38:25'),
(90, 'Analisis Laporan Bulanan', 45, '<p>Anda dapat melihat metrik untuk aplikasi, virtual server, pool member, URL, negara tertentu, dan statistik terperinci tambahan tentang lalu lintas aplikasi yang berjalan melalui sistem.</p>', 'benefit/NVrJaKjdtW31gdohz8cGwRYyvPcBVGbkEH6zQ7tm.svg', 'id', '2021-05-21 11:38:25', '2021-06-05 06:14:45');
