(9, 5, 'en', '1 Month Free Bill Promo!', '1-month-free-bill-promotion', '<ul>\r\n	<li>Valid for subscription period in 1 September &ndash; 20 October 2021.</li>\r\n	<li>Valid only for Deka Flexi (FX2) products.</li>\r\n	<li>To be eligible, you need to start a Proof of Concept (PoC) or free trial during the promotion period and agree to subscribe in the following month after the PoC or&nbsp;free trial period ended.</li>\r\n	<li>The free billing is the actual usage billing in the following first month (after free trial or PoC ended).</li>\r\n	<li>The free billing in the first month of subscription is worth maximum of&nbsp;IDR 25,000,000.00.</li>\r\n	<li>You will be charged normaly in the 2nd month of the contract and so on.</li>\r\n	<li>Only available by inserting&nbsp;the voucher code on the service portal, and our team&nbsp;will reach out if&nbsp;the customer agrees to continue to subscribe&nbsp;Deka Flexi (FX2)&nbsp;services.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a></p>'),
(10, 5, 'id', 'Promosi 1-Bulan Bebas Biaya', 'promosi-1-bulan-bebas-biaya', '<ul>\r\n	<li>Berlaku untuk periode berlangganan 1 September &ndash; 20 Oktober 2021.</li>\r\n	<li>Hanya berlaku untuk produk Deka Flexi (FX2).</li>\r\n	<li>Anda harus melakukan<em> Proof of Concept</em> (PoC) atau uji coba gratis (<em>free trial</em>)&nbsp;selama periode promosi dan setuju untuk berlangganan di bulan berikutnya setelah periode PoC atau <em>free trial</em> berakhir.</li>\r\n	<li>Tagihan gratis adalah tagihan penggunaan aktual di bulan pertama (setelah <em>free trial</em> atau PoC berakhir).</li>\r\n	<li>Maksimal nilai tagihan yang gratis pada bulan pertama berlangganan adalah Rp25.000.000,00.</li>\r\n	<li>Penagihan di bulan ke-2 kontrak dan seterusnya berlaku sesuai tarif normal.</li>\r\n	<li>Hanya tersedia dengan memasukkan kode voucher pada portal layanan, tim Cloudeka akan menghubungi Anda&nbsp;jika&nbsp;setuju untuk berlangganan layanan Deka Flexi (FX2).</li>\r\n</ul>\r\n\r\n<p>Untuk informasi lebih lanjut tentang Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">klik di sini</a></p>'),
(11, 6, 'en', 'Item 1', 'item-1', '<p>item 1</p>'),
(12, 6, 'id', 'Barang 1', 'barang-1', '<p>barang 1</p>'),
(13, 7, 'en', 'Free VM Instance Promotion', 'free-vm-instance-promotion', '<ul>\r\n	<li>Valid throughout 1 September &ndash; 20 October 2021.</li>\r\n	<li>Valid only for Deka Flexi (FX2) products with a minimum subscription of Rp30.000.000,00/month (after discount, exc. PPN) and not for multiple purchases.</li>\r\n	<li>The free VM instance specification is s1.medium, 2vCPU, 8 GB vRAM, and 24 GB Root Disk or Volume.</li>\r\n	<li>If you want to upgrade, add, or attach volume (root disk) from point 3, you will be fully charged based on price or applicable agreement.</li>\r\n	<li>Does not apply to project orders that use a business case / BC.</li>\r\n	<li>Applies to services with a monthly-basis / not pay-per-use payment model.</li>\r\n	<li>Applies only to new orders, not upgrade orders or change packages of the existing service that is being used.</li>\r\n	<li>Valid for Teknopark Data Center location.</li>\r\n	<li>The VM promotion will be automatically stopped if you downgrade or cancel and making changes that caused the monthly fee being below the limit of IDR 30.000.000,00.</li>\r\n	<li>You must sign up on the Cloudeka portal service to be able to enjoy the Free VM Instance promo.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a></p>'),
(14, 7, 'id', 'Promosi Free VM Instance', 'promo-free-vm-instance', '<ul>\r\n	<li>Berlaku selama 1 September - 20 Oktober 2021.</li>\r\n	<li>Hanya berlaku untuk produk Deka Flexi (FX2) dengan total nilai berlangganan minimum Rp30.000.000,00/bulan (setelah diskon, exc. PPN) dan tidak berlaku kelipatan.</li>\r\n	<li>Spesifikasi VM instance yang digratiskan adalah s1.medium, 2vCPU, 8 GB vRAM, dan 24 GB Root Disk atau Volume.</li>\r\n	<li>Apabila Anda melakukan upgrade, menambah, atau melakukan attach volume (root disk) dari spesifikasi poin ke-3, maka Anda akan dikenakan biaya penuh sesuai dengan harga atau kesepakatan yang berlaku.</li>\r\n	<li>Tidak berlaku untuk order project yang menggunakan business case (BC).&nbsp;</li>\r\n	<li>Berlaku untuk layanan dengan model pembayaran monthly-basis / bukan pay-per-use.</li>\r\n	<li>Berlaku untuk order baru, bukan order upgrade atau change package dari yang sedang digunakan.</li>\r\n	<li>Berlaku untuk di lokasi Data Center Teknopark.</li>\r\n	<li>VM promosi akan otomatis dihentikan apabila Anda melakukan downgrade atau cabut dan mengakibatkan biaya bulanan berada di bawah batas Rp30.000.000,00.</li>\r\n	<li>Anda diharuskan untuk sign-up pada service portal Cloudeka untuk dapat menikmati promo Free VM Instance.</li>\r\n</ul>\r\n\r\n<p>Untuk informasi lebih lanjut tentang Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">klik di sini</a></p>'),
(15, 8, 'en', '25% Discount Promotion', '25-discount-promotion', '<ul>\r\n	<li style=\"text-align:left\">Valid throughout 1 September &ndash; 20 October 2021.</li>\r\n	<li>Valid only for Deka Flexi (FX2) products with a minimum subscription of Rp15.000.000,00/month (after discount, exc. PPN) and not for multiple purchases.</li>\r\n	<li>Discount of 25% calculated after the discount / calculator discount.</li>\r\n	<li>Not applicable for the following components: IP public, additional software license, non-Cloud services (NGFW, LB, Monitoring) and backup storage.</li>\r\n	<li>Applies only to new orders, not upgrade orders or change packages of the existing service that is being used.</li>\r\n	<li>Does not apply to project orders that use a business case / BC.</li>\r\n	<li>Applies to services with a monthly-basis / not pay-per-use payment model.</li>\r\n	<li>Valid for Teknopark Data Center location.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a></p>'),
(16, 8, 'id', 'Promosi Diskon 25%', 'promosi-diskon-25', '<ul>\r\n	<li>Berlaku selama 1 September &ndash; 20 Oktober 2021.</li>\r\n	<li>Hanya berlaku untuk produk Deka Flexi (FX2) dengan total nilai berlangganan minimum Rp15.000.000,00/bulan (setelah diskon, exc. PPN) dan tidak berlaku kelipatan.</li>\r\n	<li>Potongan harga 25% dihitung setelah potongan harga / diskon kalkulator.</li>\r\n	<li>Tidak termasuk untuk komponen berikut: IP public, lisensi software tambahan, layanan non-Cloud (NGFW, LB, Monitoring) dan backup storage.</li>\r\n	<li>Berlaku untuk order baru, bukan order upgrade atau change package dari layanan yang sedang digunakan.</li>\r\n	<li>Tidak berlaku untuk order project yang menggunakan business case / BC.</li>\r\n	<li>Berlaku untuk layanan dengan model pembayaran monthly-basis / bukan pay-per-use.</li>\r\n	<li>Berlaku untuk di lokasi Data Center Teknopark.</li>\r\n</ul>\r\n\r\n<p>Untuk informasi lebih lanjut tentang Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">klik di sini</a></p>'),
(17, 9, 'en', 'Volume Buy Promotion', 'volume-buy-promotion', '<ul>\r\n	<li>Valid throughout 1 September &ndash; 20 October 2021.</li>\r\n	<li>The promotion is in a form of discount to 5%.</li>\r\n	<li>Valid only for VM instance Deka Flexi (FX2) with the size as follows:</li>\r\n	<li>Minimum: 2.000 GB storage or 24 GB RAM&nbsp;</li>\r\n	<li>Maximum: 10.000 GB storage or 64 GB RAM</li>\r\n	<li>Resource fees according to standard discounts or product escalation discounts based on the term and condition of the program promo.</li>\r\n	<li>Applies only to new orders, not upgrade orders or change packages of the existing service that is being used.</li>\r\n	<li>Does not apply to project orders that use a business case / BC.</li>\r\n	<li>Applies to services with a monthly-basis / not pay-per-use payment model.</li>\r\n	<li>Valid for Teknopark Data Center location.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a></p>'),
(18, 9, 'id', 'Promosi Volume Buy', 'promosi-volume-buy', '<ul>\r\n	<li>Berlaku selama 1 September &ndash; 20 Oktober 2021.</li>\r\n	<li>Promosi dalam bentuk potongan harga sebesar 5%.</li>\r\n	<li>Hanya berlaku untuk instance VM Deka Flexi (FX2) dengan ukuran sebagai berikut:</li>\r\n	<li>Minimum: 2.000 GB storage atau 24 GB RAM&nbsp;</li>\r\n	<li>Maksimum: &nbsp;10.000 GB storage atau 64 GB RAM</li>\r\n	<li>Biaya resource sesuai discount standar atau discount eskalasi produk sesuai ketentuan promo program.</li>\r\n	<li>Berlaku untuk order baru, bukan order upgrade atau change package dari layanan yang sedang digunakan.</li>\r\n	<li>Tidak berlaku untuk order project yang menggunakan business case / BC.</li>\r\n	<li>Berlaku untuk layanan dengan model pembayaran monthly-basis / bukan pay-per-use.</li>\r\n	<li>Berlaku untuk di lokasi Data Center Teknopark.</li>\r\n</ul>\r\n\r\n<p>Untuk informasi lebih lanjut tentang Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">klik di sini</a></p>'),
(19, 10, 'en', 'BCL (Bonus Cloud Lebay) Promo', 'start-with-cloudeka-promotion', '<p style=\"text-align:center\"><img alt=\"Promo BCL\" class=\"responsive\" src=\"https://www.lintasarta.net/wp-content/uploads/2021/11/Banner-BCL-02.jpg\" style=\"height:100%; width:95%\" /></p>\r\n\r\n<ul>\r\n	<li>Valid throughout 26 October &ndash; 31 December 2021.</li>\r\n	<li>Valid only for Deka Flexi (FX2) product with a specification below :</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:551.989px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; width:300px\">Resource Pool</td>\r\n			<td style=\"text-align:center; width:115px\">Price List</td>\r\n			<td style=\"text-align:center; width:117px\">Promo Price</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:300px\">c1.Small (1 vCPU, 1 GB RAM, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:115px\">372.400</td>\r\n			<td style=\"text-align:center; width:117px\">75.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:300px\">e1.large (4 vCPU, 8 GB RAM, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:115px\">2.145.000</td>\r\n			<td style=\"text-align:center; width:117px\">700.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:300px\">e1.qlarge (32 vCPU, 64 GB RAM, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:115px\">16.789.000</td>\r\n			<td style=\"text-align:center; width:117px\">5.600.000</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Promo for the disk is maximum 20 GB capacity. If you require a higher capacity, you will be charged based on differences of total disk.</li>\r\n	<li>Price only valid for vCPU, RAM, and Disc as described above, for other components like IP Public, extra Disc, and Root Disc, will be charged like quotation shown in calculator.</li>\r\n	<li>Price excludes 10% Tax.</li>\r\n	<li>Promo cannot be combined with other promos.</li>\r\n	<li>Applies to services with a monthly-basis / not pay-per-use (PPU) payment model.</li>\r\n	<li>Applies only to new orders, not upgrade orders or change packages of the existing service that is being used.</li>\r\n	<li>Valid for Technopark Data Center location.</li>\r\n	<li>The VM promotion will be automatically stopped if you downgrade or cancel.</li>\r\n	<li>You must sign up on the Cloudeka service portal to be able to enjoy the &quot;BCL&quot; promo.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a><br />\r\nOr visit <a href=\"https://www.cloudeka.id/contact-us\">Contact Us</a> to find out more!</p>'),
(20, 10, 'id', 'Promo BCL (Bonus Cloud Lebay)', 'cloudeka-promo', '<p style=\"text-align:center\"><img alt=\"Promo BCL\" class=\"responsive\" src=\"https://www.lintasarta.net/wp-content/uploads/2021/11/Banner-BCL-02.jpg\" style=\"height:100%; width:95%\" /></p>\r\n\r\n<ul>\r\n	<li>Berlaku selama 1 Oktober sampai dengan 31 Desember 2021.</li>\r\n	<li>Harga promo Untuk Deka Flexi (FX2) sebagai berikut:</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:548.989px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; width:301px\">Resource Pool</td>\r\n			<td style=\"text-align:center; width:112px\">Price List</td>\r\n			<td style=\"text-align:center; width:116px\">Promo Price</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:301px\">c1.Small (1 vCPU, 1 GB RAM, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:112px\">372.400</td>\r\n			<td style=\"text-align:center; width:116px\">75.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:301px\">e1.large (4 vCPU, 8 GB RAM, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:112px\">2.145.000</td>\r\n			<td style=\"text-align:center; width:116px\">700.000</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:301px\">e1.qlarge (32 vCPU, 64 GB RAM, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:112px\">16.789.000</td>\r\n			<td style=\"text-align:center; width:116px\">5.600.000</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Harga disk promo maksimum dengan&nbsp;kapasitas 20 GB.&nbsp;Apabila lebih dari 20 GB, akan dikenakan charge per GB berdasarkan selisih jumlah total disk dikurangi dengan 20 GB.</li>\r\n	<li>Harga hanya berlaku untuk komponen&nbsp;vCPU, RAM, dan disk sesuai&nbsp;dengan&nbsp;deskripsi di atas.&nbsp;Untuk komponen lain seperti IP public, tambahan <em>disk, </em>dan<em> root disk,</em> tetap di-<em>charge</em> sesuai informasi angka yang ada di