(21, 13, 'en', 'PCR (Paket Cuan Reseller) Promo', 'start-with-cloudeka-partner-promotion', '<p style=\"text-align:center\"><img alt=\"Promo PCR\" class=\"responsive\" src=\"https://www.lintasarta.net/wp-content/uploads/2021/11/Banner-PCR-02.jpg\" style=\"height:100%; width:95%\" /></p>\r\n\r\n<ul>\r\n	<li>Valid throughout 27 October &ndash; 31 December 2021.</li>\r\n	<li>Promo for Reseller Partners with Deka Flexi (FX2) services are as follows:</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:510.989px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Resource Pool</td>\r\n			<td style=\"text-align:center; width:111px\">Price List</td>\r\n			<td style=\"text-align:center; width:109px\">Promo Price</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Small (32 vCPU, 128 GB, 20 GB Disk)&nbsp;</td>\r\n			<td style=\"text-align:center; width:111px\">16,033,000</td>\r\n			<td style=\"text-align:center; width:109px\">7,214,850</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Medium (64 vCPU, 256 GB, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:111px\">32,033,000</td>\r\n			<td style=\"text-align:center; width:109px\">14,414,850</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Large (128 vCPU, 512 GB, 20 GB Disk)&nbsp;</td>\r\n			<td style=\"text-align:center; width:111px\">64,033,000</td>\r\n			<td style=\"text-align:center; width:109px\">28,814,850</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Promo prices valid with a year contract and available&nbsp;after Partner registers as a Cloudeka Reseller.</li>\r\n	<li>Prices exclude 10% VAT.</li>\r\n	<li>Promo for the disk is maximum 20 GB capacity.</li>\r\n	<li>Price only valid for vCPU, RAM, and Disc as described above, for other components such as IP Public, extra Disc, Root Disc, Win Server/RHEL/SQL will be charged according to the Price Calculator.</li>\r\n	<li>Promo cannot be combined with other promos.</li>\r\n	<li>Applies to services with a monthly-basis / not pay-per-use (PPU) payment model.</li>\r\n	<li>Applies only to new orders, not upgrade orders or change packages of the existing service that is being used.</li>\r\n	<li>Partners will get an additional 12% discount from the price list for the additional capacity of Resource Pool vCPU, vRAM, Storage during contract period.</li>\r\n	<li>Valid for Technopark Data Center location.</li>\r\n	<li>The VM promotion will be automatically stopped if customers downgrade or cancel.</li>\r\n	<li>You must sign up on the Cloudeka portal service to be able to enjoy the &quot;PCR&quot; promo.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a><br />\r\nOr visit <a href=\"https://www.cloudeka.id/contact-us\">Contact Us</a> to find out more!</p>'),
(22, 13, 'id', 'Promo PCR (Paket Cuan Reseller)', 'start-with-cloudeka-partner-promo', '<p style=\"text-align:center\"><img alt=\"Nature\" class=\"responsive\" src=\"https://www.lintasarta.net/wp-content/uploads/2021/11/Banner-PCR-02.jpg\" style=\"height:100%; width:95%\" /></p>\r\n\r\n<ul>\r\n	<li>Promo Berlaku selama 27 Oktober sampai dengan 31 Desember 2021.</li>\r\n	<li>Harga promo&nbsp;untuk&nbsp;Partner Reseller&nbsp;dengan&nbsp;services Deka Flexi (FX2)&nbsp;sebagai&nbsp;berikut:</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:510.989px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Resource Pool</td>\r\n			<td style=\"text-align:center; width:111px\">Price List</td>\r\n			<td style=\"text-align:center; width:109px\">Promo Price</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Small (32 vCPU, 128 GB, 20 GB Disk)&nbsp;</td>\r\n			<td style=\"text-align:center; width:111px\">16,033,000</td>\r\n			<td style=\"text-align:center; width:109px\">7,214,850</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Medium (64 vCPU, 256 GB, 20 GB Disk)</td>\r\n			<td style=\"text-align:center; width:111px\">32,033,000</td>\r\n			<td style=\"text-align:center; width:109px\">14,414,850</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center; width:270px\">Large (128 vCPU, 512 GB, 20 GB Disk)&nbsp;</td>\r\n			<td style=\"text-align:center; width:111px\">64,033,000</td>\r\n			<td style=\"text-align:center; width:109px\">28,814,850</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Harga promo&nbsp;berlaku&nbsp;dengan&nbsp;kontrak&nbsp;1&nbsp;Tahun.</li>\r\n	<li>Harga tidak termasuk PPN 10%.</li>\r\n	<li>Harga disk promo maksimum kapasitas 20 GB.</li>\r\n	<li>Harga hanya berlaku untuk komponen&nbsp;vCPU, RAM, dan disk sesuai&nbsp;dengan&nbsp;deskripsi di atas.&nbsp;Untuk komponen lain seperti IP public, tambahan <em>disk, </em>dan<em> root disk,</em> Win Server/RHEL/SQL tetap di-<em>charge</em> sesuai informasi angka yang ada di Price Calculator.</li>\r\n	<li>Tidak dapat digabungkan dengan promo lainya.</li>\r\n	<li>Berlaku untuk layanan dengan model pembayaran <em>monthly-basis</em> / bukan <em>pay-per-use</em>.</li>\r\n	<li>Berlaku untuk <em>order</em> baru, bukan <em>order upgrade</em> atau <em>change package</em> dari yang sedang digunakan.</li>\r\n	<li>Partner&nbsp;mendapatkan&nbsp;tambahan&nbsp;diskon 12%&nbsp;dari price list&nbsp;terhadap&nbsp;penambahan&nbsp;kapasitas&nbsp;Resource Pool vCPU,&nbsp;vRAM, Storage&nbsp;selama&nbsp;masa&nbsp;kontrak.</li>\r\n	<li>Berlaku untuk di lokasi Data Center Technopark.</li>\r\n	<li>VM promosi akan otomatis dihentikan apabila pelanggan melakukan <em>downgrade</em> atau cabut.</li>\r\n	<li>Anda diharuskan untuk <em>sign-up</em> pada <em>service</em> <em>portal</em> Cloudeka untuk dapat menikmati promo &quot;PCR&quot;.</li>\r\n</ul>\r\n\r\n<p>For more information about the Deka Flexi (FX2), <a href=\"http://www.cloudeka.id/products/deka-flexi-fx2\">click here</a><br />\r\nOr visit <a href=\"https://www.cloudeka.id/contact-us\">Contact Us</a> to find out more!</p>'),
(23, 14, 'en', 'November Rain Promo', 'november-rain-promo', '<p style=\"text-align:center\"><img alt=\"November Rain\" class=\"responsive\" src=\"https://www.lintasarta.net/wp-content/uploads/2021/11/November-Rain-02.jpg\" style=\"height:100%; width:95%\" /></p>\r\n\r\n<p>Term and Conditions November Rain Promo:</p>\r\n\r\n<ul>\r\n	<li>Valid throughout 1 &ndash; 30 November 2021.</li>\r\n	<li>Valid only for Deka Flexi (FX2) products with a minimum subscription&nbsp;of Rp15.000.000,00/month (after discount, exc. PPN) and not for multiple purchases.</li>\r\n	<li>Discount of 25% calculated after the discount / calculator discount.</li>\r\n	<li>Not applicable for the following components: IP public, additional software license, non-Cloud services (NGFW, LB, Monitoring) and backup storage.</li>\r\n	<li>Applies only to new orders, not upgrade orders or change packages of the existing service that is being used.</li>\r\n	<li>Does not apply to project orders that use a business case (BC).</li>\r\n	<li>Applies to services with a monthly-basis, not pay-per-use payment model.</li>\r\n	<li>Valid for&nbsp;Technopark&nbsp;Data&nbsp;Center&nbsp;location.</li>\r\n</ul>'),
(24, 14, 'id', 'Promo November Rain', 'promo-november-rain', '<p style=\"text-align:center\"><img alt=\"November Rain\" class=\"responsive\" src=\"https://www.lintasarta.net/wp-content/uploads/2021/11/November-Rain-02.jpg\" style=\"height:100%; width:95%\" /></p>\r\n\r\n<p>Syarat dan ketentuan November Rain Promo:</p>\r\n\r\n<ul>\r\n	<li>Berlaku&nbsp;selama&nbsp;1 November sampai&nbsp;dengan&nbsp;30 November 2021.</li>\r\n	<li>Hanya&nbsp;berlaku&nbsp;untuk&nbsp;produk&nbsp;Deka Flexi (FX2)&nbsp;dengan&nbsp;total&nbsp;nilai&nbsp;berlangganan minimum Rp15.000.000,00/bulan&nbsp;(setelah&nbsp;diskon, exc. PPN) dan&nbsp;tidak&nbsp;berlaku kelipatan.</li>\r\n	<li>Potongan&nbsp;harga&nbsp;25%&nbsp;dihitung&nbsp;setelah&nbsp;potongan&nbsp;harga&nbsp;/&nbsp;diskon&nbsp;kalkulator.</li>\r\n	<li>Tidak&nbsp;termasuk&nbsp;untuk&nbsp;komponen&nbsp;berikut: IP public,&nbsp;lisensi&nbsp;software&nbsp;tambahan,&nbsp;layanan&nbsp;non-Cloud (NGFW, LB, Monitoring) dan backup storage.</li>\r\n	<li>Berlaku&nbsp;untuk&nbsp;order&nbsp;baru,&nbsp;bukan&nbsp;order <em>upgrade</em>&nbsp;atau&nbsp;perubahan paket dari&nbsp;layanan&nbsp;yang&nbsp;sedang&nbsp;digunakan.</li>\r\n	<li>Tidak&nbsp;berlaku&nbsp;untuk&nbsp;order project&nbsp;yang&nbsp;menggunakan<em>&nbsp;business case</em> (BC).</li>\r\n	<li>Berlaku&nbsp;untuk&nbsp;layanan&nbsp;dengan&nbsp;model&nbsp;pembayaran&nbsp;<em>monthly-basis,&nbsp;</em>bukan&nbsp;<em>pay-per-use</em>.</li>\r\n	<li>Berlaku&nbsp;untuk&nbsp;di&nbsp;lokasi&nbsp;Data Center&nbsp;Technopark.</li>\r\n</ul>');
