INSERT INTO `log_details` (`id`, `log_id`, `action`, `table`, `column`, `record_id`, `old_value`, `new_value`) VALUES
(1, 1, 'create', 'documentations', 'product_id', 1, NULL, '1'),
(2, 1, 'create', 'documentations', 'level', 1, NULL, '0'),
(3, 1, 'create', 'documentations', 'order', 1, NULL, '1'),
(4, 1, 'create', 'documentation_translations', 'name', 1, NULL, 'Concepts'),
(5, 1, 'create', 'documentation_translations', 'title', 1, NULL, 'Google Cloud overview'),
(6, 1, 'create', 'documentation_translations', 'description', 1, NULL, '<p>This overview is designed to help you understand the overall landscape of Google Cloud. Here, you&#39;ll take a brief look at some of the commonly used features and get pointers to documentation that can help you go deeper. Knowing what&#39;s available and how the parts work together can help you make decisions about how to proceed. You&#39;ll also get pointers to some tutorials that you can use to try out Google Cloud in various scenarios.</p>'),
(7, 1, 'create', 'documentation_translations', 'meta_title', 1, NULL, 'Concepts'),
(8, 1, 'create', 'documentation_translations', 'meta_keywords', 1, NULL, 'Concepts'),
(9, 1, 'create', 'documentation_translations', 'meta_description', 1, NULL, 'Concepts'),
(10, 1, 'create', 'documentation_translations', 'name', 2, NULL, 'Concepts'),
(11, 1, 'create', 'documentation_translations', 'title', 2, NULL, 'Google Cloud overview'),
(12, 1, 'create', 'documentation_translations', 'description', 2, NULL, '<p>This overview is designed to help you understand the overall landscape of Google Cloud. Here, you&#39;ll take a brief look at some of the commonly used features and get pointers to documentation that can help you go deeper. Knowing what&#39;s available and how the parts work together can help you make decisions about how to proceed. You&#39;ll also get pointers to some tutorials that you can use to try out Google Cloud in various scenarios.</p>'),
(13, 1, 'create', 'documentation_translations', 'meta_title', 2, NULL, 'Concepts'),
(14, 1, 'create', 'documentation_translations', 'meta_keywords', 2, NULL, 'Concepts'),
(15, 1, 'create', 'documentation_translations', 'meta_description', 2, NULL, 'Concepts'),
(16, 2, 'create', 'documentations', 'product_id', 2, NULL, '1'),
(17, 2, 'create', 'documentations', 'parent_id', 2, NULL, '1'),
(18, 2, 'create', 'documentations', 'level', 2, NULL, '1'),
(19, 2, 'create', 'documentations', 'order', 2, NULL, '1'),
(20, 2, 'create', 'documentation_translations', 'title', 3, NULL, 'Google Cloud resources'),
(21, 2, 'create', 'documentation_translations', 'description', 3, NULL, '<p>Google Cloud consists of a set of physical assets, such as computers and hard disk drives, and virtual resources, such as virtual machines (VMs), that are contained in&nbsp;<a href=\"https://www.google.com/about/datacenters/\">Google&#39;s data centers</a>&nbsp;around the globe. Each data center location is in a&nbsp;<em>region</em>. Regions are available in Asia, Australia, Europe, North America, and South America. Each region is a collection of&nbsp;<em>zones</em>, which are isolated from each other within the region. Each zone is identified by a name that combines a letter identifier with the name of the region. For example, zone&nbsp;<code>a</code>&nbsp;in the East Asia region is named&nbsp;<code>asia-east1-a</code>.</p>\n\n<p>This distribution of resources provides several benefits, including redundancy in case of failure and reduced latency by locating resources closer to clients. This distribution also introduces some rules about how resources can be used together.</p>'),
(22, 2, 'create', 'documentation_translations', 'title', 4, NULL, 'Google Cloud resources'),
(23, 2, 'create', 'documentation_translations', 'description', 4, NULL, '<p>Google Cloud consists of a set of physical assets, such as computers and hard disk drives, and virtual resources, such as virtual machines (VMs), that are contained in&nbsp;<a href=\"https://www.google.com/about/datacenters/\">Google&#39;s data centers</a>&nbsp;around the globe. Each data center location is in a&nbsp;<em>region</em>. Regions are available in Asia, Australia, Europe, North America, and South America. Each region is a collection of&nbsp;<em>zones</em>, which are isolated from each other within the region. Each zone is identified by a name that combines a letter identifier with the name of the region. For example, zone&nbsp;<code>a</code>&nbsp;in the East Asia region is named&nbsp;<code>asia-east1-a</code>.</p>\n\n<p>This distribution of resources provides several benefits, including redundancy in case of failure and reduced latency by locating resources closer to clients. This distribution also introduces some rules about how resources can be used together.</p>'),
(24, 3, 'create', 'documentations', 'product_id', 3, NULL, '1'),
(25, 3, 'create', 'documentations', 'parent_id', 3, NULL, '1'),
(26, 3, 'create', 'documentations', 'level', 3, NULL, '1'),
(27, 3, 'create', 'documentations', 'order', 3, NULL, '1'),
(28, 3, 'create', 'documentation_translations', 'title', 5, NULL, 'Accessing resources through services'),
(29, 3, 'create', 'documentation_translations', 'description', 5, NULL, '<p>In cloud computing, what you might be used to thinking of as software and hardware products, become&nbsp;<em>services</em>. These services provide access to the underlying resources. The&nbsp;<a href=\"https://cloud.google.com/products\">list of available Google Cloud services</a>&nbsp;is long, and it keeps growing. When you develop your website or application on Google Cloud, you mix and match these services into combinations that provide the infrastructure you need, and then add your code to enable the scenarios you want to build.</p>'),
(30, 3, 'create', 'documentation_translations', 'title', 6, NULL, 'Accessing resources through services'),
(31, 3, 'create', 'documentation_translations', 'description', 6, NULL, '<p>In cloud computing, what you might be used to thinking of as software and hardware products, become&nbsp;<em>services</em>. These services provide access to the underlying resources. The&nbsp;<a href=\"https://cloud.google.com/products\">list of available Google Cloud services</a>&nbsp;is long, and it keeps growing. When you develop your website or application on Google Cloud, you mix and match these services into combinations that provide the infrastructure you need, and then add your code to enable the scenarios you want to build.</p>'),
(32, 4, 'create', 'documentations', 'product_id', 4, NULL, '1'),
(33, 4, 'create', 'documentations', 'parent_id', 4, NULL, '1'),
(34, 4, 'create', 'documentations', 'level', 4, NULL, '1'),
