(36, 4, 'create', 'documentation_translations', 'title', 7, NULL, 'Global, regional, and zonal resources'),
(37, 4, 'create', 'documentation_translations', 'description', 7, NULL, '<p>Some resources can be accessed by any other resource, across regions and zones. These&nbsp;<em>global resources</em>&nbsp;include preconfigured disk images, disk snapshots, and networks. Some resources can be accessed only by resources that are located in the same region. These&nbsp;<em>regional resources</em>&nbsp;include static external IP addresses. Other resources can be accessed only by resources that are located in the same zone. These&nbsp;<em>zonal resources</em>&nbsp;include VM instances, their types, and disks.</p>\n\n<p>The following diagram shows the relationship between global scope, regions and zones, and some of their resources:</p>\n\n<p><img alt=\"A diagram of global scope in Google Cloud, illustrating the use of regions and zones to partition resources.\" src=\"https://cloud.google.com/docs/images/overview/regions-zones.svg\" /></p>\n\n<p>The scope of an operation varies depending on what kind of resources you&#39;re working with. For example, creating a network is a global operation because a network is a global resource, while reserving an IP address is a regional operation because the address is a regional resource.</p>\n\n<p>As you start to optimize your Google Cloud applications, it&#39;s important to understand how these regions and zones interact. For example, even if you could, you wouldn&#39;t want to attach a disk in one region to a computer in a different region because the latency you&#39;d introduce would make for poor performance. Thankfully, Google Cloud won&#39;t let you do that; disks can only be attached to computers in the same zone.</p>\n\n<p>Depending on the level of self-management required for the&nbsp;<a href=\"https://cloud.google.com/docs/overview/cloud-platform-services#computing-hosting\">computing and hosting service</a>&nbsp;you choose, you might or might not need to think about how and where resources are allocated.</p>\n\n<p>For more information about the geographical distribution of Google Cloud, see&nbsp;<a href=\"https://cloud.google.com/docs/geography-and-regions\">Geography and Regions</a>.</p>'),
(38, 4, 'create', 'documentation_translations', 'title', 8, NULL, 'Global, regional, and zonal resources'),
(39, 4, 'create', 'documentation_translations', 'description', 8, NULL, '<p>Some resources can be accessed by any other resource, across regions and zones. These&nbsp;<em>global resources</em>&nbsp;include preconfigured disk images, disk snapshots, and networks. Some resources can be accessed only by resources that are located in the same region. These&nbsp;<em>regional resources</em>&nbsp;include static external IP addresses. Other resources can be accessed only by resources that are located in the same zone. These&nbsp;<em>zonal resources</em>&nbsp;include VM instances, their types, and disks.</p>\n\n<p>The following diagram shows the relationship between global scope, regions and zones, and some of their resources:</p>\n\n<p><img alt=\"A diagram of global scope in Google Cloud, illustrating the use of regions and zones to partition resources.\" src=\"https://cloud.google.com/docs/images/overview/regions-zones.svg\" /></p>\n\n<p>The scope of an operation varies depending on what kind of resources you&#39;re working with. For example, creating a network is a global operation because a network is a global resource, while reserving an IP address is a regional operation because the address is a regional resource.</p>\n\n<p>As you start to optimize your Google Cloud applications, it&#39;s important to understand how these regions and zones interact. For example, even if you could, you wouldn&#39;t want to attach a disk in one region to a computer in a different region because the latency you&#39;d introduce would make for poor performance. Thankfully, Google Cloud won&#39;t let you do that; disks can only be attached to computers in the same zone.</p>\n\n<p>Depending on the level of self-management required for the&nbsp;<a href=\"https://cloud.google.com/docs/overview/cloud-platform-services#computing-hosting\">computing and hosting service</a>&nbsp;you choose, you might or might not need to think about how and where resources are allocated.</p>\n\n<p>For more information about the geographical distribution of Google Cloud, see&nbsp;<a href=\"https://cloud.google.com/docs/geography-and-regions\">Geography and Regions</a>.</p>'),
