(44, 5, 'create', 'documentation_translations', 'title', 9, NULL, 'Projects'),
(45, 5, 'create', 'documentation_translations', 'description', 9, NULL, '<p>Any Google Cloud resources that you allocate and use must belong to a project. You can think of a project as the organizing entity for what you&#39;re building. A project is made up of the settings, permissions, and other metadata that describe your applications. Resources within a single project can work together easily, for example by communicating through an internal network, subject to the regions-and-zones rules. A project can&#39;t access another project&#39;s resources unless you use&nbsp;<a href=\"https://cloud.google.com/vpc/docs/shared-vpc\">Shared VPC</a>&nbsp;or&nbsp;<a href=\"https://cloud.google.com/vpc/docs/vpc-peering\">VPC Network Peering</a>.</p>\n\n<p>Each Google Cloud project has the following:</p>\n\n<ul>\n	<li>A project name, which you provide.</li>\n	<li>A project ID, which you can provide or Google Cloud can provide for you.</li>\n	<li>A project number, which Google Cloud provides.</li>\n</ul>\n\n<p>As you work with Google Cloud, you&#39;ll use these identifiers in certain command lines and API calls. The following screenshot shows a project name, its ID, and number:</p>\n\n<p><img alt=\"A screenshot of the Cloud Console displaying project ID and name.\" src=\"https://cloud.google.com/docs/images/overview/console-ids.png\" /></p>\n\n<p>In this example:</p>\n\n<ul>\n	<li><strong>Example Project</strong>&nbsp;is the project name.</li>\n	<li><strong>example-id</strong>&nbsp;is the project ID.</li>\n	<li><strong>123456789012</strong>&nbsp;is the project number.</li>\n</ul>\n\n<p>Each project ID is unique across Google Cloud. Once you have created a project, you can delete the project but its ID can never be used again.</p>\n\n<p>When billing is enabled, each project is associated with one billing account. Multiple projects can have their resource usage billed to the same account.</p>\n\n<p>A project serves as a namespace. This means every resource within each project must have a unique name, but you can usually reuse resource names if they are in separate projects. Some resource names must be globally unique. Refer to the documentation for the resource for details.</p>'),
(46, 5, 'create', 'documentation_translations', 'title', 10, NULL, 'Projects'),
(47, 5, 'create', 'documentation_translations', 'description', 10, NULL, '<p>Any Google Cloud resources that you allocate and use must belong to a project. You can think of a project as the organizing entity for what you&#39;re building. A project is made up of the settings, permissions, and other metadata that describe your applications. Resources within a single project can work together easily, for example by communicating through an internal network, subject to the regions-and-zones rules. A project can&#39;t access another project&#39;s resources unless you use&nbsp;<a href=\"https://cloud.google.com/vpc/docs/shared-vpc\">Shared VPC</a>&nbsp;or&nbsp;<a href=\"https://cloud.google.com/vpc/docs/vpc-peering\">VPC Network Peering</a>.</p>\n\n<p>Each Google Cloud project has the following:</p>\n\n<ul>\n	<li>A project name, which you provide.</li>\n	<li>A project ID, which you can provide or Google Cloud can provide for you.</li>\n	<li>A project number, which Google Cloud provides.</li>\n</ul>\n\n<p>As you work with Google Cloud, you&#39;ll use these identifiers in certain command lines and API calls. The following screenshot shows a project name, its ID, and number:</p>\n\n<p><img alt=\"A screenshot of the Cloud Console displaying project ID and name.\" src=\"https://cloud.google.com/docs/images/overview/console-ids.png\" /></p>\n\n<p>In this example:</p>\n\n<ul>\n	<li><strong>Example Project</strong>&nbsp;is the project name.</li>\n	<li><strong>example-id</strong>&nbsp;is the project ID.</li>\n	<li><strong>123456789012</strong>&nbsp;is the project number.</li>\n</ul>\n\n<p>Each project ID is unique across Google Cloud. Once you have created a project, you can delete the project but its ID can never be used again.</p>\n\n<p>When billing is enabled, each project is associated with one billing account. Multiple projects can have their resource usage billed to the same account.</p>\n\n<p>A project serves as a namespace. This means every resource within each project must have a unique name, but you can usually reuse resource names if they are in separate projects. Some resource names must be globally unique. Refer to the documentation for the resource for details.</p>'),
