(60, 7, 'create', 'documentation_translations', 'title', 13, NULL, 'Google Cloud Console'),
(61, 7, 'create', 'documentation_translations', 'description', 13, NULL, '<p><img alt=\"A screenshot of the Cloud Console illustrating a web UI.\" src=\"https://cloud.google.com/docs/images/overview/console.png\" /></p>\n\n<p>The&nbsp;<a href=\"https://console.cloud.google.com/\" target=\"console\">Google Cloud Console</a>&nbsp;provides a web-based, graphical user interface that you can use to manage your Google Cloud projects and resources. When you use the Cloud Console, you create a new project, or choose an existing project, and use the resources that you create in the context of that project. You can create multiple projects, so you can use projects to separate your work in whatever way makes sense for you. For example, you might start a new project if you want to make sure only certain team members can access the resources in that project, while all team members can continue to access resources in another project.</p>'),
(62, 7, 'create', 'documentation_translations', 'title', 14, NULL, 'Google Cloud Console'),
(63, 7, 'create', 'documentation_translations', 'description', 14, NULL, '<p><img alt=\"A screenshot of the Cloud Console illustrating a web UI.\" src=\"https://cloud.google.com/docs/images/overview/console.png\" /></p>\n\n<p>The&nbsp;<a href=\"https://console.cloud.google.com/\" target=\"console\">Google Cloud Console</a>&nbsp;provides a web-based, graphical user interface that you can use to manage your Google Cloud projects and resources. When you use the Cloud Console, you create a new project, or choose an existing project, and use the resources that you create in the context of that project. You can create multiple projects, so you can use projects to separate your work in whatever way makes sense for you. For example, you might start a new project if you want to make sure only certain team members can access the resources in that project, while all team members can continue to access resources in another project.</p>'),
