(68, 8, 'create', 'documentation_translations', 'title', 15, NULL, 'Command-line interface'),
(69, 8, 'create', 'documentation_translations', 'description', 15, NULL, '<p>If you prefer to work at the command line, you can perform most Google Cloud tasks by using the&nbsp;<code>gcloud</code>&nbsp;command-line tool. The&nbsp;<code>gcloud</code>&nbsp;tool lets you manage development workflow and Google Cloud resources in a terminal window.</p>\n\n<p>For example, you can create a new Compute Engine virtual machine named&nbsp;<code>example-instance</code>&nbsp;using a command like the following example:</p>\n\n<p>&nbsp;</p>\n\n<pre>\n<code>gcloud compute instances create example-instance \\\n    --image-family=rhel-8 \\\n    --image-project=rhel-cloud\\\n    --zone=us-central1-a\n</code></pre>\n\n<p>You can run&nbsp;<code>gcloud</code>&nbsp;commands in the following ways:</p>\n\n<ul>\n	<li>\n	<p>You can install the&nbsp;<a href=\"https://cloud.google.com/sdk/docs\">Cloud SDK</a>. The SDK includes the&nbsp;<code>gcloud</code>&nbsp;tool, so you can open a terminal window on your own computer and run commands to manage Google Cloud resources.</p>\n	</li>\n	<li>\n	<p>You can use&nbsp;<a href=\"https://cloud.google.com/shell/docs/features\">Cloud Shell</a>, which is a browser-based shell. Because it runs in a browser window, you don&#39;t need to install anything on your own computer. You can open the Cloud Shell from the&nbsp;<a href=\"https://console.cloud.google.com/?cloudshell=true\">Google Cloud Console</a>.</p>\n\n	<p><img alt=\"A screenshot of the Cloud Shell interface.\" src=\"https://cloud.google.com/shell/docs/images/used-console-with-editor.png\" /></p>\n	</li>\n</ul>\n\n<p>Cloud Shell provides the following:</p>\n\n<ul>\n	<li>A temporary Compute Engine virtual machine instance.</li>\n	<li>A built-in code editor.</li>\n	<li>5 GB of persistent disk storage.</li>\n	<li>Pre-installed Cloud SDK and other tools.</li>\n	<li>Language support for Java, Go, Python, Node.js, PHP, Ruby and .NET.</li>\n	<li>Web preview functionality.</li>\n	<li>Built-in authorization for access to Cloud Console projects and resources.</li>\n</ul>\n\n<p>For a list of&nbsp;<code>gcloud</code>&nbsp;commands, see the&nbsp;<a href=\"https://cloud.google.com/sdk/gcloud/reference\"><code>gcloud</code>&nbsp;reference</a>.</p>\n\n<p>For more information about Cloud Shell, see&nbsp;<a href=\"https://cloud.google.com/shell/docs/how-cloud-shell-works\">How Cloud Shell works</a>.</p>'),
(70, 8, 'create', 'documentation_translations', 'title', 16, NULL, 'Command-line interface'),
(71, 8, 'create', 'documentation_translations', 'description', 16, NULL, '<p>If you prefer to work at the command line, you can perform most Google Cloud tasks by using the&nbsp;<code>gcloud</code>&nbsp;command-line tool. The&nbsp;<code>gcloud</code>&nbsp;tool lets you manage development workflow and Google Cloud resources in a terminal window.</p>\n\n<p>For example, you can create a new Compute Engine virtual machine named&nbsp;<code>example-instance</code>&nbsp;using a command like the following example:</p>\n\n<p>&nbsp;</p>\n\n<pre>\n<code>gcloud compute instances create example-instance \\\n    --image-family=rhel-8 \\\n    --image-project=rhel-cloud\\\n    --zone=us-central1-a\n</code></pre>\n\n<p>You can run&nbsp;<code>gcloud</code>&nbsp;commands in the following ways:</p>\n\n<ul>\n	<li>\n	<p>You can install the&nbsp;<a href=\"https://cloud.google.com/sdk/docs\">Cloud SDK</a>. The SDK includes the&nbsp;<code>gcloud</code>&nbsp;tool, so you can open a terminal window on your own computer and run commands to manage Google Cloud resources.</p>\n	</li>\n	<li>\n	<p>You can use&nbsp;<a href=\"https://cloud.google.com/shell/docs/features\">Cloud Shell</a>, which is a browser-based shell. Because it runs in a browser window, you don&#39;t need to install anything on your own computer. You can open the Cloud Shell from the&nbsp;<a href=\"https://console.cloud.google.com/?cloudshell=true\">Google Cloud Console</a>.</p>\n\n	<p><img alt=\"A screenshot of the Cloud Shell interface.\" src=\"https://cloud.google.com/shell/docs/images/used-console-with-editor.png\" /></p>\n	</li>\n</ul>\n\n<p>Cloud Shell provides the following:</p>\n\n<ul>\n	<li>A temporary Compute Engine virtual machine instance.</li>\n	<li>A built-in code editor.</li>\n	<li>5 GB of persistent disk storage.</li>\n	<li>Pre-installed Cloud SDK and other tools.</li>\n	<li>Language support for Java, Go, Python, Node.js, PHP, Ruby and .NET.</li>\n	<li>Web preview functionality.</li>\n	<li>Built-in authorization for access to Cloud Console projects and resources.</li>\n</ul>\n\n<p>For a list of&nbsp;<code>gcloud</code>&nbsp;commands, see the&nbsp;<a href=\"https://cloud.google.com/sdk/gcloud/reference\"><code>gcloud</code>&nbsp;reference</a>.</p>\n\n<p>For more information about Cloud Shell, see&nbsp;<a href=\"https://cloud.google.com/shell/docs/how-cloud-shell-works\">How Cloud Shell works</a>.</p>'),
