(76, 9, 'create', 'documentation_translations', 'title', 17, NULL, 'Client libraries'),
(77, 9, 'create', 'documentation_translations', 'description', 17, NULL, '<p>The Cloud SDK includes&nbsp;<a href=\"https://cloud.google.com/sdk/cloud-client-libraries\">client libraries</a>&nbsp;that enable you to easily create and manage resources. Google Cloud client libraries expose APIs for two main purposes:</p>\n\n<ul>\n	<li>\n	<p><em>App APIs</em>&nbsp;provide access to services. App APIs are optimized for supported languages, such as Node.js and Python. The libraries are designed around service metaphors, so you can work with the services more naturally and write less boilerplate code. The libraries also provide helpers for&nbsp;<a href=\"https://cloud.google.com/docs/authentication\">authentication and authorization</a>.</p>\n	</li>\n	<li>\n	<p><em>Admin APIs</em>&nbsp;offer functionality for resource management. For example, you can use admin APIs if you want to build your own automated tools.</p>\n	</li>\n</ul>\n\n<p>You also can use the Google API client libraries to access APIs for products such as Maps, Drive, and YouTube.</p>'),
(78, 9, 'create', 'documentation_translations', 'title', 18, NULL, 'Client libraries'),
(79, 9, 'create', 'documentation_translations', 'description', 18, NULL, '<p>The Cloud SDK includes&nbsp;<a href=\"https://cloud.google.com/sdk/cloud-client-libraries\">client libraries</a>&nbsp;that enable you to easily create and manage resources. Google Cloud client libraries expose APIs for two main purposes:</p>\n\n<ul>\n	<li>\n	<p><em>App APIs</em>&nbsp;provide access to services. App APIs are optimized for supported languages, such as Node.js and Python. The libraries are designed around service metaphors, so you can work with the services more naturally and write less boilerplate code. The libraries also provide helpers for&nbsp;<a href=\"https://cloud.google.com/docs/authentication\">authentication and authorization</a>.</p>\n	</li>\n	<li>\n	<p><em>Admin APIs</em>&nbsp;offer functionality for resource management. For example, you can use admin APIs if you want to build your own automated tools.</p>\n	</li>\n</ul>\n\n<p>You also can use the Google API client libraries to access APIs for products such as Maps, Drive, and YouTube.</p>'),
