(131, 18, 'create', 'documentation_translations', 'title', 27, NULL, '2.1.   CREATE A NEW STANDALONE VIRTUAL MACHINE'),
(132, 18, 'create', 'documentation_translations', 'description', 27, NULL, '<p>1. On the Virtual Data Center dashboard screen, click the card of the virtual data center you want to explore and select Virtual Machines from the left panel.</p>\n\n<p>2. Click to view the list in a card view and, optionally, arrange the list of virtual machines from the Sort by drop-down menu.</p>\n\n<p>3. Click New VM.</p>\n\n<p>4. Enter the name and the computer name for the virtual machine. Important:The computer name can contain only alphanumeric characters and hyphens. A computer name cannot consist of digits only and cannot contain spaces.</p>\n\n<p>5. (Optional) Enter a meaningful description.</p>\n\n<p>6. Select whether you want the virtual machine to power on right after it is created.</p>\n\n<p>7. Select how you want to deploy the virtual machine.</p>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:750px\">\n	<tbody>\n		<tr>\n			<td><strong>Option</strong></td>\n			<td><strong>Action</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>New</strong></td>\n			<td>\n			<p>You deploy a new virtual machine with customizable settings.</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li>Select an Operating System family and Operating System.</li>\n				<li>(Optional) Select a Boot image.</li>\n				<li>(Optional) Select a VM placement policy and a VM sizing policy. VM placement and VM sizing policy drop-down menus are visible only if the service provider has published such policies to the organization VDC.</li>\n				<li>(Optional) Select the size of the virtual machine from the predefined sizing options or click Custom Sizing Options to enter the number of virtual CPUs, cores per socket, and memory settings manually. If you select a VM sizing policy that defines the VM size, this option is not visible. The predefined sizes of the virtual machine are: Small, Medium, and Large.</li>\n				<li>Specify the storage settings for the virtual machine, such as storage policy and size in GB.</li>\n				<li>Specify the network settings for the virtual machine, such as network, IP mode, IP address, and primary NIC. From Template You deploy a virtual machine from a template that you select from the templates catalog.</li>\n			</ol>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>From Template</strong></td>\n			<td>\n			<p>You deploy a virtual machine from a template that you select from the templates catalog.</p>\n\n			<ol start=\"7\" style=\"list-style-type:lower-alpha\">\n				<li>Select a virtual machine template from the list of available templates.</li>\n				<li>(Optional) Select a VM placement policy and a VM sizing policy. VM placement and VM sizing policy drop-down menus are visible only if the service provider has published such policies to the organization VDC. If the selected template has assigned policies, you might be limited to the predefined template policies.</li>\n				<li>(Optional) Select to use a custom storage policy and select the storage policy to use from the Custom storage policy to use drop-down menu.</li>\n				<li>Read and accept the end-user license agreement, if there is any.</li>\n			</ol>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>8. Click OK to save the settings of the virtual machine and to start the creation process.</p>\n\n<p>You can see the card of the virtual machine in the catalog. Until the virtual machine is created, its state is displayed as Busy.</p>'),
