(137, 20, 'create', 'documentation_translations', 'title', 28, NULL, '2.2.   CHANGE LOCAL ADMINISTRATOR PASSWORD'),
(138, 20, 'create', 'documentation_translations', 'description', 28, NULL, '<ol>\n	<li>On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by</strong> drop-down menu.</li>\n	<li>In the card of the virtual machine you want to edit, click <strong>Details</strong>.</li>\n	<li>Click <strong>Guest OS Customization and Properties</strong> to expand the list of guest operating system settings.</li>\n</ol>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:750px\">\n	<tbody>\n		<tr>\n			<td><strong>Option </strong></td>\n			<td><strong>Description </strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Enable Guest Customization</strong></td>\n			<td>Select this option to enable guest customization.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Change SID </strong></td>\n			<td>Select this option to change the Windows Security ID (SID). This option is specific for virtual machines running a Windows guest operating system. The SID is used in some Windows operating systems to uniquely identify systems and users. If you do not select this option, the new virtual machine has the same SID as the virtual machine or template on which it is based. Duplicate SIDs do not cause problems when the computers are part of a domain and only domain user accounts are used. However, if the machines are part of a Workgroup or local user accounts are used, duplicate SIDs can compromise file access controls. For more information, see the documentation for your Microsoft Windows operating system.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Allow local administrator password</strong></td>\n			<td>\n			<p>Select this option to allow setting an administrator password on the guest operating system.</p>\n\n			<ol>\n				<li>Specify a password for the local administrator.</li>\n			</ol>\n\n			<p style=\"margin-left:40px\">Leaving the <strong>Specify password</strong> text box blank generates a password automatically.</p>\n\n			<ol>\n				<li>Specify the number of times to allow automatic login.</li>\n			</ol>\n\n			<p style=\"margin-left:40px\">Entering a value of zero disables automatic login as an administrator</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Require Administrators to change password on first login</strong></td>\n			<td>Select this option to require administrators to change the password of the guest operating system on the first login. This is recommended for security purposes.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Auto generate password</strong></td>\n			<td>Select this option to allow password auto generation.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Enable this VM to join a domain </strong></td>\n			<td>\n			<p>You can select this option to join the virtual machine to a Windows domain. You can use the organization&#39;s domain or override the organization&#39;s domain and enter the domain properties.</p>\n\n			<ol start=\"3\" style=\"list-style-type:lower-alpha\">\n				<li>Enter the domain name.</li>\n				<li>Enter the user name and password.</li>\n				<li>Enter the account organizational unit.</li>\n			</ol>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Script </strong></td>\n			<td>\n			<p>You can use a customization script to modify the guest operating system of the virtual machine. When you add a customization script to a virtual machine, the script is called only on initial customization and force recustomization. If you set the <strong>precustomization </strong>command line parameter, the script is called before guest customization begins. If you set the <strong>postcustomization </strong>command line parameter, the script is called after guest customization finishes.</p>\n\n			<ol start=\"6\" style=\"list-style-type:lower-alpha\">\n				<li>Click the upload button below the script text box to navigate to a customization script on your local machine.</li>\n				<li>Type the customization script directly into the <strong>Script file</strong> text box.</li>\n			</ol>\n\n			<p>A customization script that you enter directly into the <strong>Script file</strong> text box cannot contain more than 1500 characters. For more information, see VMware Knowledge Base article https://kb.vmware.com/kb/1026614</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"5\">\n	<li>Click <strong>Save </strong>once you complete making your changes.</li>\n	<li>On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by</strong> drop-down menu.</li>\n	<li>From the <strong>Power </strong>menu of the virtual machine you want to power on and customize, select <strong>Power On and Force Recustomization</strong>.</li>\n</ol>'),
(139, 21, 'edit', 'documentation_translations', 'description', 27, '<p>1. On the Virtual Data Center dashboard screen, click the card of the virtual data center you want to explore and select Virtual Machines from the left panel.</p>\n\n<p>2. Click to view the list in a card view and, optionally, arrange the list of virtual machines from the Sort by drop-down menu.</p>\n\n<p>3. Click New VM.</p>\n\n<p>4. Enter the name and the computer name for the virtual machine. Important:The computer name can contain only alphanumeric characters and hyphens. A computer name cannot consist of digits only and cannot contain spaces.</p>\n\n<p>5. (Optional) Enter a meaningful description.</p>\n\n<p>6. Select whether you want the virtual machine to power on right after it is created.</p>\n\n<p>7. Select how you want to deploy the virtual machine.</p>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:750px\">\n	<tbody>\n		<tr>\n			<td><strong>Option</strong></td>\n			<td><strong>Action</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>New</strong></td>\n			<td>\n			<p>You deploy a new virtual machine with customizable settings.</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li>Select an Operating System family and Operating System.</li>\n				<li>(Optional) Select a Boot image.</li>\n				<li>(Optional) Select a VM placement policy and a VM sizing policy. VM placement and VM sizing policy drop-down menus are visible only if the service provider has published such policies to the organization VDC.</li>\n				<li>(Optional) Select the size of the virtual machine from the predefined sizing options or click Custom Sizing Options to enter the number of virtual CPUs, cores per socket, and memory settings manually. If you select a VM sizing policy that defines the VM size, this option is not visible. The predefined sizes of the virtual machine are: Small, Medium, and Large.</li>\n				<li>Specify the storage settings for the virtual machine, such as storage policy and size in GB.</li>\n				<li>Specify the network settings for the virtual machine, such as network, IP mode, IP address, and primary NIC. From Template You deploy a virtual machine from a template that you select from the templates catalog.</li>\n			</ol>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>From Template</strong></td>\n			<td>\n			<p>You deploy a virtual machine from a template that you select from the templates catalog.</p>\n\n			<ol start=\"7\" style=\"list-style-type:lower-alpha\">\n				<li>Select a virtual machine template from the list of available templates.</li>\n				<li>(Optional) Select a VM placement policy and a VM sizing policy. VM placement and VM sizing policy drop-down menus are visible only if the service provider has published such policies to the organization VDC. If the selected template has assigned policies, you might be limited to the predefined template policies.</li>\n				<li>(Optional) Select to use a custom storage policy and select the storage policy to use from the Custom storage policy to use drop-down menu.</li>\n				<li>Read and accept the end-user license agreement, if there is any.</li>\n			</ol>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>8. Click OK to save the settings of the virtual machine and to start the creation process.</p>\n\n<p>You can see the card of the virtual machine in the catalog. Until the virtual machine is created, its state is displayed as Busy.</p>', '<ol>\n	<li>On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by </strong>drop-down menu.</li>\n	<li>Click <strong>New VM</strong>.</li>\n	<li>Enter the name and the computer name for the virtual machine.</li>\n</ol>\n\n<p style=\"margin-left:40px\"><strong>Important</strong>:The computer name can contain only alphanumeric characters and hyphens. A computer name cannot consist of digits only and cannot contain spaces.</p>\n\n<ol start=\"5\">\n	<li><strong>(Optional)</strong> Enter a meaningful description.</li>\n	<li>Select whether you want the virtual machine to power on right after it is created.</li>\n	<li>Select how you want to deploy the virtual machine.</li>\n</ol>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:750px\">\n	<tbody>\n		<tr>\n			<td><strong>Option</strong></td>\n			<td><strong>Action</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>New</strong></td>\n			<td>\n			<p>You deploy a new virtual machine with customizable settings.</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li>Select an Operating System family and Operating System.</li>\n				<li>(Optional) Select a Boot image.</li>\n				<li>(Optional) Select a VM placement policy and a VM sizing policy.</li>\n			</ol>\n\n			<p style=\"margin-left:40px\">VM placement and VM sizing policy drop-down menus are visible only if the service provider has published such policies to the organization VDC.</p>\n\n			<ol start=\"4\" style=\"list-style-type:lower-alpha\">\n				<li>(Optional) Select the size of the virtual machine from the predefined sizing options or click <strong>Custom Sizing Options</strong> to enter the number of virtual CPUs, cores per socket, and memory settings manually.</li>\n			</ol>\n\n			<p style=\"margin-left:40px\">If you select a VM sizing policy that defines the VM size, this option is not visible.</p>\n\n			<p style=\"margin-left:40px\">The predefined sizes of the virtual machine are: <strong>Small, Medium</strong>, and <strong>Large</strong>.</p>\n\n			<ol start=\"5\" style=\"list-style-type:lower-alpha\">\n				<li>Specify the storage settings for the virtual machine, such as storage policy and size in GB.</li>\n				<li>Specify the network settings for the virtual machine, such as network, IP mode, IP address, and primary NIC. From Template You deploy a virtual machine from a template that you select from the templates catalog.</li>\n			</ol>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>From Template</strong></td>\n			<td>\n			<p>You deploy a virtual machine from a template that you select from the templates catalog.</p>\n\n			<ol start=\"7\" style=\"list-style-type:lower-alpha\">\n				<li>Select a virtual machine template from the list of available templates.</li>\n				<li>(Optional) Select a VM placement policy and a VM sizing policy.</li>\n			</ol>\n\n			<p style=\"margin-left:40px\">VM placement and VM sizing policy drop-down menus are visible only if the service provider has published such policies to the organization VDC. If the selected template has assigned policies, you might be limited to the predefined template policies.</p>\n\n			<ol start=\"9\" style=\"list-style-type:lower-alpha\">\n				<li>(Optional) Select to use a custom storage policy and select the storage policy to use from the <strong>Custom storage policy to use</strong> drop-down menu.</li>\n				<li>Read and accept the end-user license agreement, if there is any.</li>\n			</ol>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"8\">\n	<li>Click OK to save the settings of the virtual machine and to start the creation process.</li>\n</ol>\n\n<p style=\"margin-left:40px\">You can see the card of the virtual machine in the catalog. Until the virtual machine is created, its state is displayed as Busy.</p>'),
