(150, 24, 'create', 'documentation_translations', 'title', 30, NULL, '2.4.   PERFORMING POWER OPERATIONS ON VIRTUAL MACHINES'),
(151, 24, 'create', 'documentation_translations', 'description', 30, NULL, '<p><span style=\"color:#f39c12\"><strong>2.4.1 POWER ON A VIRTUAL MACHINE</strong></span></p>\n\n<ol>\n	<li>On the Virtual Data Center dashboard screen, click the card of the virtual data center you want to explore and select Virtual Machines from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the Sort by drop-down menu.</li>\n	<li>From the Actions menu of the virtual machine you want to start, select Power On.</li>\n</ol>\n\n<p><span style=\"color:#f39c12\"><strong>2.4.2 POWER OFF A VIRTUAL MACHINE</strong></span></p>\n\n<ol>\n	<li>On the Virtual Data Center dashboard screen, click the card of the virtual data center you want to explore and select Virtual Machines from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the Sort by drop-down menu.</li>\n	<li>From the Actions menu of the virtual machine you want to power off, select Power Off</li>\n</ol>'),
