(156, 25, 'create', 'documentation_translations', 'title', 31, NULL, '2.5.   INSTALL VMWARE TOOLS'),
(157, 25, 'create', 'documentation_translations', 'description', 31, NULL, '<ol>\n	<li>On the Virtual Data Center dashboard screen, click the card of the virtual data center you want to explore and select Virtual Machines from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the Sort by drop-down menu.</li>\n	<li>From the Actions menu of the virtual machine in which you want to install VMware Tools, select Install VMware Tools.</li>\n</ol>\n\n<p style=\"margin-left:40px\">VMware Tools is installed on the target guest operating system. If there is an error during installation, an error message displays. You can also view the progress of the installation operation in the Tasks window.</p>\n\n<ol start=\"4\">\n	<li>To open the Web console of the virtual machine, from the Actions menu, select Launch Web Console.</li>\n	<li>Follow the instructions on the VMware Knowledge Base Article 1014294 to configure the VMware Tools for your particular operating system</li>\n</ol>'),
