(162, 27, 'create', 'documentation_translations', 'title', 32, NULL, '2.6.   UPGRADE THE VIRTUAL HARDWARE VERSION FOR A VIRTUAL MACHINE'),
(163, 27, 'create', 'documentation_translations', 'description', 32, NULL, '<ol>\n	<li>On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by </strong>drop-down menu.</li>\n	<li>From the <strong>Actions </strong>menu of the virtual machine you want to upgrade, select <strong>Upgrade Virtual Hardware Version</strong>.</li>\n	<li>Click <strong>OK</strong>.</li>\n</ol>'),
