(168, 28, 'create', 'documentation_translations', 'title', 33, NULL, '2.7.   INSERT MEDIA'),
(169, 28, 'create', 'documentation_translations', 'description', 33, NULL, '<ol>\n	<li>On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by</strong> drop-down menu.</li>\n	<li>Select the virtual machine where you want to add the media.</li>\n	<li>From the <strong>Actions </strong>menu, select <strong>Insert Media.</strong></li>\n	<li>On the <strong>Insert CD</strong> window, select the media file to insert in the virtual machine.</li>\n	<li>Click <strong>Insert</strong>.</li>\n</ol>'),
