(180, 30, 'create', 'documentation_translations', 'title', 35, NULL, '2.9.   MONITOR VIRTUAL MACHINES'),
(181, 30, 'create', 'documentation_translations', 'description', 35, NULL, '<ol>\n	<li>On the Virtual Data Center dashboard screen, click the card of the virtual data center you want to explore and select Virtual Machines from the left panel.</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the Sort by drop-down menu.</li>\n	<li>Select the virtual machine you want to monitor and click Details.</li>\n	<li>Click Monitoring chart to expand the monitoring view.</li>\n</ol>\n\n<p style=\"margin-left:40px\">The monitoring chart displays.</p>\n\n<ol start=\"5\">\n	<li>Select a metric option for monitoring virtual machines.</li>\n</ol>\n\n<p style=\"margin-left:40px\">The list in the Metric drop-down menu varies depending on the choices of your system administrator. You see some or all of the options.</p>\n\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff\"><strong>Metric</strong></td>\n			<td style=\"background-color:#66ffff\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Disk provisioned latest.</strong></td>\n			<td>\n			<p>Specified in KB.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Disk read average </strong></td>\n			<td>\n			<p>Specified as a percentage.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Disk write average</strong></td>\n			<td>\n			<p>Specified as a percentage.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>CPU usage average</strong></td>\n			<td>\n			<p>Specified as a percentage.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>CPU usage MHz average</strong></td>\n			<td>\n			<p>Specified in MHz.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>CPU usage maximum</strong></td>\n			<td>\n			<p>Specified as a percentage.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Mem usage average</strong></td>\n			<td>\n			<p>Specified as a percentage.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Disk used latest</strong></td>\n			<td>\n			<p>Specified in KB.</p>\n\n			<p>Choose from day, week, or month view.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p style=\"margin-left:40px\">A new chart is displayed each time you select a different value from the list</p>\n\n<ol start=\"6\">\n	<li><strong>(Optional) </strong>Change the time frame for metrics collection.</li>\n	<li>Click <strong>Refresh</strong>.</li>\n	<li>To save your changes, click <strong>Save</strong>.</li>\n</ol>'),
