(186, 31, 'create', 'documentation_translations', 'title', 36, NULL, '2.10.   WORKING WITH SNAPSHOTS'),
(187, 31, 'create', 'documentation_translations', 'description', 36, NULL, '<p style=\"text-align:justify\"><span style=\"color:#f39c12\">2.10.1 TAKE A SNAPSHOT OF A VIRTUAL MACHINE</span></p>\n\n<ol>\n	<li style=\"text-align: justify;\">On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li style=\"text-align: justify;\">Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by </strong>drop-down menu.</li>\n	<li style=\"text-align: justify;\">From the <strong>Actions </strong>menu of the virtual machine for which you want to take a snapshot, select <strong>Create Snapshot</strong>.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">Taking a snapshot of a virtual machine replaces the existing snapshot if there is any.</p>\n\n<ol start=\"4\">\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> Select whether to snapshot the memory of the virtual machine.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">When you capture the virtual machine&#39;s memory state, the snapshot retains the live state of the virtual machine. Memory snapshots create a snapshot at a precise time, for example, to upgrade software that is still working. If you take a memory snapshot and the upgrade does not complete as expected, or the software does not meet your expectations, you can revert the virtual machine to its previous state.</p>\n\n<p style=\"margin-left:40px; text-align:justify\">When you capture the memory state, the virtual machine&#39;s files do not require quiescing. If you do not capture the memory state, the snapshot does not save the live state of the virtual machine and the disks are crash consistent unless you quiesce them.</p>\n\n<ol start=\"5\">\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> Select whether to quiesce the guest file system.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">This operation requires that VMware Tools is installed on the virtual machine. When you quiesce a virtual machine, VMware Tools quiesces the file system of the virtual machine. A quiesce operation ensures that a snapshot disk represents a consistent state of the guest file systems. Quiesced snapshots are appropriate for automated or periodic backups. For example, if you are unaware of the virtual machine&#39;s activity, but want several recent backups to revert to, you can quiesce the files.</p>\n\n<p style=\"margin-left:40px; text-align:justify\">You cannot quiesce virtual machines that have large capacity disks.</p>\n\n<ol start=\"6\">\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">2.10.2 REVERT A VIRTUAL MACHINE TO A SNAPSHOT</span></p>\n\n<ol>\n	<li style=\"text-align: justify;\">On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.</li>\n	<li style=\"text-align: justify;\">Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by</strong> drop-down menu.</li>\n	<li style=\"text-align: justify;\">From the <strong>Actions </strong>menu of the virtual machine you want to revert to a snapshot, select <strong>Revert to Snapshot</strong>.</li>\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">2.10.3 REMOVE A SNAPSHOT OF A VIRTUAL MACHINE</span></p>\n\n<ol>\n	<li style=\"text-align: justify;\">On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.&nbsp;</li>\n	<li style=\"text-align: justify;\">Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by </strong>drop-down menu.&nbsp;</li>\n	<li style=\"text-align: justify;\">From the <strong>Actions </strong>menu of the virtual machine for which you want to remove the snapshot, select <strong>Remove Snapshot</strong>.&nbsp;</li>\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.</li>\n</ol>'),
