(193, 32, 'create', 'documentation_translations', 'description', 37, NULL, '<ol>\n	<li>On the <strong>Virtual Data Center</strong> dashboard screen, click the card of the virtual data center you want to explore and select <strong>Virtual Machines</strong> from the left panel.&nbsp;</li>\n	<li>Click to view the list in a card view and, optionally, arrange the list of virtual machines from the <strong>Sort by </strong>drop-down menu.&nbsp;</li>\n	<li>From the <strong>Actions </strong>menu of the virtual machine that you want to delete, select <strong>Delete</strong>.</li>\n	<li>Confirm the deletion.</li>\n</ol>'),
