(210, 38, 'edit', 'documentation_translations', 'description', 39, '<ol>\n	<li style=\"text-align: justify;\">Open Edge Gateway Services.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>Navigate to <strong>Networking &gt; Edges</strong>.</li>\n		<li>Select the edge gateway to edit, and click <strong>Services</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align: justify;\">If the <strong>Firewall Rules</strong> screen is not already visible, click the <strong>Firewall </strong>tab.</li>\n	<li style=\"text-align: justify;\">To add a rule below an existing rule in the firewall rules table, click in the existing row and then click the <strong>Create </strong>button.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">A row for the new rule is added below the selected rule, and is assigned any destination, any service, and the <strong>Allow </strong>action by default. When the system-defined default rule is the only rule in the firewall table, the new rule is added above the default rule.</p>\n\n<ol start=\"4\">\n	<li style=\"text-align: justify;\">Click in the <strong>Name </strong>cell and type in a name.</li>\n	<li style=\"text-align: justify;\">Click in the <strong>Source </strong>cell and use the now visible icons to select a source to add to the rule:</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the IP icon</strong></td>\n			<td style=\"text-align:justify\">Type the source value you want to use. Valid values are an IP address, CIDR, an IP range, or the keyword <strong>any </strong>. The edge gateway firewall supports both IPv4 and IPv6 formats.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the + icon</strong></td>\n			<td>\n			<p style=\"text-align:justify\">Use the <strong>+</strong> icon to specify the source as an object other than a specific IP address:</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li style=\"text-align: justify;\">Use the <strong>Select objects</strong> window to add objects that match your selections and click <strong>Keep </strong>to add them to the rule.</li>\n				<li style=\"text-align: justify;\">To exclude a source from the rule, add it to this rule using the <strong>Select objects</strong> window and then select the toggle exclusion icon to exclude that source from this rule.</li>\n			</ol>\n\n			<p style=\"text-align:justify\">When the toggle exclusion is selected on the source, the rule is applied to traffic coming from all sources except for the source you excluded. When the toggle exclusion is not selected, the rule applies to traffic coming from the source you specified in the <strong>Select objects</strong> window</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"6\">\n	<li style=\"text-align: justify;\">Click in the <strong>Destination </strong>cell and perform one of the following options:</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the IP icon</strong></td>\n			<td style=\"text-align:justify\">Type the destination value you want to use. Valid values are an IP address, CIDR, an IP range, or the keyword <strong>any </strong>. The edge gateway firewall supports both IPv4 and IPv6 formats.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the + icon</strong></td>\n			<td>\n			<p style=\"text-align:justify\">Use the <strong>+</strong> icon to specify the source as an object other than a specific IP address:</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li style=\"text-align:justify\">Use the <strong>Select objects</strong> window to add objects that match your selections and click <strong>Keep </strong>to add them to the rule.</li>\n				<li style=\"text-align:justify\">To exclude a source from the rule, add it to this rule using the <strong>Select objects</strong> window and then select the toggle exclusion icon to exclude that source from this rule.</li>\n			</ol>\n\n			<p style=\"text-align:justify\">When the toggle exclusion is selected on the source, the rule is applied to traffic coming from all sources except for the source you excluded. When the toggle exclusion is not selected, the rule applies to traffic coming from the source you specified in the <strong>Select objects</strong> window</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"7\">\n	<li style=\"text-align: justify;\">Click in the <strong>Service </strong>cell of the new rule and click the <strong>+</strong> icon to specify the service as a port-protocol combination:\n\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li style=\"text-align: justify;\">Select the service protocol.</li>\n		<li style=\"text-align: justify;\">Type the port numbers for the source and destination ports, or specify <strong>any </strong>.</li>\n		<li style=\"text-align: justify;\">Click <strong>Keep</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align: justify;\">In the <strong>Action </strong>cell of the new rule, configure the action for the rule.</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Accept</strong></td>\n			<td style=\"text-align:justify\">Allows traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Deny</strong></td>\n			<td>Blocks traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"7\">\n	<li style=\"text-align: justify;\">Click <strong>Save changes.</strong></li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">The save operation can take a minute to complete.</p>', '<ol>\n	<li style=\"text-align:justify\">Open Edge Gateway Services.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>Navigate to <strong>Networking &gt; Edges</strong>.</li>\n		<li>Select the edge gateway to edit, and click <strong>Services</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align:justify\">If the <strong>Firewall Rules</strong> screen is not already visible, click the <strong>Firewall </strong>tab.</li>\n	<li style=\"text-align:justify\">To add a rule below an existing rule in the firewall rules table, click in the existing row and then click the <strong>Create </strong>button.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">A row for the new rule is added below the selected rule, and is assigned any destination, any service, and the <strong>Allow </strong>action by default. When the system-defined default rule is the only rule in the firewall table, the new rule is added above the default rule.</p>\n\n<ol start=\"4\">\n	<li style=\"text-align:justify\">Click in the <strong>Name </strong>cell and type in a name.</li>\n	<li style=\"text-align:justify\">Click in the <strong>Source </strong>cell and use the now visible icons to select a source to add to the rule:</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the IP icon</strong></td>\n			<td style=\"text-align:justify\">Type the source value you want to use. Valid values are an IP address, CIDR, an IP range, or the keyword <strong>any </strong>. The edge gateway firewall supports both IPv4 and IPv6 formats.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the + icon</strong></td>\n			<td>\n			<p style=\"text-align:justify\">Use the <strong>+</strong> icon to specify the source as an object other than a specific IP address:</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li style=\"text-align:justify\">Use the <strong>Select objects</strong> window to add objects that match your selections and click <strong>Keep </strong>to add them to the rule.</li>\n				<li style=\"text-align:justify\">To exclude a source from the rule, add it to this rule using the <strong>Select objects</strong> window and then select the toggle exclusion icon to exclude that source from this rule.</li>\n			</ol>\n\n			<p style=\"text-align:justify\">When the toggle exclusion is selected on the source, the rule is applied to traffic coming from all sources except for the source you excluded. When the toggle exclusion is not selected, the rule applies to traffic coming from the source you specified in the <strong>Select objects</strong> window</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"6\">\n	<li style=\"text-align:justify\">Click in the <strong>Destination </strong>cell and perform one of the following options:</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the IP icon</strong></td>\n			<td style=\"text-align:justify\">Type the destination value you want to use. Valid values are an IP address, CIDR, an IP range, or the keyword <strong>any </strong>. The edge gateway firewall supports both IPv4 and IPv6 formats.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Click the + icon</strong></td>\n			<td>\n			<p style=\"text-align:justify\">Use the <strong>+</strong> icon to specify the source as an object other than a specific IP address:</p>\n\n			<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n				<li style=\"text-align:justify\">Use the <strong>Select objects</strong> window to add objects that match your selections and click <strong>Keep </strong>to add them to the rule.</li>\n				<li style=\"text-align:justify\">To exclude a source from the rule, add it to this rule using the <strong>Select objects</strong> window and then select the toggle exclusion icon to exclude that source from this rule.</li>\n			</ol>\n\n			<p style=\"text-align:justify\">When the toggle exclusion is selected on the source, the rule is applied to traffic coming from all sources except for the source you excluded. When the toggle exclusion is not selected, the rule applies to traffic coming from the source you specified in the <strong>Select objects</strong> window</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"7\">\n	<li style=\"text-align:justify\">Click in the <strong>Service </strong>cell of the new rule and click the <strong>+</strong> icon to specify the service as a port-protocol combination:\n\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li style=\"text-align:justify\">Select the service protocol.</li>\n		<li style=\"text-align:justify\">Type the port numbers for the source and destination ports, or specify <strong>any </strong>.</li>\n		<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align:justify\">In the <strong>Action </strong>cell of the new rule, configure the action for the rule.</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Accept</strong></td>\n			<td style=\"text-align:justify\">Allows traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Deny</strong></td>\n			<td>Blocks traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"9\">\n	<li style=\"text-align:justify\">Click <strong>Save changes.</strong></li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">The save operation can take a minute to complete.</p>'),
