(239, 44, 'create', 'documentation_translations', 'title', 44, NULL, 'FITUR'),
(240, 44, 'create', 'documentation_translations', 'description', 44, NULL, '<p>Lintasarta panel ini memiliki beberapa menu diantaranya: Instance, Storage, Images, Network, dan Security.</p>'),
