(244, 45, 'create', 'documentations', 'order', 35, NULL, '1'),
(245, 45, 'create', 'documentation_translations', 'title', 45, NULL, '1. Instance'),
(246, 45, 'create', 'documentation_translations', 'description', 45, NULL, '<p>Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p>Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p>Tampilan operating system</p>\n\n<p>Tampilan instance image</p>\n\n<p>Tampilan authentication SSH keys</p>\n\n<p>Tampilan authentication password</p>\n\n<p>Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p><strong>Melihat Detail Instance </strong></p>\n\n<p>Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p>Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p>Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p>Detail storage akan masuk ke menu storage.</p>\n\n<p>Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p>Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p>Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p>Detail delete menampilkan halaman delete instance.</p>'),
(247, 46, 'create', 'documentations', 'product_id', 36, NULL, '1'),
(248, 46, 'create', 'documentations', 'parent_id', 36, NULL, '34'),
(249, 46, 'create', 'documentations', 'level', 36, NULL, '2'),
(250, 46, 'create', 'documentations', 'order', 36, NULL, '2'),
(251, 46, 'create', 'documentation_translations', 'title', 46, NULL, '2. Storage'),
(252, 46, 'create', 'documentation_translations', 'description', 46, NULL, '<p>Halaman ini menampilkan list storage yang terdiri dari nama, size, instance name, region, created date, dan tombol action. Klik tombol Create Storage untuk membuat storage baru.</p>\n\n<p>Untuk membuat Storage, lengkapi kolom dengan pilih volume size, pilih instance, isi nama volume lalu klik tombol Create Storage.</p>\n\n<p>Selanjutnya, storage yang telah dibuat akan muncul di halaman list Storage.</p>'),
(253, 47, 'create', 'documentations', 'product_id', 37, NULL, '1'),
(254, 47, 'create', 'documentations', 'parent_id', 37, NULL, '34'),
(255, 47, 'create', 'documentations', 'level', 37, NULL, '2'),
(256, 47, 'create', 'documentations', 'order', 37, NULL, '3'),
(257, 47, 'create', 'documentation_translations', 'title', 47, NULL, '3. Images'),
(258, 47, 'create', 'documentation_translations', 'description', 47, NULL, '<p>Menu image ini memiliki submenu Snapshot dan Custom image.</p>\n\n<ul>\n	<li>Snapshot</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan sanpshot for instance dan snapshot for storage.</p>\n\n<ul>\n	<li>Custom Image</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list image yang terdiri dari image, status, created date, dan tombol action. User dapat melakukan custom image dengan import via URL.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolo dengan mengisi nama image, nomor version, dan image URL lalu klik tombol Import.</p>'),
(259, 48, 'create', 'documentations', 'product_id', 38, NULL, '1'),
(260, 48, 'create', 'documentations', 'parent_id', 38, NULL, '34'),
(261, 48, 'create', 'documentations', 'level', 38, NULL, '2'),
(262, 48, 'create', 'documentations', 'order', 38, NULL, '4'),
(263, 48, 'create', 'documentation_translations', 'title', 48, NULL, '4. Network'),
(264, 48, 'create', 'documentation_translations', 'description', 48, NULL, '<p>Menu image ini memiliki submenu VPC, Floating IPs, dan Load balancer.</p>\n\n<ul>\n	<li>VPC</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list VPC terdiri dari nama, region, available IP, resource in this VPC dan tombol action. User dapat membuat VPC, mengedit dan menghapus VPC.</p>\n\n<p style=\"margin-left:40px\">Untuk membuat VPC network, lengkapi kolom nama, deskripsi, dan configure IP range lalu klik tombol Create VPC Network.</p>\n\n<p style=\"margin-left:40px\">Selanjutnya, VPC yang telah dibuat akan muncul di halaman list VPC Network.</p>\n\n<p style=\"margin-left:40px\">Untuk mengedit VPC network, edit kolom yang akan diubah lalu klik tombol Save untuk menyimpan.</p>\n\n<ul>\n	<li>Floating IPs</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan assign floating IP, reassign, unassign dan delete floating IP.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolo dengan mengisi nama image, nomor version, dan image URL lalu klik tombol Import.</p>'),
(265, 49, 'edit', 'documentation_translations', 'description', 40, '<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td colspan=\"4\" style=\"background-color:#66ccff\"><strong>Document History</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Version</strong></td>\n			<td style=\"text-align:center\"><strong>Date</strong></td>\n			<td style=\"text-align:center\"><strong>Author</strong></td>\n			<td style=\"text-align:center\"><strong>Revision Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">1.0</td>\n			<td style=\"text-align:center\">Mei 2021</td>\n			<td style=\"text-align:center\">GITS Indonesia</td>\n			<td style=\"text-align:center\">First Version</td>\n		</tr>\n	</tbody>\n</table>', '<table border=\"1\" cellpadding=\"5\" cellspacing=\"0\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td colspan=\"4\" style=\"background-color:#66ccff\"><strong>Document History</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Version</strong></td>\n			<td style=\"text-align:center\"><strong>Date</strong></td>\n			<td style=\"text-align:center\"><strong>Author</strong></td>\n			<td style=\"text-align:center\"><strong>Revision Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\">1.0</td>\n			<td style=\"text-align:center\">Mei 2021</td>\n			<td style=\"text-align:center\">GITS Indonesia</td>\n			<td style=\"text-align:center\">First Version</td>\n		</tr>\n	</tbody>\n</table>'),
(266, 50, 'edit', 'documentation_translations', 'description', 48, '<p>Menu image ini memiliki submenu VPC, Floating IPs, dan Load balancer.</p>\n\n<ul>\n	<li>VPC</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list VPC terdiri dari nama, region, available IP, resource in this VPC dan tombol action. User dapat membuat VPC, mengedit dan menghapus VPC.</p>\n\n<p style=\"margin-left:40px\">Untuk membuat VPC network, lengkapi kolom nama, deskripsi, dan configure IP range lalu klik tombol Create VPC Network.</p>\n\n<p style=\"margin-left:40px\">Selanjutnya, VPC yang telah dibuat akan muncul di halaman list VPC Network.</p>\n\n<p style=\"margin-left:40px\">Untuk mengedit VPC network, edit kolom yang akan diubah lalu klik tombol Save untuk menyimpan.</p>\n\n<ul>\n	<li>Floating IPs</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan assign floating IP, reassign, unassign dan delete floating IP.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolo dengan mengisi nama image, nomor version, dan image URL lalu klik tombol Import.</p>', '<p>Menu image ini memiliki submenu VPC, Floating IPs, dan Load balancer.</p>\n\n<ul>\n	<li>VPC</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list VPC terdiri dari nama, region, available IP, resource in this VPC dan tombol action. User dapat membuat VPC, mengedit dan menghapus VPC.</p>\n\n<p style=\"margin-left:40px\">Untuk membuat VPC network, lengkapi kolom nama, deskripsi, dan configure IP range lalu klik tombol Create VPC Network.</p>\n\n<p style=\"margin-left:40px\">Selanjutnya, VPC yang telah dibuat akan muncul di halaman list VPC Network.</p>\n\n<p style=\"margin-left:40px\">Untuk mengedit VPC network, edit kolom yang akan diubah lalu klik tombol Save untuk menyimpan.</p>\n\n<ul>\n	<li>Floating IPs</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan assign floating IP, reassign, unassign dan delete floating IP.</p>'),
(267, 51, 'create', 'documentations', 'product_id', 39, NULL, '1'),
(268, 51, 'create', 'documentations', 'parent_id', 39, NULL, '34'),
(269, 51, 'create', 'documentations', 'level', 39, NULL, '2'),
(270, 51, 'create', 'documentations', 'order', 39, NULL, '5'),
(271, 51, 'create', 'documentation_translations', 'title', 49, NULL, '5. Security'),
(272, 51, 'create', 'documentation_translations', 'description', 49, NULL, '<p>Menu ini menampilkan list security yang terdiri dari nama, applied to, rules, created by dan tombol action untuk mengedit dan menghapus data. User juga dapat membuat security dengan klik tombol Create Security.</p>\n\n<p>Untuk membuat security, lengkapi kolom nama, inbound role dan outbound role, apply to instance lalu klik tombol Create Security Firewall.</p>\n\n<p>Untuk melihat detail security, pilih salah satu nama security. Detail terdiri dari rules, instance dan destroy.</p>\n\n<p>Detail rules menampilkan Inbound Rule dan Outbound Rule yang terdiri dari type, protocol, ethertype, port range dan source.</p>\n\n<p><strong>Organization</strong></p>\n\n<p>Menu ini terdiri dari beberapa submenu diantaranya: Manage Role, Setting Organization, List Project, Service Limit, dan Audit Log.</p>\n\n<ul>\n	<li>Manage Role</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat list nama role, deskripsi dan tombol action untuk mengedit. User juga dapat membuat role baru.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Create New Role</span></p>\n\n<p style=\"margin-left:40px\">Untuk membuat role baru, klik tombol Create New Role.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom dengan mengisi nama role, deskripsi, dan pilih privilages access dan permission dengan menggeser toggle button ke kanan untuk mengaktifkan, lalu pilih permission editor atau viewer lalu klik tombol Save Role.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Edit Role</span></p>\n\n<p style=\"margin-left:40px\">Untuk mengedit role, klik tombol Edit.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom yang akan diedit lalu klik tombol Save Role.</p>\n\n<ul>\n	<li>Setting Organization</li>\n</ul>\n\n<p style=\"margin-left:40px\">Di halaman ini, user dapat mengedit organisasi dan menambah member baru.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Edit Organization</span></p>\n\n<p style=\"margin-left:40px\">Klik tombol Edit Organization, lalu akan muncul popup edit.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom yang akan diedit lalu klik tombol Update.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Add New Member</span></p>\n\n<p style=\"margin-left:40px\">Klik tombol Add New Member, lalu akan muncul popup.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom nama member, email, nomor telepon, pilih project, dan pilih role lalu klik tombol Add.</p>\n\n<ul>\n	<li>List Project</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat daftar project yang telah dibuat.</p>\n\n<ul>\n	<li>Service Limit</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat limit dari instance dan storage.</p>\n\n<ul>\n	<li>Audit Log</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat audit log. User dapat mendownload data dengan klik tombol Download lalu pilih period days.</p>'),
