(289, 56, 'create', 'documentation_translations', 'title', 52, NULL, '1.1. Access your VM’s'),
(290, 56, 'create', 'documentation_translations', 'description', 52, NULL, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Open your Putty / Mobaxterm / Terminal and fill specific port </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong>5617</strong></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> for SSH session</span></span></span></p>\n\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/ClzHPhngkHjhISpcobyLUNQGkmB0lhtE-HmMnNg7KCno0DmqoRBtl90svLcEtHGgMGByqVrE7B8FsFWEUl4FYkQtH9FvYAf-hxH53k0JJJbaLCyyHnCSfS6KnAXYoPH2MaAQoV2qC3-vL5M7cA\" style=\"height:186px; width:451px\" /></span></span></span></p>\n\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/ApNNI75VHmabVhbBJHHgwqfjEu8CdrbpxtykZhe8p6024RUFPyNpCRJfAmE7Qze-Nfda8zhR9dpQjsPZiVjCaWIbeNbtiQJ_VAafLiH9G-lTleayoKxCfquQhZvZWY5SlTMMFCkWrw3v9SkMrw\" style=\"height:376px; width:535px\" /></span></span></span></p>'),
