(295, 57, 'create', 'documentation_translations', 'title', 53, NULL, '1.2. Working with hardening files'),
(296, 57, 'create', 'documentation_translations', 'description', 53, NULL, '<ol>\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Make iptables files executeable (</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong>/home/vas/hardening.fw</strong></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">)</span></span></span></li>\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Running command # chmod +x hardening.fw</span></span></span></li>\n</ol>\n\n<p style=\"list-style-type:decimal; margin-left:40px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/wEoZqmGZAxkXH-nKINYPGUH7aBUI-CYVYK9J_K3pUOfUX82YcDVsiEZYM3Befxuwc77dqDSrDLuWlm_KYq_E1hTp1LriU3eJQHfq8zVGYnniXe8sW6AgcuOVw55tk5Xd4lgiwEeFvz3BxZoQhQ\" style=\"height:437px; width:465px\" /></span></span></span></p>\n\n<ol start=\"3\">\n	<li style=\"list-style-type:decimal\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Change file format (</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><strong>/home/vas/hardening.fw</strong></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">)</span></span></span></li>\n</ol>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"list-style-type: disc;\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Open file /home/vas/hardening.fw using vi command</span></span></span></li>\n	<li style=\"list-style-type: disc;\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Press esc key</span></span></span></li>\n	<li style=\"list-style-type: disc;\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">:set fileformat=unix</span></span></span></li>\n	<li style=\"list-style-type: disc;\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Save it by press :wq!</span></span></span></li>\n</ul>\n\n<p style=\"list-style-type:disc; margin-left:40px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/j05YlUltGHEDsj1JXKrI7oFm-D9TJ_B0Y1wtvRBLZU3gmAwe9DCOeOR2OVFYYCs3p66mltS9Ib40V_f9Qe8xRgH0_htcSCXv_iBD2ukEK5fcBod8te2QUj_o36yNBZ88aWs1cBu_vYGDzdjLBA\" style=\"height:39px; width:226px\" /></span></span></span></p>'),
