(362, 75, 'create', 'documentation_translations', 'description', 57, NULL, '<ul>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Open /home/vas/hardening.fw file.</span></span></span></li>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Comment line 6 and 7 if your server only received / sent UDP packet.</span></span></span></li>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Define required UDP port in line 8 and 9.</span></span></span></li>\n</ul>\n\n<p style=\"margin-left:43px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/HC4_xSMdVmIz4HgI_L-4yGDaPvjZAKuzsz17CCjyMzlZDszGGRZL9Zhcetg_a_T_OSgCtmrKuLb7FkrnregkLaA3aS5rJ5peT7zR6HtVymT6igLRfpmny5BJ8QwvcVsiZCxmVTkxJDebbj_CwA\" style=\"height:137px; width:546px\" /></span></span></span></p>\n\n<ul>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Save file by press :wq!</span></span></span></li>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Execute hardening files -&gt;&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">#./hardening.fw</span></span></span></li>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Make sure your port already open</span></span></span></li>\n</ul>\n\n<p style=\"margin-left:43px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/HiTQNH2CzqvPHPEXhcAVCfe6hNU4tWsIiWWYO2J30E24_1dkXynCukwoKk32-0VdKoFvxnTUfaIauxKV_gfTfMPw_nVv20kH86OcmLYmDUfdqeVH2_IgN9iXzymZLoEDELKrVqJdkTK5TsbLtQ\" style=\"height:33px; width:620px\" /></span></span></span></p>\n\n<ul>\n	<li style=\"list-style-type:disc\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Save iptables rules -&gt;&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"># iptables-save &gt; /etc/sysconfig/iptables</span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Reload iptables services -&gt;&nbsp;</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">#systemctl restart iptables</span></span></span></li>\n</ul>'),
(363, 76, 'edit', 'documentation_translations', 'description', 41, '<p>Untuk user yang belum memiliki akun, silakan klik tombol Sign Up untuk membuat akun baru.</p>\n\n<p>Selanjutnya, akan muncul halaman Sign Up. Lengkapi kolom dengan mengisi username, email, password, nomor handphone, dan nomor NPWP lalu klik tombol Sign Up untuk membuat akun.</p>\n\n<p>Setelah berhasil sign up, user akan menerima email verifikasi untuk mengaktifkan akun. Cek email, klik tombol verifikasi lalu kembali ke halaman Login.</p>', '<p>Untuk user yang belum memiliki akun, silakan klik tombol Sign Up untuk membuat akun baru.</p>\n\n<p><img alt=\"\" src=\"http://103.148.190.87/storage/doc_img/eo1kLu4YJYwKOLhXU2U1YydNWsgFV8gbT60zsjvj.png\" /></p>\n\n<p>Selanjutnya, akan muncul halaman Sign Up. Lengkapi kolom dengan mengisi username, email, password, nomor handphone, dan nomor NPWP lalu klik tombol Sign Up untuk membuat akun.</p>\n\n<p>Setelah berhasil sign up, user akan menerima email verifikasi untuk mengaktifkan akun. Cek email, klik tombol verifikasi lalu kembali ke halaman Login.</p>'),
(364, 77, 'edit', 'documentation_translations', 'description', 41, '<p>Untuk user yang belum memiliki akun, silakan klik tombol Sign Up untuk membuat akun baru.</p>\n\n<p><img alt=\"\" src=\"http://103.148.190.87/storage/doc_img/eo1kLu4YJYwKOLhXU2U1YydNWsgFV8gbT60zsjvj.png\" /></p>\n\n<p>Selanjutnya, akan muncul halaman Sign Up. Lengkapi kolom dengan mengisi username, email, password, nomor handphone, dan nomor NPWP lalu klik tombol Sign Up untuk membuat akun.</p>\n\n<p>Setelah berhasil sign up, user akan menerima email verifikasi untuk mengaktifkan akun. Cek email, klik tombol verifikasi lalu kembali ke halaman Login.</p>', '<p>Untuk user yang belum memiliki akun, silakan klik tombol Sign Up untuk membuat akun baru.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/FlfrcKcqltJqMA29QNkrAa6UIpLhWn233NGFsNOF50dR6NbKGld6Du-oO7XIVp3j-w-ujR5kjFlAuGmNNfe5lsND_PaP31eIvXVJifPB00rR95-JaXYX5NmU9GB348pT89mOIS7Q\" style=\"height:297px; width:602px\" /></span></span></span></p>\n\n<p>Selanjutnya, akan muncul halaman Sign Up. Lengkapi kolom dengan mengisi username, email, password, nomor handphone, dan nomor NPWP lalu klik tombol Sign Up untuk membuat akun.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/Rmx1guShWTDWxHpOuvxLxDhiLr3CPKZd-blFn7rWtMMHRQTIB4POSYcpZzmC30al4AW75keM9wRQRb1RS75vlWPtS9I81qNG3-sRt9Oby7pYPqyoJPWE8TM79mM1Fr1zt9ugRob2\" style=\"height:308px; width:602px\" /></span></span></span></p>\n\n<p>Setelah berhasil sign up, user akan menerima email verifikasi untuk mengaktifkan akun. Cek email, klik tombol verifikasi lalu kembali ke halaman Login.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/uTad6fiAl1ovWckYzoeLXpX9F_dVTdwTkuYOXIPJXUfj-gJKYfDJ8n_3H-uMTOncNnvyS_zlvmuy8ZjCR0OsfdQ0ofLWl-v3KegHMWhnvX8vc1AixYc5C35YyyOdJp3CZwurMYtX\" style=\"height:308px; width:602px\" /></span></span></span></p>'),
(365, 78, 'edit', 'documentation_translations', 'description', 42, '<p>Setelah berhasil membuat akun, selanjutnya masuk ke halaman login. Masukkan email yang sudah terdaftar dan password lalu klik tombol Sign In.</p>\n\n<p><strong>FORGOT PASSWORD</strong></p>\n\n<p>Jika user mengalami lupa password, klik tombol Forgot Password. Selanjutnya, akan muncul popup forgot pasword. Masukkan email lalu server akan mengirim link untuk reset password di email.</p>\n\n<p>Setelah login, masuk ke halaman Create Organization. Lengkapi kolom dengan mengisi nama organisasi, detail, alamat, nomor telepon lalu klik tombol Create.</p>\n\n<p>Setelah membuat organisasi, selanjutnya masuk ke halaman Create New Project. Lengkapi kolom dengan mengisi nama project dan deskripsi project lalu klik tombol Create.</p>', '<p>Setelah berhasil membuat akun, selanjutnya masuk ke halaman login. Masukkan email yang sudah terdaftar dan password lalu klik tombol Sign In.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/FlfrcKcqltJqMA29QNkrAa6UIpLhWn233NGFsNOF50dR6NbKGld6Du-oO7XIVp3j-w-ujR5kjFlAuGmNNfe5lsND_PaP31eIvXVJifPB00rR95-JaXYX5NmU9GB348pT89mOIS7Q\" style=\"height:297px; width:602px\" /></span></span></span></p>\n\n<p><strong>FORGOT PASSWORD</strong></p>\n\n<p>Jika user mengalami lupa password, klik tombol Forgot Password. Selanjutnya, akan muncul popup forgot pasword. Masukkan email lalu server akan mengirim link untuk reset password di email.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/KMQ-dQd1PIrtATxlictXcBx-nmzIyhsGTasDVCKpLwOVLg2v3-qDzlohoC5huR6kDIXG2HuCCqiiTcZhTUa3bX0Qo542adJ5pLyy58qtzaL2N9Yl0_ONi_jK8seJ1GTJnB_I9QqH\" style=\"height:270px; width:448px\" /></span></span></span></p>\n\n<p>Setelah login, masuk ke halaman Create Organization. Lengkapi kolom dengan mengisi nama organisasi, detail, alamat, nomor telepon lalu klik tombol Create.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/nAwJS-NJqwOg2eMGqYTjU9j6MImxxztX5L-48kbjHAQCLrVZrdhx1DUa-XqezUlaRk8vCf7PhONNJMkwUwPrJRXHelJG9gNUFm5NjKKlV3_aWYfeQEouxXzMJeMaoA1nsARHlhNm\" style=\"height:288px; width:602px\" /></span></span></span></p>\n\n<p>Setelah membuat organisasi, selanjutnya masuk ke halaman Create New Project. Lengkapi kolom dengan mengisi nama project dan deskripsi project lalu klik tombol Create.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/umlCFmO85Ozrc_Zh84flHodiRQQMiUWOiDkGrBCBbyfzdjjaFlxIOc39q_ATwJaFrdPQLq_iLbWKY6_FM7EcdWkrYKqeO5zeUxXkIPy2sGxzrh6n1uFt5w_LPU6wEVIYLWQ1kQ6t\" style=\"height:261px; width:602px\" /></span></span></span></p>'),
(366, 79, 'edit', 'documentation_translations', 'description', 43, '<p>Halaman ini memuat informasi profil user yang terdiri dari nama lengkap, email, alamat dan email. User dapat mengedit profil dan mengubah password.</p>\n\n<p>Selanjutnya user akan melihat halaman profile yang terdiri dari nama akun, nama lengkap dan nomor telepon. Di halaman ini terdapat tombol untuk ganti password dan edit profile.</p>\n\n<p>Untuk mengedit profil, lengkapi kolom nama dan nomor handphone lalu klik tombol Update Profile.</p>\n\n<p>Untuk mengubah password, lengkapi kolom password lama, password baru, dan konfirmasi ulang password lalu klik tombol Update Password.</p>', '<p>Halaman ini memuat informasi profil user yang terdiri dari nama lengkap, email, alamat dan email. User dapat mengedit profil dan mengubah password.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/NCVrvDbJjTlrax8KN0RFH4KQN7LL9jz_a1huApbtTSor-hnUQWLWFXDU4i_RuG3AcVFK8sKw-TrMrbFjKUHq0KuDKqLqnsDBQT2Z2OL2sU4Pmpya529Nmo4RbYAblgHqo_yDbyDX\" style=\"height:193px; width:602px\" /></span></span></span></p>\n\n<p>Selanjutnya user akan melihat halaman profile yang terdiri dari nama akun, nama lengkap dan nomor telepon. Di halaman ini terdapat tombol untuk ganti password dan edit profile.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/vJ2ZZb0RWksNv-hOVrKlJhQ401U5RzOW8QmBr3Hp9_GP0eN0PcwedW97xexTX8NickN87YGah9l7c3vjeppHDjcnQ1oL5Mrms-j0wrANRAhPKyWcfgChuTopFtaPZLIBnWh3aara\" style=\"height:217px; width:602px\" /></span></span></span></p>\n\n<p>Untuk mengedit profil, lengkapi kolom nama dan nomor handphone lalu klik tombol Update Profile.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/5Nv3aHLl4J-zVxAgB84VG_PTyR6U33-byooVLHmSZwnCTWNeGv19Itg3s6CZn0bEbj5OBYG-2yC123sNcMzHJmb9vOoqAWjPK4acax4N_3vrK6uNJHa-gLlb_HwIZE7wznJXsuqm\" style=\"height:547px; width:602px\" /></span></span></span></p>\n\n<p>Untuk mengubah password, lengkapi kolom password lama, password baru, dan konfirmasi ulang password lalu klik tombol Update Password.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/UWa-yvNGZoyuVr-2W_JIullJy7pVQNwG2ydibjsYkGOk6QKn0qxIb_D_v_y2SA29fpIW4Nk8suqamv0sUnQolC9WCCnxHjqxJYe_XxuHIWX1wNEUaw6Zd-urQnGBAeDORs_idi_e\" style=\"height:551px; width:543px\" /></span></span></span></p>'),
(367, 80, 'edit', 'documentation_translations', 'description', 45, '<p>Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p>Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p>Tampilan operating system</p>\n\n<p>Tampilan instance image</p>\n\n<p>Tampilan authentication SSH keys</p>\n\n<p>Tampilan authentication password</p>\n\n<p>Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p><strong>Melihat Detail Instance </strong></p>\n\n<p>Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p>Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p>Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p>Detail storage akan masuk ke menu storage.</p>\n\n<p>Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p>Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p>Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p>Detail delete menampilkan halaman delete instance.</p>', '<p>Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p>Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:553px; width:602px\" /></span></span></span></p>\n\n<p>Tampilan operating system</p>\n\n<p>Tampilan instance image</p>\n\n<p>Tampilan authentication SSH keys</p>\n\n<p>Tampilan authentication password</p>\n\n<p>Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p><strong>Melihat Detail Instance </strong></p>\n\n<p>Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p>Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p>Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p>Detail storage akan masuk ke menu storage.</p>\n\n<p>Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p>Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p>Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p>Detail delete menampilkan halaman delete instance.</p>'),
