 on which the virtual machines are connected. This selection is not available when the Protocol is set to ICMP or Any.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>ICMP Type</strong></td>\n			<td>\n			<p>When you select ICMP (an error reporting and a diagnostic utility used between devices to communicate error information) for Protocol, select the ICMP Type from the drop-down menu.</p>\n\n			<p>ICMP messages are identified by the type field. By default, the ICMP type is set to any.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Translated IP/Range</strong></td>\n			<td>\n			<p>Type the IP address or a range of IP addresses to which destination addresses on inbound packets will be translated.</p>\n\n			<p>These addresses are the IP addresses of the one or more virtual machines for which you are configuring DNAT so that they can receive traffic from the external network.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Translated Port</strong></td>\n			<td>(Optional) Select the port or port range that inbound traffic is connecting to on the virtual machines on the internal network. These ports are the ones into which the DNAT rule is translating for the packets inbound to the virtual machines.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Source IP address </strong></td>\n			<td>If you want the rule to apply only for traffic from a specific domain, enter an IP address for this domain or an IP address range in CIDR format. If you leave this text box blank, the DNAT rule applies to all IP addresses that are in the local subnet.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Source Port</strong></td>\n			<td>(Optional) Enter a port number for the source.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Description </strong></td>\n			<td>(Optional) Enter a meaningful description for the DNAT rule.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Enabled </strong></td>\n			<td>Toggle on to enable this rule.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Enable logging</strong></td>\n			<td>Toggle on to have the address translation performed by this rule logged</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"5\">\n	<li>Configure a Source NAT rule (inside going outside).</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Accept</strong></td>\n			<td style=\"text-align:justify\">Allows traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Deny</strong></td>\n			<td>Blocks traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"6\">\n	<li>Click Keep to add the rule to the on-screen table.</li>\n	<li>Repeat the steps to configure additional rules.</li>\n	<li>Click Save changes to save the rules to the system.</li>\n</ol>', '<ol>\n	<li>Open Edge Gateway Services.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>Navigate to Networking &gt; Edges.</li>\n		<li>Select the edge gateway to edit, and click Services.</li>\n	</ol>\n	</li>\n	<li>Click the NAT to view the NAT Rules screen.</li>\n	<li>Depending on which type of NAT rule you are creating, click DNAT Rule or SNAT Rule.</li>\n	<li>Configure a Destination NAT rule (outside coming inside).</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:750px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong