>\n\n			<p>These addresses are the IP addresses of the one or more virtual machines for which you are configuring DNAT so that they can receive traffic from the external network.</p>\n			</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Translated Port</strong></td>\n			<td>(Optional) Select the port or port range that inbound traffic is connecting to on the virtual machines on the internal network. These ports are the ones into which the DNAT rule is translating for the packets inbound to the virtual machines.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Source IP address </strong></td>\n			<td>If you want the rule to apply only for traffic from a specific domain, enter an IP address for this domain or an IP address range in CIDR format. If you leave this text box blank, the DNAT rule applies to all IP addresses that are in the local subnet.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Source Port</strong></td>\n			<td>(Optional) Enter a port number for the source.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Description </strong></td>\n			<td>(Optional) Enter a meaningful description for the DNAT rule.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Enabled </strong></td>\n			<td>Toggle on to enable this rule.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Enable logging</strong></td>\n			<td>Toggle on to have the address translation performed by this rule logged</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"5\">\n	<li>Configure a Source NAT rule (inside going outside).</li>\n</ol>\n\n<table border=\"1\" bordercolor=\"#ccc\" cellpadding=\"5\" cellspacing=\"0\" style=\"border-collapse:collapse; width:500px\">\n	<tbody>\n		<tr>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Option</strong></td>\n			<td style=\"background-color:#66ffff; text-align:justify\"><strong>Description</strong></td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Accept</strong></td>\n			<td style=\"text-align:justify\">Allows traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n		<tr>\n			<td style=\"text-align:center\"><strong>Deny</strong></td>\n			<td>Blocks traffic from or to the specified sources, destinations, and services.</td>\n		</tr>\n	</tbody>\n</table>\n\n<ol start=\"6\">\n	<li>Click Keep to add the rule to the on-screen table.</li>\n	<li>Repeat the steps to configure additional rules.</li>\n	<li>Click Save changes to save the rules to the system.</li>\n</ol>'),
(377, 85, 'edit', 'documentation_translations', 'description', 45, '<p>Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p>Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:553px; width:602px\" /></span></span></span></p>\n\n<p>Tampilan operating system</p>\n\n<p>Tampilan instance image</p>\n\n<p>Tampilan authentication SSH keys</p>\n\n<p>Tampilan authentication password</p>\n\n<p>Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p><strong>Melihat Detail Instance </strong></p>\n\n<p>Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p>Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p>Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p>Detail storage akan masuk ke menu storage.</p>\n\n<p>Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p>Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p>Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p>Detail delete menampilkan halaman delete instance.</p>', '<p style=\"text-align:justify\">Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:553px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Tampilan operating system</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/413b8bfce4e5c5b7410066d355b29f21402067.png\" style=\"height:229px; width:1075px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan instance image</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/fd526aa7625fcc0b6b69f4b261893248674489.png\" style=\"height:250px; width:741px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication SSH keys</p>\n\n<p style=\"text-align:justify\">Tampilan authentication password</p>\n\n<p style=\"text-align:justify\">Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p style=\"text-align:justify\"><strong>Melihat Detail Instance </strong></p>\n\n<p style=\"text-align:justify\">Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p style=\"text-align:justify\">Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p style=\"text-align:justify\">Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p style=\"text-align:justify\">Detail storage akan masuk ke menu storage.</p>\n\n<p style=\"text-align:justify\">Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p style=\"text-align:justify\">Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p style=\"text-align:justify\">Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p style=\"text-align:justify\">Detail delete menampilkan halaman delete instance.</p>'),
(378, 86, 'edit', 'documentation_translations', 'description', 45, '<p style=\"text-align:justify\">Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:553px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Tampilan operating system</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/413b8bfce4e5c5b7410066d355b29f21402067.png\" style=\"height:229px; width:1075px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan instance image</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/fd526aa7625fcc0b6b69f4b261893248674489.png\" style=\"height:250px; width:741px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication SSH keys</p>\n\n<p style=\"text-align:justify\">Tampilan authentication password</p>\n\n<p style=\"text-align:justify\">Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p style=\"text-align:justify\"><strong>Melihat Detail Instance </strong></p>\n\n<p style=\"text-align:justify\">Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p style=\"text-align:justify\">Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p style=\"text-align:justify\">Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p style=\"text-align:justify\">Detail storage akan masuk ke menu storage.</p>\n\n<p style=\"text-align:justify\">Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p style=\"text-align:justify\">Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p style=\"text-align:justify\">Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p style=\"text-align:justify\">Detail delete menampilkan halaman delete instance.</p>', '<p style=\"text-align:justify\">Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:553px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Tampilan operating system</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/413b8bfce4e5c5b7410066d355b29f21402067.png\" style=\"height:229px; width:1075px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan instance image</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/fd526aa7625fcc0b6b69f4b261893248674489.png\" style=\"height:250px; width:741px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication SSH keys</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6188afe7ccd622892e64f9ec8c0a1053645923.png\" style=\"height:508px; width:733px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication password</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/2b58ece2f638d3dd15f2b3076bcbf8ed875363.png\" style=\"height:320px; width:788px\" /></p>\n\n<p style=\"text-align:justify\">Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p style=\"text-align:justify\"><strong>Melihat Detail Instance </strong></p>\n\n<p style=\"text-align:justify\">Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/07b358f39cc86e70cc5da3ac04387cd2965203.png\" style=\"height:580px; width:1138px\" /></p>\n\n<p style=\"text-align:justify\">Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/ecb74eca6b7a45c0e1c29e34685e8e83946530.png\" style=\"height:1126px; width:1013px\" /></p>\n\n<p style=\"text-align:justify\">Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/e76865926b026fe9d164ed825101af16465563.png\" style=\"height:706px; width:1086px\" /></p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/c67ed5bf6b6b0aa750889945509ea945495001.jpg\" style=\"height:385px; width:673px\" /></p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/58b373a712f210b8ca27452d7a95f815288121.jpg\" style=\"height:314px; width:703px\" /></p>\n\n<p style=\"text-align:justify\">Detail storage akan masuk ke menu storage.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/9840c3c3044ffc83d84d361cfd16ce46438616.png\" style=\"height:603px; width:1292px\" /></p>\n\n<p style=\"text-align:justify\">Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/a722cd2bac12a0dded508d11db849f4c654833.png\" style=\"height:578px; width:1257px\" /></p>\n\n<p style=\"text-align:justify\">Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/d1babd154ed522318077ea93c5ad4162301624.png\" style=\"height:647px; width:1291px\" /></p>\n\n<p style=\"text-align:justify\">Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/519170509ba7e005aa7782ed1d322fb4854283.png\" style=\"height:732px; width:1202px\" /></p>\n\n<p style=\"text-align:justify\">Detail delete menampilkan halaman delete instance.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/3757d074ee809ac4738d42c48d2663c1609024.png\" style=\"height:532px; width:1158px\" /></p>'),
(379, 87, 'edit', 'documentation_translations', 'description', 46, '<p>Halaman ini menampilkan list storage yang terdiri dari nama, size, instance name, region, created date, dan tombol action. Klik tombol Create Storage untuk membuat storage baru.</p>\n\n<p>Untuk membuat Storage, lengkapi kolom dengan pilih volume size, pilih instance, isi nama volume lalu klik tombol Create Storage.</p>\n\n<p>Selanjutnya, storage yang telah dibuat akan muncul di halaman list Storage.</p>', '<p>Halaman ini menampilkan list storage yang terdiri dari nama, size, instance name, region, created date, dan tombol action. Klik tombol Create Storage untuk membuat storage baru.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/59d17e7caa7de4ef00f399d80b84f271817547.png\" style=\"height:372px; width:1285px\" /></p>\n\n<p>Untuk membuat Storage, lengkapi kolom dengan pilih volume size, pilih instance, isi nama volume lalu klik tombol Create Storage.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/9b9493585cf05d1405bf5d89a8f7d2d0836738.png\" style=\"height:660px; width:1103px\" /></p>\n\n<p>Selanjutnya, storage yang telah dibuat akan muncul di halaman list Storage.</p>'),
(380, 88, 'edit', 'documentation_translations', 'description', 47, '<p>Menu image ini memiliki submenu Snapshot dan Custom image.</p>\n\n<ul>\n	<li>Snapshot</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan sanpshot for instance dan snapshot for storage.</p>\n\n<ul>\n	<li>Custom Image</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list image yang terdiri dari image, status, created date, dan tombol action. User dapat melakukan custom image dengan import via URL.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolo dengan mengisi nama image, nomor version, dan image URL lalu klik tombol Import.</p>', '<p>Menu image ini memiliki submenu Snapshot dan Custom image.</p>\n\n<ul>\n	<li>Snapshot</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan sanpshot for instance dan snapshot for storage.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/82938d5a00865041d5158af1c9e71c7d193428.jpg\" style=\"height:476px; width:750px\" /></p>\n\n<ul>\n	<li>Custom Image</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list image yang terdiri dari image, status, created date, dan tombol action. User dapat melakukan custom image dengan import via URL.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/21e741d23580c9778bb09c322daa7852709825.png\" style=\"height:250px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Lengkapi kolo dengan mengisi nama image, nomor version, dan image URL lalu klik tombol Import.</p>'),
(381, 89, 'edit', 'documentation_translations', 'description', 48, '<p>Menu image ini memiliki submenu VPC, Floating IPs, dan Load balancer.</p>\n\n<ul>\n	<li>VPC</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list VPC terdiri dari nama, region, available IP, resource in this VPC dan tombol action. User dapat membuat VPC, mengedit dan menghapus VPC.</p>\n\n<p style=\"margin-left:40px\">Untuk membuat VPC network, lengkapi kolom nama, deskripsi, dan configure IP range lalu klik tombol Create VPC Network.</p>\n\n<p style=\"margin-left:40px\">Selanjutnya, VPC yang telah dibuat akan muncul di halaman list VPC Network.</p>\n\n<p style=\"margin-left:40px\">Untuk mengedit VPC network, edit kolom yang akan diubah lalu klik tombol Save untuk menyimpan.</p>\n\n<ul>\n	<li>Floating IPs</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan assign floating IP, reassign, unassign dan delete floating IP.</p>', '<p>Menu image ini memiliki submenu VPC, Floating IPs, dan Load balancer.</p>\n\n<ul>\n	<li>VPC</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini menampilkan list VPC terdiri dari nama, region, available IP, resource in this VPC dan tombol action. User dapat membuat VPC, mengedit dan menghapus VPC.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/3934a05064b6501c3689376758074f41630242.png\" style=\"height:246px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Untuk membuat VPC network, lengkapi kolom nama, deskripsi, dan configure IP range lalu klik tombol Create VPC Network.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/23b7ae74f2f96af9549aaedf7cb4db07789297.png\" style=\"height:458px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Selanjutnya, VPC yang telah dibuat akan muncul di halaman list VPC Network.</p>\n\n<p style=\"margin-left:40px\">Untuk mengedit VPC network, edit kolom yang akan diubah lalu klik tombol Save untuk menyimpan.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/72b57cfaf2158e6669804655c1a30a01785121.png\" style=\"height:511px; width:750px\" /></p>\n\n<ul>\n	<li>Floating IPs</li>\n</ul>\n\n<p style=\"margin-left:40px\">User dapat melakukan assign floating IP, reassign, unassign dan delete floating IP.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/1a3b5f1b06178f9a4f546f7c11062244964104.png\" style=\"height:325px; width:750px\" /></p>'),
(382, 90, 'edit', 'documentation_translations', 'description', 49, '<p>Menu ini menampilkan list security yang terdiri dari nama, applied to, rules, created by dan tombol action untuk mengedit dan menghapus data. User juga dapat membuat security dengan klik tombol Create Security.</p>\n\n<p>Untuk membuat security, lengkapi kolom nama, inbound role dan outbound role, apply to instance lalu klik tombol Create Security Firewall.</p>\n\n<p>Untuk melihat detail security, pilih salah satu nama security. Detail terdiri dari rules, instance dan destroy.</p>\n\n<p>Detail rules menampilkan Inbound Rule dan Outbound Rule yang terdiri dari type, protocol, ethertype, port range dan source.</p>\n\n<p><strong>Organization</strong></p>\n\n<p>Menu ini terdiri dari beberapa submenu diantaranya: Manage Role, Setting Organization, List Project, Service Limit, dan Audit Log.</p>\n\n<ul>\n	<li>Manage Role</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat list nama role, deskripsi dan tombol action untuk mengedit. User juga dapat membuat role baru.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Create New Role</span></p>\n\n<p style=\"margin-left:40px\">Untuk membuat role baru, klik tombol Create New Role.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom dengan mengisi nama role, deskripsi, dan pilih privilages access dan permission dengan menggeser toggle button ke kanan untuk mengaktifkan, lalu pilih permission editor atau viewer lalu klik tombol Save Role.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Edit Role</span></p>\n\n<p style=\"margin-left:40px\">Untuk mengedit role, klik tombol Edit.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom yang akan diedit lalu klik tombol Save Role.</p>\n\n<ul>\n	<li>Setting Organization</li>\n</ul>\n\n<p style=\"margin-left:40px\">Di halaman ini, user dapat mengedit organisasi dan menambah member baru.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Edit Organization</span></p>\n\n<p style=\"margin-left:40px\">Klik tombol Edit Organization, lalu akan muncul popup edit.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom yang akan diedit lalu klik tombol Update.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Add New Member</span></p>\n\n<p style=\"margin-left:40px\">Klik tombol Add New Member, lalu akan muncul popup.</p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom nama member, email, nomor telepon, pilih project, dan pilih role lalu klik tombol Add.</p>\n\n<ul>\n	<li>List Project</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat daftar project yang telah dibuat.</p>\n\n<ul>\n	<li>Service Limit</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat limit dari instance dan storage.</p>\n\n<ul>\n	<li>Audit Log</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat audit log. User dapat mendownload data dengan klik tombol Download lalu pilih period days.</p>', '<p>Menu ini menampilkan list security yang terdiri dari nama, applied to, rules, created by dan tombol action untuk mengedit dan menghapus data. User juga dapat membuat security dengan klik tombol Create Security.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/bde9024518a1c5100211eacab7796017631048.jpg\" style=\"height:151px; width:750px\" /></p>\n\n<p>Untuk membuat security, lengkapi kolom nama, inbound role dan outbound role, apply to instance lalu klik tombol Create Security Firewall.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/0d26b650e44d7459d66b0a0b8d9ac517645809.png\" style=\"height:601px; width:750px\" /></p>\n\n<p>Untuk melihat detail security, pilih salah satu nama security. Detail terdiri dari rules, instance dan destroy.</p>\n\n<p>Detail rules menampilkan Inbound Rule dan Outbound Rule yang terdiri dari type, protocol, ethertype, port range dan source.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/63f53db6051ff3b5ef191c6aa22cce97280183.png\" style=\"height:259px; width:500px\" /></p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/adf861b70b6eb6366630b842bdf505e1855559.png\" style=\"height:164px; width:500px\" /></p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/e68ada4fc6f8b221838f7adbaa09eefc228697.png\" style=\"height:131px; width:500px\" /></p>\n\n<p><strong>Organization</strong></p>\n\n<p>Menu ini terdiri dari beberapa submenu diantaranya: Manage Role, Setting Organization, List Project, Service Limit, dan Audit Log.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/3a7116c13f297c8b92d3b07f0a00e9c2815276.png\" style=\"height:268px; width:750px\" /></p>\n\n<ul>\n	<li>Manage Role</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat list nama role, deskripsi dan tombol action untuk mengedit. User juga dapat membuat role baru.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Create New Role</span></p>\n\n<p style=\"margin-left:40px\">Untuk membuat role baru, klik tombol Create New Role.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6fc46017c65e6265c7f6ed2baeadfaca435928.png\" style=\"height:278px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom dengan mengisi nama role, deskripsi, dan pilih privilages access dan permission dengan menggeser toggle button ke kanan untuk mengaktifkan, lalu pilih permission editor atau viewer lalu klik tombol Save Role.</p>\n\n<p style=\"margin-left:40px; text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/2fcb531ca87e0aad9d82e852058939ff601960.png\" style=\"height:1038px; width:500px\" /></p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Edit Role</span></p>\n\n<p style=\"margin-left:40px\">Untuk mengedit role, klik tombol Edit.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6fc46017c65e6265c7f6ed2baeadfaca856864.png\" style=\"height:278px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom yang akan diedit lalu klik tombol Save Role.</p>\n\n<p style=\"margin-left:40px; text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/a656c8582a68fef6090316c878c028dd554893.png\" style=\"height:1042px; width:500px\" /></p>\n\n<ul>\n	<li>Setting Organization</li>\n</ul>\n\n<p style=\"margin-left:40px\">Di halaman ini, user dapat mengedit organisasi dan menambah member baru.</p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Edit Organization</span></p>\n\n<p style=\"margin-left:40px\">Klik tombol Edit Organization, lalu akan muncul popup edit.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/49b1dbd51c9b9865c27bec8987409ca7846655.png\" style=\"height:389px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom yang akan diedit lalu klik tombol Update.</p>\n\n<p style=\"margin-left:40px; text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/44ecde137957d5c2d9e018420f4d890b590484.png\" style=\"height:613px; width:427px\" /></p>\n\n<p style=\"margin-left:40px\"><span style=\"color:#3498db\">Add New Member</span></p>\n\n<p style=\"margin-left:40px\">Klik tombol Add New Member, lalu akan muncul popup.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/49b1dbd51c9b9865c27bec8987409ca7683415.png\" style=\"height:389px; width:750px\" /></p>\n\n<p style=\"margin-left:40px\">Lengkapi kolom nama member, email, nomor telepon, pilih project, dan pilih role lalu klik tombol Add.</p>\n\n<p style=\"margin-left:40px; text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/5d38c69c7b4d539aea9e94984ad0afd3521821.png\" style=\"height:682px; width:500px\" /></p>\n\n<ul>\n	<li>List Project</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat daftar project yang telah dibuat.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/978ea28970bcd3ac5d737aa4ea446ebe722848.png\" style=\"height:274px; width:750px\" /></p>\n\n<ul>\n	<li>Service Limit</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat limit dari instance dan storage.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/b098a0ee7ab18dac77bcaeb5f993c242417112.png\" style=\"height:392px; width:750px\" /></p>\n\n<ul>\n	<li>Audit Log</li>\n</ul>\n\n<p style=\"margin-left:40px\">Halaman ini memuat audit log. User dapat mendownload data dengan klik tombol Download lalu pilih period days.</p>\n\n<p style=\"margin-left:40px\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/0d7433b2caf022cadbf7f5b68ce44ea4147377.png\" style=\"height:458px; width:750px\" /></p>\n\n<p style=\"margin-left:40px; text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/dacb31cfd503e47fb95d1a25df52756a886914.png\" style=\"height:66px; width:57px\" /></p>\n\n<p style=\"margin-left:40px; text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/335a7b7d2e47ecd0e8a87ef560a82a6f282569.png\" style=\"height:307px; width:426px\" /></p>'),
(383, 91, 'edit', 'documentation_translations', 'description', 50, '<p>Untuk keluar dari web Lintasarta Panel klik tombol Profile lalu klik tombol Logout.</p>', '<p>Untuk keluar dari web Lintasarta Panel klik tombol Profile lalu klik tombol Logout.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/1fa4fd6a4c92b4019946947126538a25927073.jpg\" style=\"height:241px; width:750px\" /></p>'),
(384, 93, 'edit', 'documentation_translations', 'file', 51, NULL, 'https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/8262ebd5da2995895d6b99e24f3a316f263352.docx');
INSERT INTO `log_details` (`id`, `log_id`, `action`, `table`, `column`, `record_id`, `old_value`, `new_value`) VALUES
(385, 94, 'edit', 'documentation_translations', 'description', 45, '<p style=\"text-align:justify\">Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:553px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Tampilan operating system</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/413b8bfce4e5c5b7410066d355b29f21402067.png\" style=\"height:229px; width:1075px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan instance image</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/fd526aa7625fcc0b6b69f4b261893248674489.png\" style=\"height:250px; width:741px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication SSH keys</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6188afe7ccd622892e64f9ec8c0a1053645923.png\" style=\"height:508px; width:733px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication password</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/2b58ece2f638d3dd15f2b3076bcbf8ed875363.png\" style=\"height:320px; width:788px\" /></p>\n\n<p style=\"text-align:justify\">Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p style=\"text-align:justify\"><strong>Melihat Detail Instance </strong></p>\n\n<p style=\"text-align:justify\">Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/07b358f39cc86e70cc5da3ac04387cd2965203.png\" style=\"height:580px; width:1138px\" /></p>\n\n<p style=\"text-align:justify\">Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/ecb74eca6b7a45c0e1c29e34685e8e83946530.png\" style=\"height:1126px; width:1013px\" /></p>\n\n<p style=\"text-align:justify\">Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/e76865926b026fe9d164ed825101af16465563.png\" style=\"height:706px; width:1086px\" /></p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/c67ed5bf6b6b0aa750889945509ea945495001.jpg\" style=\"height:385px; width:673px\" /></p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/58b373a712f210b8ca27452d7a95f815288121.jpg\" style=\"height:314px; width:703px\" /></p>\n\n<p style=\"text-align:justify\">Detail storage akan masuk ke menu storage.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/9840c3c3044ffc83d84d361cfd16ce46438616.png\" style=\"height:603px; width:1292px\" /></p>\n\n<p style=\"text-align:justify\">Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/a722cd2bac12a0dded508d11db849f4c654833.png\" style=\"height:578px; width:1257px\" /></p>\n\n<p style=\"text-align:justify\">Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/d1babd154ed522318077ea93c5ad4162301624.png\" style=\"height:647px; width:1291px\" /></p>\n\n<p style=\"text-align:justify\">Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/519170509ba7e005aa7782ed1d322fb4854283.png\" style=\"height:732px; width:1202px\" /></p>\n\n<p style=\"text-align:justify\">Detail delete menampilkan halaman delete instance.</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/3757d074ee809ac4738d42c48d2663c1609024.png\" style=\"height:532px; width:1158px\" /></p>', '<p style=\"text-align:justify\">Klik tombol Create Instance untuk membuat instance di project yang sudah dibuat.</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/-SzhWWfzF-Itdon0A8WXNdRU9LoaKOWiQyumHqAhZ7fsjWJ3Kf2QW26bbPSYfvAfmmqKwC94xWcWhsWqPVsppJztJdnwNRkX6Rin-41ECV8kE79pS4XjyJXBQT8o-jTys699B6Nj\" style=\"height:184px; width:602px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Untuk membuat Instance, lengkapi kolom dengan pilih Operating System atau Instance Image, pilih VPC network, pilih plan, add volume storage. Di menu Authentication pilih SSH keys dan password lalu klik tombol Create Instance.</p>\n\n<p style=\"text-align:center\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/GqLvio1Xdg4qYycqfMU6uILGtVhnCC0bCYu6XdJt8pz-towhtvE8jWwCuwozqm-crCkNBMby5-_uoFsS7Dv4aBLJtGNxlv8siSQX9gLL1QfWYU-XMXUYb6y-BX-0ul2ZewC8-e2T\" style=\"height:460px; width:500px\" /></span></span></span></p>\n\n<p style=\"text-align:justify\">Tampilan operating system</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/413b8bfce4e5c5b7410066d355b29f21402067.png\" style=\"height:107px; width:500px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan instance image</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/fd526aa7625fcc0b6b69f4b261893248674489.png\" style=\"height:169px; width:500px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication SSH keys</p>\n\n<p style=\"text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6188afe7ccd622892e64f9ec8c0a1053645923.png\" style=\"height:508px; width:733px\" /></p>\n\n<p style=\"text-align:justify\">Tampilan authentication password</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/2b58ece2f638d3dd15f2b3076bcbf8ed875363.png\" style=\"height:203px; width:500px\" /></p>\n\n<p style=\"text-align:justify\">Setelah berhasil membuat instance, data akan masuk ke halaman list instance. User dapat melakukan Add floating IP, Access Console, Resize Instance, View Usage, Create Snapshot dan Delete Instance dengan klik tombol More atau klik nama instance untuk melihat detail.</p>\n\n<p style=\"text-align:justify\"><strong>Melihat Detail Instance </strong></p>\n\n<p style=\"text-align:justify\">Halaman ini menampilkan nama, IP address, region, created date dan tombol action. Untuk melihat detail instance, klik salah satu nama instance.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/07b358f39cc86e70cc5da3ac04387cd2965203.png\" style=\"height:382px; width:750px\" /></p>\n\n<p style=\"text-align:justify\">Detail usage menampilkan grafik CPU usage, RAM usage, network usage. User dapat turn on/turn off instance dan open console.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/ecb74eca6b7a45c0e1c29e34685e8e83946530.png\" style=\"height:834px; width:750px\" /></p>\n\n<p style=\"text-align:justify\">Detail power menampilkan Turn off instance dan Power cycle.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/e76865926b026fe9d164ed825101af16465563.png\" style=\"height:488px; width:750px\" /></p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/c67ed5bf6b6b0aa750889945509ea945495001.jpg\" style=\"height:286px; width:500px\" /></p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/58b373a712f210b8ca27452d7a95f815288121.jpg\" style=\"height:223px; width:500px\" /></p>\n\n<p style=\"text-align:justify\">Detail storage akan masuk ke menu storage.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/9840c3c3044ffc83d84d361cfd16ce46438616.png\" style=\"height:350px; width:750px\" /></p>\n\n<p style=\"text-align:justify\">Detail resize menampilkan halaman resize dari beberapa type (basic, intermediate dan pro). Pilih salah satu type kemudian klik tombol Resize.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/a722cd2bac12a0dded508d11db849f4c654833.png\" style=\"height:345px; width:750px\" /></p>\n\n<p style=\"text-align:justify\">Detail networking menampilkan halaman public network dan private network. Di Public Network, user dapat melakukan enable floating IP.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/d1babd154ed522318077ea93c5ad4162301624.png\" style=\"height:376px; width:750px\" /></p>\n\n<p style=\"text-align:justify\">Detail snapshot menampilkan halaman take snapshot dan snapshot list.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/519170509ba7e005aa7782ed1d322fb4854283.png\" style=\"height:457px; width:750px\" /></p>\n\n<p style=\"text-align:justify\">Detail delete menampilkan halaman delete instance.</p>\n\n<p style=\"text-align:center\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/3757d074ee809ac4738d42c48d2663c1609024.png\" style=\"height:345px; width:750px\" /></p>'),
(386, 95, 'edit', 'documentation_translations', 'description', 46, '<p>Halaman ini menampilkan list storage yang terdiri dari nama, size, instance name, region, created date, dan tombol action. Klik tombol Create Storage untuk membuat storage baru.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/59d17e7caa7de4ef00f399d80b84f271817547.png\" style=\"height:372px; width:1285px\" /></p>\n\n<p>Untuk membuat Storage, lengkapi kolom dengan pilih volume size, pilih instance, isi nama volume lalu klik tombol Create Storage.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/9b9493585cf05d1405bf5d89a8f7d2d0836738.png\" style=\"height:660px; width:1103px\" /></p>\n\n<p>Selanjutnya, storage yang telah dibuat akan muncul di halaman list Storage.</p>', '<p>Halaman ini menampilkan list storage yang terdiri dari nama, size, instance name, region, created date, dan tombol action. Klik tombol Create Storage untuk membuat storage baru.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/59d17e7caa7de4ef00f399d80b84f271817547.png\" style=\"height:217px; width:750px\" /></p>\n\n<p>Untuk membuat Storage, lengkapi kolom dengan pilih volume size, pilih instance, isi nama volume lalu klik tombol Create Storage.</p>\n\n<p><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/9b9493585cf05d1405bf5d89a8f7d2d0836738.png\" style=\"height:449px; width:750px\" /></p>\n\n<p>Selanjutnya, storage yang telah dibuat akan muncul di halaman list Storage.</p>'),
