(392, 97, 'create', 'documentation_translations', 'description', 59, NULL, '<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.1 NAVIGATE TO SSL VPN-PLUS</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Open <strong>Edge Gateway Services.</strong>\n\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>Navigate to <strong>Networking &gt; Edges</strong>.</li>\n		<li>Select the edge gateway to edit, and click <strong>Services</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align:justify\">Click the <strong>SSL VPN-Plus</strong> tab.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.2 CONFIGURE SSL VPN SERVER SETTING</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus screen</strong>, click <strong>Server Settings</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Enabled</strong>.</li>\n	<li style=\"text-align:justify\">Select an IP address from the drop-down menu.</li>\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> Enter a TCP port number.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">The TCP port number is used by the SSL client installation package. By default, the system uses port 443, which is the default port for HTTPS/SSL traffic. Even though a port number is required, you can set any TCP port for communications.</p>\n\n<p style=\"margin-left:40px; text-align:justify\"><strong>Note</strong>:The SSL VPN client requires the IP address and port configured here to be reachable from the client systems of your remote users. If you change the port number from the default, ensure that the IP address and port combination are reachable from the systems of your intended users.</p>\n\n<ol start=\"5\">\n	<li style=\"text-align:justify\">Select an encryption method from the cipher list.</li>\n	<li style=\"text-align:justify\">Configure the service Syslog logging policy.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">Logging is enabled by default. You can change the level of messages to log or disable logging.</p>\n\n<ol start=\"7\">\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> If you want to use a service certificate instead of the default system-generated self-signed certificate, click <strong>Change server certificate</strong>, selection a certificate, and click <strong>OK</strong>.</li>\n	<li style=\"text-align:justify\">Click Save <strong>changes</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.3 CREATE AN IP POOL</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>IP Pools</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Create </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the IP pool settings.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/80851e2edd0a0190d906d3e9e1bceb66163786.png\" style=\"height:418px; width:611px\" /></p>\n\n<ol start=\"4\">\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.4 ADD A PRIVATE NETWORK</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>Private Networks</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Add </strong>button.</li>\n	<li style=\"text-align:justify\">Configure the private network settings.</li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Save changes</strong> to save the configuration to the system.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.5 CONFIGURE AN AUTHENTICATION SERVICE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Click the <strong>SSL VPN-Plus</strong> tab and <strong>Authentication</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Local</strong>.</li>\n	<li style=\"text-align:justify\">Configure the authentication server settings.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Enable and configure the password policy<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/44ad833f84c957bcc7011b4668e41d29242141.png\" style=\"height:376px; width:564px\" /></li>\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Enable and configure the account lockout policy.<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/ee1adff2541b5c24aea173888335220e524236.png\" style=\"height:227px; width:563px\" /></li>\n		<li style=\"text-align:justify\">In the Status section, enable this authentication server.</li>\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Configure secondary authentication<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/7673de0c29b93469a39b4d96f15d6296904809.png\" style=\"height:111px; width:564px\" /></li>\n		<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	</ol>\n	</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.6 ADD SSL VPN PLUS USERS</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>Users</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Create </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the following options for the user.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/76afb4b4b31ef8d7a86a5946d4a78e93610462.png\" style=\"height:299px; width:610px\" /></li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	<li style=\"text-align:justify\">Repeat the steps to add additional users.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.7 ADD AN SSL VPN-PLUS CLIENT INSTALLATION PACKAGE</span></p>\n\n<ol>\n	<li style=\"text-align: justify;\">On the <strong>SSL VPN-Plus</strong> tab in the tenant portal, click Installation <strong>Packages</strong>.&nbsp;</li>\n	<li style=\"text-align: justify;\">Click the <strong>Add </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align: justify;\">Configure the installation package settings.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6c12a693dc484838be65597ecedd331a313859.png\" style=\"height:390px; width:612px\" /></li>\n	<li style=\"text-align: justify;\">Select the installation parameters for Windows.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/07ec8f361c067f1b7d14686915e33a71614407.png\" style=\"height:330px; width:612px\" /></li>\n	<li style=\"text-align: justify;\">Click <strong>Keep</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.8 DOWNLOAD SSL VPN PLUS INSTALLATION PACKAGE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Access to <a href=\"https://ssl_vpn-plus_server_ip/\" target=\"_blank\">https://SSL_VPN-Plus_SERVER_IP:443 </a></li>\n	<li style=\"text-align:justify\">Enter username and password</li>\n	<li style=\"text-align:justify\">Download installation package</li>\n</ol>'),
(398, 98, 'edit', 'documentation_translations', 'description', 59, '<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.1 NAVIGATE TO SSL VPN-PLUS</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Open <strong>Edge Gateway Services.</strong>\n\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>Navigate to <strong>Networking &gt; Edges</strong>.</li>\n		<li>Select the edge gateway to edit, and click <strong>Services</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align:justify\">Click the <strong>SSL VPN-Plus</strong> tab.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.2 CONFIGURE SSL VPN SERVER SETTING</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus screen</strong>, click <strong>Server Settings</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Enabled</strong>.</li>\n	<li style=\"text-align:justify\">Select an IP address from the drop-down menu.</li>\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> Enter a TCP port number.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">The TCP port number is used by the SSL client installation package. By default, the system uses port 443, which is the default port for HTTPS/SSL traffic. Even though a port number is required, you can set any TCP port for communications.</p>\n\n<p style=\"margin-left:40px; text-align:justify\"><strong>Note</strong>:The SSL VPN client requires the IP address and port configured here to be reachable from the client systems of your remote users. If you change the port number from the default, ensure that the IP address and port combination are reachable from the systems of your intended users.</p>\n\n<ol start=\"5\">\n	<li style=\"text-align:justify\">Select an encryption method from the cipher list.</li>\n	<li style=\"text-align:justify\">Configure the service Syslog logging policy.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">Logging is enabled by default. You can change the level of messages to log or disable logging.</p>\n\n<ol start=\"7\">\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> If you want to use a service certificate instead of the default system-generated self-signed certificate, click <strong>Change server certificate</strong>, selection a certificate, and click <strong>OK</strong>.</li>\n	<li style=\"text-align:justify\">Click Save <strong>changes</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.3 CREATE AN IP POOL</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>IP Pools</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Create </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the IP pool settings.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/80851e2edd0a0190d906d3e9e1bceb66163786.png\" style=\"height:418px; width:611px\" /></p>\n\n<ol start=\"4\">\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.4 ADD A PRIVATE NETWORK</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>Private Networks</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Add </strong>button.</li>\n	<li style=\"text-align:justify\">Configure the private network settings.</li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Save changes</strong> to save the configuration to the system.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.5 CONFIGURE AN AUTHENTICATION SERVICE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Click the <strong>SSL VPN-Plus</strong> tab and <strong>Authentication</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Local</strong>.</li>\n	<li style=\"text-align:justify\">Configure the authentication server settings.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Enable and configure the password policy<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/44ad833f84c957bcc7011b4668e41d29242141.png\" style=\"height:376px; width:564px\" /></li>\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Enable and configure the account lockout policy.<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/ee1adff2541b5c24aea173888335220e524236.png\" style=\"height:227px; width:563px\" /></li>\n		<li style=\"text-align:justify\">In the Status section, enable this authentication server.</li>\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Configure secondary authentication<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/7673de0c29b93469a39b4d96f15d6296904809.png\" style=\"height:111px; width:564px\" /></li>\n		<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	</ol>\n	</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.6 ADD SSL VPN PLUS USERS</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>Users</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Create </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the following options for the user.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/76afb4b4b31ef8d7a86a5946d4a78e93610462.png\" style=\"height:299px; width:610px\" /></li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	<li style=\"text-align:justify\">Repeat the steps to add additional users.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.7 ADD AN SSL VPN-PLUS CLIENT INSTALLATION PACKAGE</span></p>\n\n<ol>\n	<li style=\"text-align: justify;\">On the <strong>SSL VPN-Plus</strong> tab in the tenant portal, click Installation <strong>Packages</strong>.&nbsp;</li>\n	<li style=\"text-align: justify;\">Click the <strong>Add </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align: justify;\">Configure the installation package settings.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6c12a693dc484838be65597ecedd331a313859.png\" style=\"height:390px; width:612px\" /></li>\n	<li style=\"text-align: justify;\">Select the installation parameters for Windows.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/07ec8f361c067f1b7d14686915e33a71614407.png\" style=\"height:330px; width:612px\" /></li>\n	<li style=\"text-align: justify;\">Click <strong>Keep</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.8 DOWNLOAD SSL VPN PLUS INSTALLATION PACKAGE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Access to <a href=\"https://ssl_vpn-plus_server_ip/\" target=\"_blank\">https://SSL_VPN-Plus_SERVER_IP:443 </a></li>\n	<li style=\"text-align:justify\">Enter username and password</li>\n	<li style=\"text-align:justify\">Download installation package</li>\n</ol>', '<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.1 NAVIGATE TO SSL VPN-PLUS</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Open <strong>Edge Gateway Services.</strong>\n\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>Navigate to <strong>Networking &gt; Edges</strong>.</li>\n		<li>Select the edge gateway to edit, and click <strong>Services</strong>.</li>\n	</ol>\n	</li>\n	<li style=\"text-align:justify\">Click the <strong>SSL VPN-Plus</strong> tab.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.2 CONFIGURE SSL VPN SERVER SETTING</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus screen</strong>, click <strong>Server Settings</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Enabled</strong>.</li>\n	<li style=\"text-align:justify\">Select an IP address from the drop-down menu.</li>\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> Enter a TCP port number.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">The TCP port number is used by the SSL client installation package. By default, the system uses port 443, which is the default port for HTTPS/SSL traffic. Even though a port number is required, you can set any TCP port for communications.</p>\n\n<p style=\"margin-left:40px; text-align:justify\"><strong>Note</strong>:The SSL VPN client requires the IP address and port configured here to be reachable from the client systems of your remote users. If you change the port number from the default, ensure that the IP address and port combination are reachable from the systems of your intended users.</p>\n\n<ol start=\"5\">\n	<li style=\"text-align:justify\">Select an encryption method from the cipher list.</li>\n	<li style=\"text-align:justify\">Configure the service Syslog logging policy.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\">Logging is enabled by default. You can change the level of messages to log or disable logging.</p>\n\n<ol start=\"7\">\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> If you want to use a service certificate instead of the default system-generated self-signed certificate, click <strong>Change server certificate</strong>, selection a certificate, and click <strong>OK</strong>.</li>\n	<li style=\"text-align:justify\">Click Save <strong>changes</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.3 CREATE AN IP POOL</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>IP Pools</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Create </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the IP pool settings.</li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\"><img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/80851e2edd0a0190d906d3e9e1bceb66163786.png\" style=\"height:418px; width:611px\" /></p>\n\n<ol start=\"4\">\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.4 ADD A PRIVATE NETWORK</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>Private Networks</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Add </strong>button.</li>\n	<li style=\"text-align:justify\">Configure the private network settings.</li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Save changes</strong> to save the configuration to the system.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.5 CONFIGURE AN AUTHENTICATION SERVICE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Click the <strong>SSL VPN-Plus</strong> tab and <strong>Authentication</strong>.</li>\n	<li style=\"text-align:justify\">Click <strong>Local</strong>.</li>\n	<li style=\"text-align:justify\">Configure the authentication server settings.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Enable and configure the password policy<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/44ad833f84c957bcc7011b4668e41d29242141.png\" style=\"height:376px; width:564px\" /></li>\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Enable and configure the account lockout policy.<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/ee1adff2541b5c24aea173888335220e524236.png\" style=\"height:227px; width:563px\" /></li>\n		<li style=\"text-align:justify\">In the Status section, enable this authentication server.</li>\n		<li style=\"text-align:justify\"><strong>(Optional)</strong> Configure secondary authentication<br />\n		<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/7673de0c29b93469a39b4d96f15d6296904809.png\" style=\"height:111px; width:564px\" /></li>\n		<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	</ol>\n	</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.6 ADD SSL VPN PLUS USERS</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab, click <strong>Users</strong>.</li>\n	<li style=\"text-align:justify\">Click the <strong>Create </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the following options for the user.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/76afb4b4b31ef8d7a86a5946d4a78e93610462.png\" style=\"height:299px; width:610px\" /></li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n	<li style=\"text-align:justify\">Repeat the steps to add additional users.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.7 ADD AN SSL VPN-PLUS CLIENT INSTALLATION PACKAGE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">On the <strong>SSL VPN-Plus</strong> tab in the tenant portal, click Installation <strong>Packages</strong>.&nbsp;</li>\n	<li style=\"text-align:justify\">Click the <strong>Add </strong>( <strong>+</strong> ) button.</li>\n	<li style=\"text-align:justify\">Configure the installation package settings.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/6c12a693dc484838be65597ecedd331a313859.png\" style=\"height:390px; width:612px\" /></li>\n	<li style=\"text-align:justify\">Select the installation parameters for Windows.<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/07ec8f361c067f1b7d14686915e33a71614407.png\" style=\"height:330px; width:612px\" /></li>\n	<li style=\"text-align:justify\">Click <strong>Keep</strong>.</li>\n</ol>\n\n<p style=\"text-align:justify\"><span style=\"color:#f39c12\">3.3.8 DOWNLOAD SSL VPN PLUS INSTALLATION PACKAGE</span></p>\n\n<ol>\n	<li style=\"text-align:justify\">Access to <a href=\"https://ssl_vpn-plus_server_ip/\" target=\"_blank\">https://SSL_VPN-Plus_SERVER_IP:443 </a></li>\n	<li style=\"text-align:justify\">Enter username and password</li>\n	<li style=\"text-align:justify\">Download installation package</li>\n</ol>'),
