(409, 102, 'create', 'documentation_translations', 'title', 61, NULL, '4.1.   UPLOAD MEDIA FILES'),
(410, 102, 'create', 'documentation_translations', 'description', 61, NULL, '<ol>\n	<li style=\"text-align: justify;\">In the top navigation bar, click <strong>Libraries </strong>and, in the left panel, select <strong>Media &amp; Other</strong>.<br />\n	The list of media files appears in a grid view.</li>\n	<li style=\"text-align: justify;\">Click <strong>Add</strong>.</li>\n	<li style=\"text-align: justify;\">From the <strong>Catalog </strong>drop-down menu, select a catalog to which you want to upload the media file.</li>\n	<li style=\"text-align: justify;\">Enter a name for the media file.<br />\n	<br />\n	If you do not enter a name, the name text box is populated automatically after the name of the media file.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click the upload icon ( ) to browse and select the disk image file, for example an .iso file.</li>\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.<br />\n	<br />\n	After the upload starts, the media file appears in the grid</li>\n</ol>'),
