(415, 103, 'create', 'documentation_translations', 'title', 62, NULL, '4.2.   DELETE MEDIA FILES'),
(416, 103, 'create', 'documentation_translations', 'description', 62, NULL, '<ol>\n	<li style=\"text-align: justify;\">In the top navigation bar, click <strong>Libraries </strong>and, in the left panel, select <strong>Media &amp; Other</strong>.<br />\n	<br />\n	The list of media files appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click the list bar ( ) on the left of the media file you want to delete, and select <strong>Delete</strong>.</li>\n	<li style=\"text-align: justify;\">Confirm the deletion.<br />\n	<br />\n	The deleted media file is removed from the grid view.</li>\n</ol>'),
