(437, 107, 'create', 'documentation_translations', 'description', 65, NULL, '<ol>\n	<li style=\"text-align: justify;\">In the top navigation bar, click <strong>Libraries</strong>, and, in the left panel, select <strong>Catalogs</strong>.<br />\n	<br />\n	The list of catalogs appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> Configure the grid view to contain elements you want to see.\n	<ol start=\"1\" style=\"list-style-type:lower-alpha\">\n		<li>From the grid view, click the grid editor icon ( ) displayed below the list of catalogs.</li>\n		<li>Select the elements you want to include in the grid view, such as version, description, status, and so on.</li>\n		<li>Click <strong>OK</strong>.&nbsp;</li>\n	</ol>\n	</li>\n</ol>\n\n<p style=\"margin-left:40px\">The grid displays the elements you selected for each catalog.</p>\n\n<ol start=\"3\">\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> From the grid view, use the list bar ( ) to display the actions you can take for each catalog.<br />\n	<br />\n	For example, you can share or delete a catalog.</li>\n</ol>'),
