(445, 109, 'edit', 'documentation_translations', 'description', 66, '<ol>\n	<li style=\"text-align: justify;\">In the top navigation bar, click <strong>Libraries</strong>, and, in the left panel, select <strong>Catalogs</strong>.<br />\n	<br />\n	The list of catalogs appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click New to create a new catalog.</li>\n	<li style=\"text-align: justify;\">Enter the name and, optionally, a description of the catalog.</li>\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> Select whether you want to assign a storage policy to the catalog, and select a storage policy.</li>\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.</li>\n</ol>', '<ol>\n	<li style=\"text-align:justify\">In the top navigation bar, click <strong>Libraries</strong>, and, in the left panel, select <strong>Catalogs</strong>.<br />\n	<br />\n	The list of catalogs appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align:justify\">Click New to create a new catalog.</li>\n	<li style=\"text-align:justify\">Enter the name and, optionally, a description of the catalog.</li>\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> Select whether you want to assign a storage policy to the catalog, and select a storage policy.</li>\n	<li style=\"text-align:justify\">Click <strong>OK</strong>.</li>\n</ol>'),
