(450, 110, 'create', 'documentation_translations', 'title', 67, NULL, '5.3.   SHARE A CATALOG'),
(451, 110, 'create', 'documentation_translations', 'description', 67, NULL, '<ol>\n	<li style=\"text-align: justify;\">In the top navigation bar, click <strong>Libraries</strong>, and, in the left panel, select <strong>Catalogs</strong>.<br />\n	<br />\n	The list of catalogs appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click the list bar ( ) on the left of the catalog you want to share, and select <strong>Share</strong>.<br />\n	<br />\n	The list of users who can access the catalog appears in the grid view of the <strong>Share Catalog</strong> window.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click <strong>Add </strong>to share the catalog with other users.<br />\n	<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/7839579791760188a8e80d95c44415cc880725.png\" style=\"height:112px; width:612px\" /><br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Select the access level.<br />\n	<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/68b3d442e67394191c211b78d57daacd118967.png\" style=\"height:136px; width:611px\" /><br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.<br />\n	<br />\n	The users or groups that now have access to the catalog appear in the grid view of the Share Catalog dialog box.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> Select to share read-only access to the administrators of all other organizations</li>\n	<li style=\"text-align: justify;\">Click <strong>Save</strong>.</li>\n</ol>'),
(452, 111, 'edit', 'documentation_translations', 'description', 67, '<ol>\n	<li style=\"text-align: justify;\">In the top navigation bar, click <strong>Libraries</strong>, and, in the left panel, select <strong>Catalogs</strong>.<br />\n	<br />\n	The list of catalogs appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click the list bar ( ) on the left of the catalog you want to share, and select <strong>Share</strong>.<br />\n	<br />\n	The list of users who can access the catalog appears in the grid view of the <strong>Share Catalog</strong> window.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click <strong>Add </strong>to share the catalog with other users.<br />\n	<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/7839579791760188a8e80d95c44415cc880725.png\" style=\"height:112px; width:612px\" /><br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Select the access level.<br />\n	<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/68b3d442e67394191c211b78d57daacd118967.png\" style=\"height:136px; width:611px\" /><br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\">Click <strong>OK</strong>.<br />\n	<br />\n	The users or groups that now have access to the catalog appear in the grid view of the Share Catalog dialog box.<br />\n	&nbsp;</li>\n	<li style=\"text-align: justify;\"><strong>(Optional)</strong> Select to share read-only access to the administrators of all other organizations</li>\n	<li style=\"text-align: justify;\">Click <strong>Save</strong>.</li>\n</ol>', '<ol>\n	<li style=\"text-align:justify\">In the top navigation bar, click <strong>Libraries</strong>, and, in the left panel, select <strong>Catalogs</strong>.<br />\n	<br />\n	The list of catalogs appears in a grid view.<br />\n	&nbsp;</li>\n	<li style=\"text-align:justify\">Click the list bar ( ) on the left of the catalog you want to share, and select <strong>Share</strong>.<br />\n	<br />\n	The list of users who can access the catalog appears in the grid view of the <strong>Share Catalog</strong> window.<br />\n	&nbsp;</li>\n	<li style=\"text-align:justify\">Click <strong>Add </strong>to share the catalog with other users.<br />\n	<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/7839579791760188a8e80d95c44415cc880725.png\" style=\"height:112px; width:612px\" /><br />\n	&nbsp;</li>\n	<li style=\"text-align:justify\">Select the access level.<br />\n	<br />\n	<img alt=\"\" src=\"https://bucket.cloud.lintasarta.co.id:8082/cloudeka-dev/uploads/68b3d442e67394191c211b78d57daacd118967.png\" style=\"height:136px; width:611px\" /><br />\n	&nbsp;</li>\n	<li style=\"text-align:justify\">Click <strong>OK</strong>.<br />\n	<br />\n	The users or groups that now have access to the catalog appear in the grid view of the Share Catalog dialog box.<br />\n	&nbsp;</li>\n	<li style=\"text-align:justify\"><strong>(Optional)</strong> Select to share read-only access to the administrators of all other organizations</li>\n	<li style=\"text-align:justify\">Click <strong>Save</strong>.</li>\n</ol>'),
