(540, 129, 'edit', 'documentation_translations', 'title', 4, 'Google Cloud resources', 'Test Google Cloud resources'),
(541, 129, 'edit', 'documentation_translations', 'description', 4, '<p>Google Cloud consists of a set of physical assets, such as computers and hard disk drives, and virtual resources, such as virtual machines (VMs), that are contained in&nbsp;<a href=\"https://www.google.com/about/datacenters/\">Google&#39;s data centers</a>&nbsp;around the globe. Each data center location is in a&nbsp;<em>region</em>. Regions are available in Asia, Australia, Europe, North America, and South America. Each region is a collection of&nbsp;<em>zones</em>, which are isolated from each other within the region. Each zone is identified by a name that combines a letter identifier with the name of the region. For example, zone&nbsp;<code>a</code>&nbsp;in the East Asia region is named&nbsp;<code>asia-east1-a</code>.</p>\n\n<p>This distribution of resources provides several benefits, including redundancy in case of failure and reduced latency by locating resources closer to clients. This distribution also introduces some rules about how resources can be used together.</p>', '<p>Test Google Cloud consists of a set of physical assets, such as computers and hard disk drives, and virtual resources, such as virtual machines (VMs), that are contained in&nbsp;<a href=\"https://www.google.com/about/datacenters/\">Google&#39;s data centers</a>&nbsp;around the globe. Each data center location is in a&nbsp;<em>region</em>. Regions are available in Asia, Australia, Europe, North America, and South America. Each region is a collection of&nbsp;<em>zones</em>, which are isolated from each other within the region. Each zone is identified by a name that combines a letter identifier with the name of the region. For example, zone&nbsp;<code>a</code>&nbsp;in the East Asia region is named&nbsp;<code>asia-east1-a</code>.</p>\n\n<p>This distribution of resources provides several benefits, including redundancy in case of failure and reduced latency by locating resources closer to clients. This distribution also introduces some rules about how resources can be used together.</p>'),
