(550, 139, 'edit', 'documentation_translations', 'description', 2, '<p>This overview is designed to help you understand the overall landscape of Google Cloud. Here, you&#39;ll take a brief look at some of the commonly used features and get pointers to documentation that can help you go deeper. Knowing what&#39;s available and how the parts work together can help you make decisions about how to proceed. You&#39;ll also get pointers to some tutorials that you can use to try out Google Cloud in various scenarios.</p>', '<p>Test This overview is designed to help you understand the overall landscape of Google Cloud. Here, you&#39;ll take a brief look at some of the commonly used features and get pointers to documentation that can help you go deeper. Knowing what&#39;s available and how the parts work together can help you make decisions about how to proceed. You&#39;ll also get pointers to some tutorials that you can use to try out Google Cloud in various scenarios.</p>'),
