(622, 196, 'edit', 'documentation_translations', 'description', 41, '<p>Untuk user yang belum memiliki akun, silakan klik tombol Sign Up untuk membuat akun baru.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/FlfrcKcqltJqMA29QNkrAa6UIpLhWn233NGFsNOF50dR6NbKGld6Du-oO7XIVp3j-w-ujR5kjFlAuGmNNfe5lsND_PaP31eIvXVJifPB00rR95-JaXYX5NmU9GB348pT89mOIS7Q\" style=\"height:297px; width:602px\" /></span></span></span></p>\n\n<p>Selanjutnya, akan muncul halaman Sign Up. Lengkapi kolom dengan mengisi username, email, password, nomor handphone, dan nomor NPWP lalu klik tombol Sign Up untuk membuat akun.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/Rmx1guShWTDWxHpOuvxLxDhiLr3CPKZd-blFn7rWtMMHRQTIB4POSYcpZzmC30al4AW75keM9wRQRb1RS75vlWPtS9I81qNG3-sRt9Oby7pYPqyoJPWE8TM79mM1Fr1zt9ugRob2\" style=\"height:308px; width:602px\" /></span></span></span></p>\n\n<p>Setelah berhasil sign up, user akan menerima email verifikasi untuk mengaktifkan akun. Cek email, klik tombol verifikasi lalu kembali ke halaman Login.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/uTad6fiAl1ovWckYzoeLXpX9F_dVTdwTkuYOXIPJXUfj-gJKYfDJ8n_3H-uMTOncNnvyS_zlvmuy8ZjCR0OsfdQ0ofLWl-v3KegHMWhnvX8vc1AixYc5C35YyyOdJp3CZwurMYtX\" style=\"height:308px; width:602px\" /></span></span></span></p>', '<p>Untuk user yang belum memiliki akun, silakan klik tombol Sign Up untuk membuat akun baru.</p>\n\n<p><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/FlfrcKcqltJqMA29QNkrAa6UIpLhWn233NGFsNOF50dR6NbKGld6Du-oO7XIVp3j-w-ujR5kjFlAuGmNNfe5lsND_PaP31eIvXVJifPB00rR95-JaXYX5NmU9GB348pT89mOIS7Q\" st