(36, 46, 54, 'pahmil khoriji', 'Pusat Ilmu Komputer UI', 'pahmil@pusilkom.com', '+6282298523891', 'selamat malam. perkenalkan saya pahmil khoriji dari pusat ilmu komputer UI. saya ada kebutuhan private cloud dengan spek secara high level:\n- cpu 224 core\n- ram 512GB\n- Storage SAS usable 16.5TB\nsaya sangat berterimakasih jika dari lintasarta memberikan penawaran atau gambaran harga terkait kebutuhan saya diatas. Terimakasih.', '2021-10-05 13:40:19', '2021-10-05 13:40:19'),
(37, 43, 54, 'Estu Ardiyanto', 'PT Unibless Indo Multi', 'estu.adiyanto@unibless.co.id', '081311052060', 'Apakah untuk Paket Deka Prime (PX1) sudah termasuk penyediaan IP Public?', '2021-10-13 01:39:03', '2021-10-13 01:39:03'),
(38, 44, 58, 'Hardiyanto', 'PT Imani Prima', 'hardiyanto@imaniprima.co.id', '081210514664', 'Rekues penawaran Cloud Server', '2021-11-02 09:23:45', '2021-11-02 09:23:45'),
(39, 43, 54, 'Reza Arrofi', 'None', 'arrofireza23@gmail.com', '081918504360', 'Selamat Siang,\nperkenalkan nama saya Reza Arrofi, Saya adalah mahasiswa dari universitas mercu buana jakarta, disini saya sebagai perwakilan kelompok dari mata kuliah pengantar cloud computing.\nMaksud dan tujuan saya disini adalah ingin mencari tahu informasi cloud yang ada di perusahaan ini, untuk memenuhi tugas besar 2 mata kuliah pengantar cloud computing. Saya harap perusahaan ini dapat membantu saya memberi informasi dari pertanyaan-pertanyaan mengenai produk yang tersedia.\nTerimakasih, Salam Hangat, Reza Arrofi', '2021-11-13 06:16:24', '2021-11-13 06:16:24');
