/products/deka-box?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=cloud-object-storage\">Deka Box</a></strong> as a Public Cloud service for Object Storage (Cloud Object Storage). This Cloud Computing solution is very suitable for companies that have applications that require data storage of diverse and complex types, such as unstructured data.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/cloud-services//kontainerisasi-salah-satu-tren-cloud-computing-2021\">Containerization, One of the Cloud Computing Trends in 2021</a></strong></p>\r\n\r\n<p><strong><a href=\"http://www.cloudeka.id/id/products/deka-box?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=cloud-object-storage\">This Deka Box service</a></strong> is one of the Public Cloud products offered by Lintasarta for your company&#39;s data storage. In addition, there are other products such as <strong><a href=\"http://www.cloudeka.id/id/products/deka-vault?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=cloud-object-storage\">Deka Vault</a></strong> for Cloud Backup and Disaster Recovery.</p>\r\n\r\n<p>To find out more about Object Storage services from Lintasarta Cloudeka and other Public Cloud services, please <a href=\"http://www.cloudeka.id/id/contact-us?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=cloud-object-storage\"><strong>contact us</strong></a>.</p>', 'Cloud Computing Services (cloud computing) enable customers to access various computing resources over the Internet.', 'news/1efff2da6d3b19089b6f024514e2557a709696.jpeg', NULL, 'When Should Your Company Use Cloud Object Storage?', 'Cloud', 'Cloud Computing Services (cloud computing) enable customers to access various computing resources over the Internet.', 'id', '2021-09-14 16:26:34', '2021-09-14 16:26:34'),
(13, 7, 'BRI Life Customer Data Leaks, This is the Importance of Security for Company Devices', 'bri-life-customer-data-leaks-this-is-the-importance-of-security-for-company-devices', NULL, '<p>Some time ago, the Indonesian insurance industry was shocked by the news of the leak of customer data of BRI Life, a subsidiary of Bank Rakyat Indonesia. Initially, the data leak was claimed to cover 2 million BRI Life customers, although BRI Life later found that only about 25 thousand sharia policy holders might be affected by the hack. However, one thing that should be noted is the mode of burglary that is possible.</p>\r\n\r\n<p>The hackers are thought to have first <a href=\"http://tekno.kompas.com/read/2021/07/29/10010027/ini-dugaan-sumber-kebocoran-data-2-juta-nasabah-bri-life?page=all\">infiltrated the devices belonging to BRI Life employees</a>. The burglary of this employee&#39;s device is then suspected of helping hackers to gain early access to the BRI Life system. Although this mode has not been confirmed, this news makes us aware of the importance of securing employee-owned devices.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/solution/it-services/security-it-services//3-serangan-siber-yang-sering-menimpa-lembaga-pemerintahan-indonesia\">3 Cyber ​​Attacks That Often Affect Indonesian Government Institutions</a></strong></p>\r\n\r\n<p>A report says that, although at first glance executives and upper management should be attractive targets for hackers, <a href=\"http://www.techrepublic.com/article/hackers-are-targeting-these-employees-the-most-hint-its-not-the-c-suite/\">ordinary employees are now being targeted more by cybercriminals</a>.</p>\r\n\r\n<p>Some of the reasons that <a href=\"http://www.forbes.com/sites/tmobile/2021/02/24/5-reasons-hackers-target-mobile-devices-and-how-to-stop-them/?sh=64d793fa7b28\">motivate hackers</a> to target employees&#39; devices are password/credential theft, theft of company data, spying on executives and top management, and spreading ransomware/malware. And as may be the case with BRI Life, employee tools can be a stepping stone to enter the corporate network.</p>\r\n\r\n<p>In general, employee equipment can be provided by the company, especially when working in the office. However, nowadays more and more companies are allowing their employees to use their own devices for work (bring your own devices or BYOD). This trend is increasing when devices such as laptops and smart phones (smartphones) are increasingly affordable.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The advantages and disadvantages of BYOD</strong></p>\r\n\r\n<p>A survey from Bitglass in 2020, said that <a href=\"http://securitybrief.com.au/story/byod-security-in-remote-work-era-still-riddled-with-issues\">about 66%</a> of respondents allowed the practice of BYOD, and about 69% allowed employees to bring their own devices.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/article/industry-solutions//keuntungan-memilih-managed-security-operation-center\">These are the advantages if you choose the Managed Security Operation Center</a></strong></p>\r\n\r\n<p>In addition to the increasingly affordable price, the practice of BYOD is also said to bring various benefits. Here are some of the benefits of BYOD:</p>\r\n\r\n<ol>\r\n	<li>Employee productivity. A survey found that 42% of <a href=\"http://www.eweek.com/mobile/byod-programs-boost-productivity-efficiency/\">employees feel their productivity and efficiency have increased</a>.</li>\r\n	<li>Another benefit of BYOD is lower business costs, although the savings <a href=\"http://www.wired.com/brandlab/2018/12/byod-whats-roi/\">may not be that great</a>.</li>\r\n	<li>Easier for remote working. During the pandemic, the practice of BYOD is also encouraged because many offices require their employees to work from home. In this case, it is generally easier and cheaper to let employees choose their own tools to work from home.</li>\r\n</ol>\r\n\r\n<p>In reality, not all companies are comfortable with this practice. The most obvious drawback of BYOD is in terms of cybersecurity. While BYOD is generally welcomed by employees, this practice is not always welcomed by IT staff who secure enterprise systems.</p>\r\n\r\n<ol>\r\n	<li>Quite a number of BYOD devices are not managed by the company&#39;s IT staff. This means that device and network administration is the employee&#39;s responsibility. Even though not all employees are orderly in updating the operating system and software used, or installing antivirus/antimalware and VPN. This results in the software and operating system being used not being up-to-date, and therefore more vulnerable to hacking.</li>\r\n	<li>The risk of data leakage due to theft and loss is greater on BYOD devices. This is mainly because these devices are usually mobile devices, not devices such as Personal Computers (desktop PCs) or servers. The same risk will also occur in mobile devices provided by the office. However, because devices like this can usually be managed by the company&#39;s IT staff, the risk of data leakage can be minimized with the remote wipe feature.</li>\r\n</ol>\r\n\r\n<p>It can be seen that the company&#39;s decision to provide its own equipment or allow BYOD has its advantages and disadvantages. Whatever decision is made, the obligation to protect employees&#39; devices is now increasingly urgent. What&#39;s more when more and more employees are working from outside the office.</p>\r\n\r\n<p>If the company allows its employees to use their own devices, it is highly recommended to establish <a href=\"http://www.cio.com/article/2395944/7-tips-for-establishing-a-successful-byod-policy.html\">a clear BYOD policy</a> and pay attention to cybersecurity aspects. Enterprises can leverage solutions such as Mobile Device Management (MDM) to help manage BYOD devices.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/solution/it-services/security-it-services//managed-soc-jawaban-untuk-operasi-keamanan-siber-yang-kompleks-dan-mahal\">Managed SOC, the Answer to Complex and Expensive Cybersecurity Operations</a></strong></p>\r\n\r\n<p>To further protect employees from cyber threats, companies can use Managed Security services, including the <strong><a href=\"http://www.lintasarta.net/en/products-services/lintasarta-security/managed-security-operation-center/?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=data-nasabah-bri-life-bocor\">Managed Security</a></strong> Operation Center (SOC) from Lintasarta. <a href=\"http://www.lintasarta.net/en/products-services/lintasarta-security/managed-security-operation-center/?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=data-nasabah-bri-life-bocor\"><strong>Managed SOC</strong></a> services can monitor security 24 hours, 7 days a week, and detect and respond to cyber events within 15 minutes.</p>\r\n\r\n<p>To find out more about&nbsp;comprehensive security services provided by Lintasarta, <a href=\"http://www.lintasarta.net/en/contact-us/?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=data-nasabah-bri-life-bocor\"><strong>please contact us</strong></a>.</p>', 'Some time ago, the Indonesian insurance industry was shocked by the news of the leak of customer data of BRI Life, a subsidiary of Bank Rakyat Indonesia.', 'news/3b39c7b58f830787fc8c1176f482f7f8876163.jpeg', NULL, 'BRI Life Customer Data Leaks, This is the Importance of Security for Company Devices', 'Data security, lintasarta security', 'Some time ago, the Indonesian insurance industry was shocked by the news of the leak of customer data of BRI Life, a subsidiary of Bank Rakyat Indonesia.', 'en', '2021-09-14 16:28:37', '2021-09-14 16:28:37'),
(14, 7, 'BRI Life Customer Data Leaks, This is the Importance of Security for Company Devices', 'bri-life-customer-data-leaks-this-is-the-importance-of-security-for-company-devices', NULL, '<p>Some time ago, the Indonesian insurance industry was shocked by the news of the leak of customer data of BRI Life, a subsidiary of Bank Rakyat Indonesia. Initially, the data leak was claimed to cover 2 million BRI Life customers, although BRI Life later found that only about 25 thousand sharia policy holders might be affected by the hack. However, one thing that should be noted is the mode of burglary that is possible.</p>\r\n\r\n<p>The hackers are thought to have first <a href=\"http://tekno.kompas.com/read/2021/07/29/10010027/ini-dugaan-sumber-kebocoran-data-2-juta-nasabah-bri-life?page=all\">infiltrated the devices belonging to BRI Life employees</a>. The burglary of this employee&#39;s device is then suspected of helping hackers to gain early access to the BRI Life system. Although this mode has not been confirmed, this news makes us aware of the importance of securing employee-owned devices.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/solution/it-services/security-it-services//3-serangan-siber-yang-sering-menimpa-lembaga-pemerintahan-indonesia\">3 Cyber ​​Attacks That Often Affect Indonesian Government Institutions</a></strong></p>\r\n\r\n<p>A report says that, although at first glance executives and upper management should be attractive targets for hackers, <a href=\"http://www.techrepublic.com/article/hackers-are-targeting-these-employees-the-most-hint-its-not-the-c-suite/\">ordinary employees are now being targeted more by cybercriminals</a>.</p>\r\n\r\n<p>Some of the reasons that <a href=\"http://www.forbes.com/sites/tmobile/2021/02/24/5-reasons-hackers-target-mobile-devices-and-how-to-stop-them/?sh=64d793fa7b28\">motivate hackers</a> to target employees&#39; devices are password/credential theft, theft of company data, spying on executives and top management, and spreading ransomware/malware. And as may be the case with BRI Life, employee tools can be a stepping stone to enter the corporate network.</p>\r\n\r\n<p>In general, employee equipment can be provided by the company, especially when working in the office. However, nowadays more and more companies are allowing their employees to use their own devices for work (bring your own devices or BYOD). This trend is increasing when devices such as laptops and smart phones (smartphones) are increasingly affordable.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The advantages and disadvantages of BYOD</strong></p>\r\n\r\n<p>A survey from Bitglass in 2020, said that <a href=\"http://securitybrief.com.au/story/byod-security-in-remote-work-era-still-riddled-with-issues\">about 66%</a> of respondents allowed the practice of BYOD, and about 69% allowed employees to bring their own devices.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/article/industry-solutions//keuntungan-memilih-managed-security-operation-center\">These are the advantages if you choose the Managed Security Operation Center</a></strong></p>\r\n\r\n<p>In addition to the increasingly affordable price, the practice of BYOD is also said to bring various benefits. Here are some of the benefits of BYOD:</p>\r\n\r\n<ol>\r\n	<li>Employee productivity. A survey found that 42% of <a href=\"http://www.eweek.com/mobile/byod-programs-boost-productivity-efficiency/\">employees feel their productivity and efficiency have increased</a>.</li>\r\n	<li>Another benefit of BYOD is lower business costs, although the savings <a href=\"http://www.wired.com/brandlab/2018/12/byod-whats-roi/\">may not be that great</a>.</li>\r\n	<li>Easier for remote working. During the pandemic, the practice of BYOD is also encouraged because many offices require their employees to work from home. In this case, it is generally easier and cheaper to let employees choose their own tools to work from home.</li>\r\n</ol>\r\n\r\n<p>In reality, not all companies are comfortable with this practice. The most obvious drawback of BYOD is in terms of cybersecurity. While BYOD is generally welcomed by employees, this practice is not always welcomed by IT staff who secure enterprise systems.</p>\r\n\r\n<ol>\r\n	<li>Quite a number of BYOD devices are not managed by the company&#39;s IT staff. This means that device and network administration is the employee&#39;s responsibility. Even though not all employees are orderly in updating the operating system and software used, or installing antivirus/antimalware and VPN. This results in the software and operating system being used not being up-to-date, and therefore more vulnerable to hacking.</li>\r\n	<li>The risk of data leakage due to theft and loss is greater on BYOD devices. This is mainly because these devices are usually mobile devices, not devices such as Personal Computers (desktop PCs) or servers. The same risk will also occur in mobile devices provided by the office. However, because devices like this can usually be managed by the company&#39;s IT staff, the risk of data leakage can be minimized with the remote wipe feature.</li>\r\n</ol>\r\n\r\n<p>It can be seen that the company&#39;s decision to provide its own equipment or allow BYOD has its advantages and disadvantages. Whatever decision is made, the obligation to protect employees&#39; devices is now increasingly urgent. What&#39;s more when more and more employees are working from outside the office.</p>\r\n\r\n<p>If the company allows its employees to use their own devices, it is highly recommended to establish <a href=\"http://www.cio.com/article/2395944/7-tips-for-establishing-a-successful-byod-policy.html\">a clear BYOD policy</a> and pay attention to cybersecurity aspects. Enterprises can leverage solutions such as Mobile Device Management (MDM) to help manage BYOD devices.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/solution/it-services/security-it-services//managed-soc-jawaban-untuk-operasi-keamanan-siber-yang-kompleks-dan-mahal\">Managed SOC, the Answer to Complex and Expensive Cybersecurity Operations</a></strong></p>\r\n\r\n<p>To further protect employees from cyber threats, companies can use Managed Security services, including the <strong><a href=\"http://www.lintasarta.net/en/products-services/lintasarta-security/managed-security-operation-center/?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=data-nasabah-bri-life-bocor\">Managed Security</a></strong> Operation Center (SOC) from Lintasarta. <a href=\"http://www.lintasarta.net/en/products-services/lintasarta-security/managed-security-operation-center/?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=data-nasabah-bri-life-bocor\"><strong>Managed SOC</strong></a> services can monitor security 24 hours, 7 days a week, and detect and respond to cyber events within 15 minutes.</p>\r\n\r\n<p>To find out more about&nbsp;comprehensive security services provided by Lintasarta, <a href=\"http://www.lintasarta.net/en/contact-us/?utm_source=blog&amp;utm_medium=lintasartablog&amp;utm_campaign=data-nasabah-bri-life-bocor\"><strong>please contact us</strong></a>.</p>', 'Some time ago, the Indonesian insurance industry was shocked by the news of the leak of customer data of BRI Life, a subsidiary of Bank Rakyat Indonesia.', 'news/3b39c7b58f830787fc8c1176f482f7f8876163.jpeg', NULL, 'BRI Life Customer Data Leaks, This is the Importance of Security for Company Devices', 'Data security, lintasarta security', 'Some time ago, the Indonesian insurance industry was shocked by the news of the leak of customer data of BRI Life, a subsidiary of Bank Rakyat Indonesia.', 'id', '2021-09-14 16:28:37', '2021-09-14 16:28:37'),
(23, 12, 'What is Storage as a Service?', 'what-is-storage-as-a-service', NULL, '<p>Data storage (storage) has become a necessity for modern businesses, ranging from small and medium enterprises to large and multinational companies. However, managing this data storage infrastructure can consume resources, be it space, hardware, or IT staff. Especially if you want to use the Storage as a Service service.</p>\r\n\r\n<p>Whereas the latest applications and business processes can produce large amounts of data every day, which will indirectly require companies to invest in hardware to increase storage capacity, or add new rooms.</p>\r\n\r\n<p><strong>Also read</strong>: <a href=\"http://blog.lintasarta.net/article/cloud-services//kontainerisasi-salah-satu-tren-cloud-computing-2021\">Containerization, One of the Cloud Computing Trends in 2021</a></p>\r\n\r\n<p>Many companies, especially small and medium-sized businesses, do not have sufficient IT personnel and capital to spend on necessary infrastructure such as storage devices. For companies like this, Storage as a Service (STaaS) can be an attractive solution. Currently, large companies are also quite a lot of using these technology services.</p>\r\n\r\n<p>Storage as a Service is a type of Cloud Computing service, which makes service providers offer data storage capacity services (storage) to their customers.</p>\r\n\r\n<p>Like other Cloud services, customers use data storage over an Internet connection. Customers only need to pay according to usage (Pay as You Go), and there is no need for initial capital expenditures that can demand large funds. Budget management can be easier because capital expenditure (Capital Expense/Capex) is converted into operational expenditure (Operational Expense/Opex).</p>\r\n\r\n<p>By utilizing STaaS, the burden of managing data storage devices in the corporate office (on-premise) can be lighter. The space used for storage can be reduced and used for other purposes. That way, companies can still store on-premise data, especially data that is considered very sensitive.</p>\r\n\r\n<p><strong>Storage as a Service use case example</strong><br />\r\nSTaaS can be used for all applications and purposes that require data storage. For example, a company might use a magnetic tape device to store important, but rarely accessed, data (cold data). This magnetic tape library is then stored in the office or sent to another location deemed secure. By utilizing STaaS services, the data can be transferred and stored securely without the hassles of managing magnetic tape devices. Data can be accessed at any time when needed.</p>\r\n\r\n<p><strong>Also read:</strong> <a href=\"http://blog.lintasarta.net/article/cloud-services//bagaimana-cloud-computing-dapat-mendorong-adopsi-teknologi-ai-di-perusahaan\">How Cloud Computing Can Drive AI Technology Adoption in Enterprises?</a></p>\r\n\r\n<p>Another use of Storage as a Service is for data backup for disaster recovery purposes. In this case, data from a system is periodically backed up. In the event of an event that causes data loss in the main system, for example due to a disaster (fire, flood, earthquake) or due to a cyber attack, data can be restored from a backup. The system can quickly work as before, with minimum downtime.</p>\r\n\r\n<p>Enterprises can also use STaaS for business application development and testing. Application development sometimes requires the use of large capacity data storage, but it is only used temporarily. With STaaS, application developers can access large-capacity data storage devices easily and quickly.</p>\r\n\r\n<p><strong>Some aspects of Storage as a Service</strong><br />\r\nSTaaS services have many advantages that can be compared with other types of Cloud services, especially the IaaS (Infrastructure as a Service) type.</p>\r\n\r\n<ul>\r\n	<li><strong>Costs</strong>: Generally, expenses can be regulated so that they are more efficient, and costs can be reduced. The company only pays data storage fees according to the capacity used and the amount of data transferred. For cold data, paying for the amount of data stored may be cheaper. However, if the data is expected to be accessed frequently, you should take a close look at the available service contracts.</li>\r\n	<li><strong>Flexibility</strong>: Companies can add storage capacity immediately, without having to go through a lengthy and expensive procurement process. Data can also be accessed from anywhere via an Internet connection.</li>\r\n	<li><strong>Security</strong>: Some customers may be reluctant to share sensitive data with third parties. It is therefore very important to choose a proven STaaS provider with experience in securing Cloud services. An alternative that is also starting to attract attention is the on-premise STaaS model, where data storage is still carried out at the company installation, but is managed by the STaaS service provider.</li>\r\n</ul>\r\n\r\n<p><strong>Also read:</strong> <a href=\"http://blog.lintasarta.net/article/cloud-services//5-strategi-migrasi-ke-cloud-computing\">5 Migration Strategies to Cloud Computing</a></p>\r\n\r\n<p>Lintasarta provides Storage as a Service service to assist data storage needs. With Cloud and Data Center services available in 3 different locations in Indonesia, data storage will be easier to do in a modern way or not to use disks. With more than three decades of experience, Lintasarta is always ready to help business people by providing an</p>', 'What is Storage as a Service that can be a solution for companies that want bigger data storage?', 'news/0fe9012886b5d4e0b3cd5dab9b55f989405163.jpeg', NULL, 'What is Storage as a Service?', 'Storage as a Service', 'What is Storage as a Service that can be a solution for companies that want bigger data storage?', 'en', '2021-09-14 16:34:16', '2021-09-14 16:34:16'),
