(26, 13, '5 Migration Strategies to Cloud Computing', '5-migration-strategies-to-cloud-computing', NULL, '<p>When your company is considering migrating its applications to cloud computing services (Cloud Computing), it is important to think about how this migration will be executed. In general, decision makers must consider things such as the demands of the organization&#39;s needs, the skills of internal IT staff, and the architecture of the application to be migrated. This will determine the strategy to be implemented.</p>\r\n\r\n<p>Gartner mentions that in general, there are <strong><a href=\"http://www.computerweekly.com/tip/Cloud-applications-Five-migration-tips-from-Gartner\">five application migration</a> </strong>strategies that can be taken: rehosting, refactoring, revise, rebuild and replace. Rehosting utilizes IaaS (Infrastructure as a Service) services, while the refactor, revise and rebuild strategy basically relies on PaaS (Platform as a Service) services. Companies that decide on a replace strategy (replacing old applications) will use SaaS (Software as a Service) services.</p>\r\n\r\n<p><strong>Also read: </strong><strong><a href=\"http://blog.lintasarta.net/article/article/products-and-services//tantangan-dan-peluang-migrasi-ke-cloud-computing-di-era-new-normal\">Challenges and Opportunities for Migration to Cloud Computing in the New Normal Era</a></strong></p>\r\n\r\n<p>Of course, this strategy is not rigid: the company may initially choose a rehosting strategy, but then decide that a refactor or replace will be more profitable in the long run. What are the considerations for each of these strategies? Check out the following.</p>\r\n\r\n<p><strong>Rehosting</strong><br />\r\n<em>Rehosting</em> or often also referred to as lift-and-shift is the placement of business applications on new infrastructure, in this case Cloud IaaS services. Migrating in this way is not much different from moving business applications to new hardware. The system maintainer may need to make configuration changes to adapt to the Cloud Computing environment, but there is no need to overhaul the application architecture.</p>\r\n\r\n<p>Because it is the easiest and least demanding of changes, rehosting is chosen as a migration strategy by many companies. However, because old applications are not necessarily designed with Cloud Computing, there is a possibility that the benefits obtained are also not optimal.</p>\r\n\r\n<p><strong>Refactoring</strong><br />\r\nWith the refactoring strategy, companies no longer just move old applications from on-premise infrastructure and reconfigure, but also rely on software platforms from Cloud Computing service providers. Since in this scheme legacy applications will use PaaS services, system maintainers no longer need to think about administering the underlying infrastructure.</p>\r\n\r\n<p><strong>Also read:</strong> <strong><a href=\"http://blog.lintasarta.net/article/industri/finance//bagaimana-teknologi-cloud-bisa-bantu-perusahaan-asuransi-untuk-berinovasi\">How Cloud Technology Can Help Insurance Companies to Innovate?</a></strong></p>\r\n\r\n<p>The selected PaaS service is still backward compatible, meaning that application developers still use the programming languages, frameworks and container technologies that have been used previously. However, this time all the platforms are managed by the Cloud Computing provider, no longer by the company&#39;s IT personnel.</p>\r\n\r\n<p>When choosing this strategy, the company invested not only in the Cloud Computing service but also the platform. Therefore the choice of platform also needs to be considered properly.</p>\r\n\r\n<p><strong>Revise/rearchitected</strong><br />\r\nIn some cases, a business application moved to a Cloud service may not be able to simply be moved to the selected PaaS service without a fundamental change, such as a Refactor migration. This option is selected if you still want to take advantage of existing application code, but these old applications must be rearchitected in order to take full advantage of Cloud Computing services.</p>\r\n\r\n<p>The Revise option may take longer than the other options. Another option, building from scratch (Rebuild) might be easier and faster.</p>\r\n\r\n<p><strong>Rebuild</strong><br />\r\nAs you go through the migration process, your app developer may decide that it&#39;s easier and cheaper to build your app from scratch than to revise it. This rebuilt application will fully use the facilities and features of the PaaS provider.</p>\r\n\r\n<p>In this scenario, the developer has the opportunity to build more optimized applications for the Cloud. But on the other hand, there is a risk of dependence on the selected PaaS service. You may find it difficult to migrate if the company wants to move to another Cloud service.</p>\r\n\r\n<p><strong>Replace</strong><br />\r\nIn this strategy, your company decides to abandon old applications completely and move to SaaS services. The advantage is, you no longer need to incur development and maintenance costs. On the other hand, SaaS solutions are also at risk of vendor lock-in, and your company must prepare a data migration strategy when necessary.</p>\r\n\r\n<p><strong>Also read:</strong> <strong><a href=\"http://blog.lintasarta.net/article/cloud-services//kontainerisasi-salah-satu-tren-cloud-computing-2021\">Containerization, One of the Cloud Computing Trends in 2021</a></strong></p>\r\n\r\n<p>Whatever strategy you take later, <strong><a href=\"http://www.lintasarta.net/en/products-services/lintasarta-cloud/cloud-services/?utm_source=bloglintasarta&amp;utm_medium=blog&amp;utm_campaign=strategicloudcomputing\">migrating to Cloud Computing</a></strong> requires careful preparation. It is also very important to choose a service provider partner who can meet your business needs.</p>\r\n\r\n<p>Lintasarta can help you to migrate to Cloud technology. Lintasarta provides various types of services ranging from IaaS, PaaS, and SaaS. For further information and consultation, <strong><a href=\"http://www.lintasarta.net/en/contact-us/?utm_source=bloglintasarta&amp;utm_medium=blog&amp;utm_campaign=strategicloudcomputing\">please contact us</a></strong>.</p>', 'What are the best strategies if your company wants to migrate to Cloud Computing technology? Find the answer through the following article.', 'news/03a21c9a122316423cba47e41f467a3d982969.jpeg', NULL, '5 Migration Strategies to Cloud Computing', 'cloud computing', 'What are the best strategies if your company wants to migrate to Cloud Computing technology? Find the answer through the following article.', 'id', '2021-09-14 16:35:34', '2021-09-14 16:35:34'),
(27, 14, 'Containerization, One of the Cloud Computing Trends in 2021', 'containerization-one-of-the-cloud-computing-trends-in-2021', NULL, '<p>When an enterprise moves its application to a Cloud Computing service, the choice that is often made is to take advantage of the virtualization process. By utilizing virtual machines (Virtual Machines or VMs), system managers can move their infrastructure from on-premise Data Centers to Cloud Computing services through the IaaS (Infrastructure as a Service) model, easily and quickly.</p>\r\n\r\n<p>However, virtualization is not the only way to run applications in Cloud Computing. Another alternative that is starting to dominate is containerization, which Accenture calls one of <strong><a href=\"http://blog.lintasarta.net/article/solution/it-services//prediksi-tren-cloud-di-2021\">the Cloud Computing trends in 2021</a></strong>. In containers, applications are packaged simply with the required software libraries, without having to include virtual devices with the operating system.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/cloud-services//bagaimana-cloud-computing-dapat-mendorong-adopsi-teknologi-ai-di-perusahaan\">How Cloud Computing Can Drive AI Technology Adoption in Enterprises?</a></strong></p>\r\n\r\n<p>Containerization was previously predicted to be the choice of many leading companies around the world. A survey conducted in 2019 by market research institute Market Cube said that 87% of respondents were already running container technology. Of the organizations that use container technology, 90% run it in the production phase.</p>\r\n\r\n<p>Gartner predicts that <a href=\"http://www.gartner.com/en/newsroom/press-releases/2020-06-25-gartner-forecasts-strong-revenue-growth-for-global-co\">75% of global enterprises</a> will run more than two applications in containers by 2023. Compare that to the statistics in 2020, when only 30% of global companies used containers.</p>\r\n\r\n<p><strong>Disadvantages of virtual machines in Cloud Computing</strong><br />\r\nIn many cases, virtualization to run business applications can still be an option. System administrators can still manage their infrastructure as on-premises devices without having to make many adjustments. The difference is, companies no longer need to buy, manage, and maintain physical resources, such as servers, storage, and network devices. Companies also don&#39;t need to think about supporting infrastructure such as electricity, cooling, and physical security.</p>\r\n\r\n<p>There is another possibility, namely that previous companies have even utilized virtualization technology in on-premise infrastructure. Virtualization can be done for reasons of efficiency and better utilization of hardware resources in the company&#39;s Data Center. In this case, it is relatively easy to move an existing instance to a Cloud service, and take advantage of the other benefits that a Cloud Computing environment provides.</p>\r\n\r\n<p>However, the use of Cloud Computing services like this has its own problems. The system manager may no longer have to deal with the physical aspects of the infrastructure, but still have to maintain other aspects, such as the operating system, other software, and security.</p>\r\n\r\n<p>This operating system and other software also consumes processor, memory, and data storage resources provided by Cloud Computing services. When a company runs multiple virtual machines for different applications, resources are wasted.</p>\r\n\r\n<p><strong>Maximizing the excess of containers</strong><br />\r\nFor enterprises, the use of containers in Cloud Computing services <a href=\"http://blog.lintasarta.net/article/cloud-101-apa-itu-container-as-a-service-caas\">offers a number of advantages</a>, over the use of classic IaaS services that are based on virtualization.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/solution/managed-services/sdwan//memecahkan-masalah-hybrid-cloud-dengan-sd-wan\">Troubleshooting Hybrid Cloud with SD-WAN</a></strong></p>\r\n\r\n<p>Because a single container consists of only the application and supporting software libraries, containers are more efficient in consuming processor and memory resources than virtual machines. Launching applications from containers can also be faster (more than 10 times), in seconds. The container size of only tens of megabytes allows launching multiple applications at a time with minimal resource consumption.</p>\r\n\r\n<p>Containers are also portable, can be run and moved on various Cloud services (public or private), or also on premise installation when needed.</p>\r\n\r\n<p>However, in order for enterprises to fully reap the benefits of container technology, enterprises need to embrace a new paradigm in application development. Containers are the foundation of the <a href=\"http://blog.lintasarta.net/article/devops-cloud-computing-pasangan-andal-untuk-tingkatkan-daya-kompetisi-bisnis\">DevOps paradigm</a>, which combines development (development or dev) and operations (operations or ops) divisions.</p>\r\n\r\n<p>Since a container can be launched and removed in a matter of milliseconds, this technology is suitable for application development methods with continuous integration/continuous deployment. In this model, the developer packs the latest version of the application in a container, which can then be deployed to production after passing automated testing. If a problem occurs, it is very easy to remove this new container and revert to the old version of the container.</p>\r\n\r\n<p>However, managing this container is not easy, because it requires resources with sufficient skills and flight hours so that the operating conditions are constant and always prime. Therefore, Lintasarta provides <a href=\"http://www.lintasarta.net/en/products-services/lintasarta-cloud/cloud-services/?utm_source=bloglintasarta&amp;utm_medium=blog&amp;utm_campaign=kontainerisasicloudcomputing\"><strong>Managed Cloud Services</strong></a> for customers&nbsp;organize and manage applications in the form of an orchestration container.</p>\r\n\r\n<p><strong>Also read: <a href=\"http://blog.lintasarta.net/article/cloud-services//jenis-cloud-computing\">More and more adoption, what are the types of Cloud Computing services?</a></strong></p>\r\n\r\n<p>In collaboration with Red Hat OpenShift, Lintasarta&#39;s Container as a Service service enables your company to package and launch business applications in agile and scalable container form. With this service, you can add features and launch the latest version of your app to the public, quickly and efficiently. Your business can be more agile and competitive because it can more quickly improve services and offer the latest products.</p>\r\n\r\n<p>To find out more, <strong><a href=\"https://www.cloudeka.id/contact-us\">please contact us</a></strong>.</p>', 'What is Containerization in cloud computing? What\'s the advantage? Find the answer through this article.', 'news/36d6465cf0bd55a60e87e93e16f70ac8941950.jpeg', NULL, 'Containerization, One of the Cloud Computing Trends in 2021', 'cloud computing', 'What is Containerization in cloud computing? What\'s the advantage? Find the answer through this article.', 'en', '2021-09-14 16:36:24', '2021-10-11 08:10:54'),
