INSERT INTO `product_translations` (`id`, `product_id`, `title`, `slug`, `subtitle`, `excerpt`, `images`, `logo_1`, `logo_2`, `description`, `partner_description`, `meta_title`, `meta_keyword`, `meta_description`, `lang`, `created_at`, `updated_at`) VALUES
(1, 1, 'Deka Prime (PX1)', 'deka-prime-px1', 'What is <br>Deka Prime (PX1)', 'Public Cloud service equipped with comprehensive features that will support your business.', 'imgs/products/banner-detail.jpg', 'imgs/solutions/svg/solutions/products/cloud-premium-2.svg', 'imgs/solutions/svg/solutions/products/cloud-premium-2.svg', '<p>Deka Prime (PX1)&nbsp;is one of the Public Cloud services by Lintasarta Cloudeka that offers businesses an IT infrastructure with the virtual server device. This Cloud service can be accessed by using public Internet or private network.</p>\r\n\r\n<p>With the help of VMware technology, Deka Prime (PX1)&nbsp;by Lintasarta Cloudeka provides you with a free dedicated virtual router with NAT, access list, and static routing features. The comprehensive Cloud service offers upgrade options for IP VPN dedicated router and the Load Balancer feature. To complete the service, Cloud Premium can be integrated with a few more features such as Cloud Backup, Disaster Recovery, and Global Load Balancer.</p>', '<p>Partners</p>', 'Deka Prime (PX1)', 'Public Cloud', 'Deka Prime (PX1) for Public Cloud', 'en', '2021-05-10 22:42:00', '2021-07-21 09:28:12'),
(2, 1, 'Deka Prime (PX1)', 'deka-prime-px1', 'Apa itu <br>Deka Prime (PX1)', 'Layanan Public Cloud didukung dengan fitur-fitur andal yang dapat menunjang bisnis Anda.', 'imgs/products/banner-detail.jpg', 'imgs/solutions/svg/solutions/products/cloud-premium-2.svg', 'imgs/solutions/svg/solutions/products/cloud-premium-2.svg', '<p>Deka Prime (PX1) merupakan salah satu layanan Public Cloud dari Lintasarta Cloudeka yang membantu bisnis di Indonesia menyediakan infrastruktur IT dengan perangkat virtual server. Layanan Cloud ini dapat diakses melalui jaringan Internet maupun jaringan privat.</p>\r\n\r\n<p>Berbasis teknologi dari VMware, Deka Prime (PX1) milik Lintasarta Cloudeka akan menyediakan virtual router dedicated secara gratis dengan NAT, access list, dan fitur static routing. Tidak hanya itu, Lintasarta Deka Prime (PX1) menawarkan upgrade dedicated router untuk IP VPN dan fitur Load Balancer. Lintasarta Deka Prime (PX1) sudah dapat diintegrasikan dengan beberapa fitur tambahan seperti Cloud Backup, Disaster Recovery, dan Global Load Balancer.</p>', '<p>Mitra</p>', 'Dexa Prime (PX1)', 'Public Cloud', 'Deka Prime (PX1) untuk Public Cloud', 'id', '2021-05-10 22:42:00', '2021-07-21 09:28:38'),
(3, 2, 'Deka Flexi (FX2)', 'deka-flexi-fx2', 'What is <br>Deka Flexi (FX2)', 'Public Cloud service with pay-per-use model and simple VM deployment.', 'product/sKuhDkUxqLouoV49yWJmu3pYJfRJxw5Yf4v0GiHk.jpg', 'imgs/solutions/svg/solutions/products/cloud-lite-2.svg', 'imgs/solutions/svg/solutions/products/cloud-lite-2.svg', '<p>Deka Flexi (FX2) is one of the Public Cloud service options from the Lintasarta Cloudeka series. By implementing a simple deployment of virtual machine from RedHat OpenStack technology and pay-per-use mechanism, Deka Flexi (FX2) offers flexibility that will allow companies to select services that suit their needs and business scale.</p>\r\n\r\n<p>Deka Flexi (FX2) service are renowned for its best price value in the Indonesian Cloud market and is able to increase efficiency, especially in the use of Capital Expenditure (capex) for various unnecessary IT investments.</p>', '<p>description</p>', 'Deka Flexi (FX2)', 'Public Cloud', 'Deka Flexi (FX2) for Public Cloud', 'en', '2021-05-19 07:57:16', '2021-07-21 09:32:03'),
(4, 2, 'Deka Flexi (FX2)', 'deka-flexi-fx2', 'Apa itu<br>Deka Flexi (FX2)', 'Layanan Public Cloud dengan skema pay-per-use dan deployment VM sederhana.', 'product/sKuhDkUxqLouoV49yWJmu3pYJfRJxw5Yf4v0GiHk.jpg', 'imgs/solutions/svg/solutions/products/cloud-lite-2.svg', 'imgs/solutions/svg/solutions/products/cloud-lite-2.svg', '<p>Deka Flexi (FX2) merupakan salah satu pilihan layanan <em>Public Cloud</em> dari rangkaian Lintasarta Cloudeka. Dengan menerapkan <em>Virtual Machine</em> sederhana dan mekanisme <em>pay-per-use</em> serta didukung teknologi dari RedHat OpenStack, Deka Flexi (FX2) menawarkan fleksibilitas sehingga perusahaan dapat memilih layanan yang sesuai dengan kebutuhan dan skala bisnis.</p>\r\n\r\n<p>Layanan Deka Flexi (FX2) dikenal memiliki harga terbaik di pasar Indonesia dan mampu meningkatkan efisiensi, terutama pada penggunaan <em>Capital Expenditure</em> (Capex) perusahaan untuk berbagai investasi IT yang tidak perlu.&nbsp;</p>', '<p>description</p>', 'Deka Flexi (FX2)', 'Public Cloud', 'Deka Flexi (FX2) untuk Public Cloud', 'id', '2021-05-19 07:57:16', '2021-07-21 09:30:46'),
(5, 3, 'Deka Vault', 'deka-vault', 'What is <br>Deka Vault', 'Cloud Backup and Disaster Recovery service to help you synchronize the main virtual server.', 'product/LRRschYjaIW7KrIQ5eGTI9qeAqG7js03aHEgwZC0.png', 'svgs/cloud-safe.svg', 'svgs/cloud-safe.svg', '<p>Deka Vault from Lintasarta Cloudeka product series is a Cloud Backup and Disaster Recovery service to help you synchronize the main virtual server by using the Internet to a backup virtual server for data protection and avoid bad things from happening to your main server.</p>\r\n\r\n<p>Deka Vault is supported by technology from Veeam for all types of Cloud storage infrastructure that you have so that all data is protected.</p>', '<p>Partners</p>', 'Deka Vault', 'Cloud Backup and Disaster Recovery', 'Cloud Safe for Cloud Backup and Disaster Recovery', 'en', '2021-05-21 07:55:59', '2021-07-21 09:50:08'),
(6, 3, 'Deka Vault', 'deka-vault', 'Apa itu <br>Deka Vault', 'Layanan Cloud Backup dan Disaster Recovery untuk membantu Anda melakukan sinkronisasi terhadap virtual server utama.', 'product/LRRschYjaIW7KrIQ5eGTI9qeAqG7js03aHEgwZC0.png', 'svgs/cloud-safe.svg', 'svgs/cloud-safe.svg', '<p>Deka Vault dari rangkaian produk Lintasarta Cloudeka adalah layanan <em>Cloud Backup</em> dan <em>Disaster Recovery</em> untuk membantu Anda menyinkronkan <em>virtual server</em> utama dengan menggunakan internet ke <em>virtual server backup</em> untuk perlindungan data dan menghindari hal buruk terjadi pada server utama Anda.</p>\r\n\r\n<p>Deka Vault didukung oleh teknologi dari Veeam untuk semua jenis infrastruktur penyimpanan Cloud yang Anda miliki sehingga semua data terlindungi.</p>', '<p>Partners</p>', 'Deka Vault', 'Cloud Backup and Disaster Recovery', 'Deka Vault untuk Cloud Backup and Disaster Recovery', 'id', '2021-05-21 07:55:59', '2021-07-21 09:48:40'),
(7, 4, 'Deka Premium', 'deka-premium', 'What is <br>Deka Premium', 'Private Cloud service dedicated to only one customer.', 'product/JTDBBhXbecAsOfQvTZuV7ocrKqoz7OVYJwA04fWf.png', 'product/VspdWUYJYqxVEe1snnp2co5WYdJT2q0z7APPHNlc.svg', 'product/VspdWUYJYqxVEe1snnp2co5WYdJT2q0z7APPHNlc.svg', '<p>Deka Premium by Lintasarta Cloudeka is a Private Cloud Service dedicated for one customer only. The particular extensive solution is accessible through both the internet network and private networks to support various data production, Disaster Recovery, or any kind of enviroment needed.</p>\r\n\r\n<p>Supported by prestigious and well-known partners&nbsp;technologies, Deka Premium from Lintasarta Cloudeka has reliable features that you can choose to support business operations.</p>', '<p>Partner</p>', 'Deka Premium', 'Private Cloud', 'Deka Premium for Private Cloud', 'en', '2021-05-21 10:26:54', '2021-07-21 09:53:55'),
(8, 4, 'Deka Premium', 'deka-premium', 'Apa itu <br>Deka Premium', 'Layanan Private Cloud yang didedikasikan untuk hanya satu pelanggan.', 'product/JTDBBhXbecAsOfQvTZuV7ocrKqoz7OVYJwA04fWf.png', 'product/VspdWUYJYqxVEe1snnp2co5WYdJT2q0z7APPHNlc.svg', 'product/VspdWUYJYqxVEe1snnp2co5WYdJT2q0z7APPHNlc.svg', '<p>Deka Premium&nbsp;milik Lintasarta Cloudeka merupakan layanan <em>Private Cloud</em> yang didedikasikan untuk hanya satu pelanggan. Solusi layanan ini dapat diakses melalui jaringan Internet maupun jaringan privat untuk mendukung seluruh jenis produksi data, <em>Disaster Recovery</em>, atau berbagai jenis kebutuhan lainnya.</p>\r\n\r\n<p>Berbasis dukungan dari partner-partner ternama, Deka Premium&nbsp;dari Lintasarta Cloudeka memiliki fitur-fitur andal yang dapat Anda pilih sesuai kebutuhan untuk mendukung kegiatan operasional perusahaan.</p>', '<p>Partner</p>', 'Deka Premium', 'Private Cloud', 'Deka Premium untuk Private Cloud', 'id', '2021-05-21 10:26:54', '2021-07-21 09:54:50'),
(13, 7, 'Deka Box', 'deka-box', 'What is <br>Deka Box', 'Object Storage service for managing corporate applications and data.', 'product/JCftHv1tSVvneSJEUS9gt6cUWvcbkOHxNaCdLL97.png', 'product/Xz2f53tRlXhcssgAn3II7IBueDlrZuBFQ9hr4vXj.svg', 'product/Xz2f53tRlXhcssgAn3II7IBueDlrZuBFQ9hr4vXj.svg', '<p>Deka Box from Lintasarta Cloudeka is an Object Storage service that can be used to manage corporate data storage from various locations with replication control capabilities. This reliable Cloud Computing solution is very suitable for companies that have many applications with a level of data complexity and require the storage of various types of data.</p>', '<p>Cloud Box</p>', 'Deka Box', 'Cloud Box', 'Cloud Box', 'en', '2021-05-21 10:51:04', '2021-06-24 01:27:41'),
(14, 7, 'Deka Box', 'deka-box', 'Apa itu<br>Deka Box', 'Layanan Object Storage untuk mengelola penyimpan data perusahaan.', 'product/JCftHv1tSVvneSJEUS9gt6cUWvcbkOHxNaCdLL97.png', 'product/Xz2f53tRlXhcssgAn3II7IBueDlrZuBFQ9hr4vXj.svg', 'product/Xz2f53tRlXhcssgAn3II7IBueDlrZuBFQ9hr4vXj.svg', '<p>Deka Box dari Lintasarta Cloudeka adalah layanan Object Storage yang dapat dimanfaatkan untuk mengelola penyimpan data perusahaan dari berbagai lokasi dengan kemampuan kendali replikasi. Solusi Cloud Computing andal ini sangat sesuai digunakan bagi perusahaan yang memiliki banyak aplikasi dengan tingkat kompleksitas data dan membutuhkan tempat penyimpanan berbagai jenis data.</p>', '<p>Cloud Bucket</p>', 'Deka Box', 'Cloud Box', 'Cloud Box', 'id', '2021-05-21 10:51:04', '2021-06-29 13:30:08'),
(15, 8, 'Deka Harbor', 'deka-harbor', 'What is <br>Deka Harbor', 'Container-based Cloud Service to manage your company applications.', 'product/S0RpxD9RKyPO7TaHGA37vpWGHt0AkgLu0V09JHic.png', 'product/YxtYaTm2KUy60D6JC1iF9TO6L8OWnucUIMHGTTBy.svg', 'product/YxtYaTm2KUy60D6JC1iF9TO6L8OWnucUIMHGTTBy.svg', '<p>Deka Harbor is a Managed Container as a Service solution from Lintasarta Cloudeka that can help application developers optimizing their actions to upload, set up, start, stop, and manage applications in the form of a secure and scalable container.</p>\r\n\r\n<p>This Cloud service model offers a complete framework for deploying and managing containerized applications. Deka Harbor by Lintasarta Cloudeka provides a logical packaging mechanism through which applications can be abstracted from their run environment. This combination allows container-based applications to be used easily and consistently, regardless of whether the target environment is a production environment or even a developer&#39;s personal laptop.</p>', '<p>Deka Harbor</p>', 'Deka Harbor', 'Container Storage', 'Deka Harbor for Container Storage', 'en', '2021-05-21 10:57:11', '2021-07-21 10:14:35'),
(16, 8, 'Deka Harbor', 'deka-harbor', 'Apa itu <br>Deka Harbor', 'Layanan Cloud berbasis Container untuk mengelola aplikasi perusahaan Anda.', 'product/S0RpxD9RKyPO7TaHGA37vpWGHt0AkgLu0V09JHic.png', 'product/YxtYaTm2KUy60D6JC1iF9TO6L8OWnucUIMHGTTBy.svg', 'product/YxtYaTm2KUy60D6JC1iF9TO6L8OWnucUIMHGTTBy.svg', '<p>Deka Harbor adalah layanan <em>Managed Container as a Service</em> dari Lintasarta Cloudeka yang dapat membantu para pengembang aplikasi melancarkan aksinya untuk mengunggah, mengatur, memulai, menghentikan, dan mengelola aplikasi dalam bentuk <em>container </em>yang aman dan terukur.&nbsp;</p>\r\n\r\n<p>Model layanan Cloud ini menawarkan kerangka kerja yang lengkap untuk menggunakan dan mengelola aplikasi dalam bentuk <em>container</em>. Tidak hanya itu, Deka Harbor milik Lintasarta Cloudeka menyediakan mekanisme pengemasan logis di mana aplikasi dapat diabstraksi dari lingkungan mereka dijalankan. Kombinasi ini memungkinkan aplikasi berbasis <em>container </em>untuk digunakan dengan mudah dan konsiten, terlepas dari apakah lingkungan yang ditargetkan adalah lingkungan produksi (<em>production environment</em>) atau bahkan laptop pribadi pengembang.</p>', '<p>Deka Harbor</p>', 'Deka Harbor', 'Container Storage', 'Deka Harbor untuk Container Storage', 'id', '2021-05-21 10:57:11', '2021-07-21 10:16:31'),
(17, 9, 'Deka Sense', 'deka-sense', 'What is <br>Deka Sense', 'Data Analytics service based on Social Intelligence technology to generate analytical reports for your company’s brand from digital media.', 'product/pYqz4jeSV8N7oxuXrw3ennMlKRhBm7eb2vjuoFNT.png', 'product/7Ph479rKeHB01IiIdNzJw6JymfxKbDtvos9iPDcc.svg', 'product/7Ph479rKeHB01IiIdNzJw6JymfxKbDtvos9iPDcc.svg', '<p>Deka Sense is a social intelligence application that generates social insights by summarizing, analyzing, and monitoring public sentiments and trending issues from conversations happening in social media &amp; online media.&nbsp;</p>\r\n\r\n<p>With Deka&nbsp;Sense, you can monitor and listen to multiple channels from a single easy-to-use dashboard and respond in real-time. Deka Sense is a fully managed service from installation, transition, and maintenance conducted by Lintasarta Cloudeka professional technicians team who hold international certifications.&nbsp;</p>', '<p>Deka Sense</p>', 'Deka Sense', 'Media Analytics', 'Deka Sense for Media Analytics', 'en', '2021-05-21 11:05:46', '2021-07-21 10:21:38'),
(18, 9, 'Deka Sense', 'deka-sense', 'Apa itu<br>Deka Sense', 'Layanan Data Analytics berbasis teknologi Social Intelligence untuk menghasilkan laporan analisis brand perusahaan Anda dari digital media.', 'product/pYqz4jeSV8N7oxuXrw3ennMlKRhBm7eb2vjuoFNT.png', 'product/7Ph479rKeHB01IiIdNzJw6JymfxKbDtvos9iPDcc.svg', 'product/7Ph479rKeHB01IiIdNzJw6JymfxKbDtvos9iPDcc.svg', '<p>Deka Sense adalah aplikasi <em>social intelligence</em> yang menghasilkan laporan sentimen publik, tren, dan isu yang terkumpul dari proses pemantauan dan penganalisisan dari percakapan yang terjadi di media sosial &amp; media online.</p>\r\n\r\n<p>Dengan&nbsp;Deka Sense, Anda dapat memantau dan mendengarkan dari berbagai saluran di satu <em>dashboard</em> yang mudah digunakan dan merespons secara <em>real-time</em>. Deska Sense merupakan layanan <em>Cloud fully managed </em>dari instalasi, perpindahan data, hingga pengelolaan yang dilaksanakan oleh tim teknisi profesional Lintasarta Cloudeka dengan sertifikasi internasional.</p>', '<p>Media Analytics</p>', 'Deka Sense', 'Media Analytics', 'Deka Sense untuk Media Analytics', 'id', '2021-05-21 11:05:46', '2021-07-21 10:23:24'),
(19, 10, 'Intelligent Video Analytics', 'intelligent-video-analytics', 'What is <br>Intelligent Video Analytics', 'Ready-to-use software services based on Artificial Intelligence technology for monitoring via live-video to gather attributes, events or patterns of specific behaviour.', 'product/ZPrBAzLUI8LtDkNZwEJnqO8HOOSNw6Xs7lIj63zD.png', 'product/1fpk0sp08ymM53ytp1urnvEwd6Vp0VwfGuR7MHGe.svg', 'product/1fpk0sp08ymM53ytp1urnvEwd6Vp0VwfGuR7MHGe.svg', '<p>Lintasarta Intelligent Video Analytics (IVA) is a ready-to-use software for live video that works in all environments to provide a new level of situational awareness for a more secured and smarter organization. With the support of Artificial Intelligence, Lintasarta IVA can generate insightful real-time reports of what is currently happening in the location where the devices are installed.</p>\r\n\r\n<p>Unlike any other camera surveillance, the analysis of video/image generated by Lintasarta IVA is carried out by the system so that it is consistent and accurate thanks to the comprehensive features such as Face Recognition, Demography Analytics, License Plate Recognition, and Vehicle Counting &amp; Classification. Moreover, the accuracy of interpretation has been tested by the National Institute of Standards &amp; Technology (NIST).</p>', '<p>Intelligent Video Analytics</p>', 'Intelligent Video Analytics', 'Intelligent Video Analytics', 'Intelligent Video Analytics', 'en', '2021-05-21 11:15:17', '2021-05-21 11:15:17'),
(20, 10, 'Intelligent Video Analytics', 'intelligent-video-analytics', 'Apa itu <br>Intelligent Video Analytics', 'Layanan perangkat lunak siap pakai berbasis teknologi Artificial Intelligence untuk pemantuan melalui live-video untuk mengumpulkan data atribut, peristiwa, atau pola perilaku tertentu.', 'product/ZPrBAzLUI8LtDkNZwEJnqO8HOOSNw6Xs7lIj63zD.png', 'product/1fpk0sp08ymM53ytp1urnvEwd6Vp0VwfGuR7MHGe.svg', 'product/1fpk0sp08ymM53ytp1urnvEwd6Vp0VwfGuR7MHGe.svg', '<p>Lintasarta Intelligent Video Analytics (IVA) adalah perangkat lunak siap pakai untuk pemantuan melalui <em>live-video</em> yang ter-<em>install</em> di semua lingkungan untuk memberikan tingkat keamanan yang lebih cerdas. Dengan dukungan <em>Artificial Intelligence</em>, Lintasarta IVA dapat menghasilkan laporan <em>real-time</em> tentang apa yang sedang terjadi di lokasi di mana perangkat dipasang.</p>\r\n\r\n<p>Berbeda dengan kamera pengawas lainnya, analisis video/gambar yang dihasilkan oleh Lintasarta IVA dilakukan oleh sistem agar konsisten dan akurat karena telah dilengkapi fitur Pengenalan Wajah, Analisis Demografi, Pengenalan Nomor Plat Kendaraan, dan Perhitungan Jumlah &amp; Klasifikasi Kendaraan. Selain itu, tingkat keakurasian interpretasi telah diuji oleh <em>National Institute of Standards &amp; Technology </em>(NIST).</p>', '<p>Intelligent Video Analytics</p>', 'Intelligent Video Analytics', 'Intelligent Video Analytics', 'Intelligent Video Analytics', 'id', '2021-05-21 11:15:17', '2021-07-22 06:11:48'),
(21, 11, 'Next Generation Firewall', 'next-generation-firewall', 'What is <br>Next Generation Firewall', 'Protects your IT infrastructure from malware.', 'product/wOhov3UyBpz0AjM5mjkLoLshRjQSBDuq1G72e40m.png', 'product/6kptZEuwBp2PKJ7ZH2rEfDpD6Ea7UvSfJ4DEs9yV.svg', 'product/6kptZEuwBp2PKJ7ZH2rEfDpD6Ea7UvSfJ4DEs9yV.svg', '<p>Lintasarta NGFW On Cloud is a value-added service for Lintasarta Cloud and Lintasarta Colocation customers. With Lintasarta NGFW On Cloud, your servers within the Lintasarta Cloud and Lintasarta Colocation networks will be protected from modern viruses and malware that come from the Internet.</p>\r\n\r\n<p>Lintasarta NGFW On Cloud is the first and only Indonesian provider to offer such Cloud Security services. In collaboration with Palo Alto Networks, as a leading technology partner in the field, we ensure the security of your servers within Lintasarta Cloud and Lintasarta Colocation networks from cyber attacks.</p>', '<p>Next Generation Firewall</p>', 'Next Generation Firewall', 'Next Generation Firewall', 'Next Generation Firewall', 'en', '2021-05-21 11:25:24', '2021-06-05 05:28:13'),
(22, 11, 'Next Generation Firewall', 'next-generation-firewall', 'Apa itu <br>Next Generation Firewall', 'Lindungi infrastruktur IT Anda dari Malware.', 'product/wOhov3UyBpz0AjM5mjkLoLshRjQSBDuq1G72e40m.png', 'product/6kptZEuwBp2PKJ7ZH2rEfDpD6Ea7UvSfJ4DEs9yV.svg', 'product/6kptZEuwBp2PKJ7ZH2rEfDpD6Ea7UvSfJ4DEs9yV.svg', '<p style=\"text-align:justify\">Lintasarta Next-Generation Firewall On Cloud adalah layanan value added bagi Anda yang menggunakan layanan Lintasarta Cloudeka dan Lintasarta Colocation. Dengan Lintasarta Next-Generation Firewall On Cloud, server Anda yang berada di dalam jaringan Lintasarta Cloud dan Lintasarta Colocation akan terlindungi dari virus modern dan malware yang datang dari Internet.</p>\r\n\r\n<p style=\"text-align:justify\">Lintasarta Next-Generation Firewall On Cloud menjadikan Lintasarta sebagai provider dalam negeri pertama dan satu-satunya yang menawarkan layanan Cloud Security sejenis. Bekerja sama dengan Palo Alto Networks sebagai partner teknologi terdepan di bidangnya, kami memastikan keamanan server Anda yang berada di dalam jaringan Lintasarta Cloudeka dan Lintasarta Colocation dari serangan siber.</p>', '<p>Next Generation Firewall</p>', 'Next Generation Firewall', 'Next Generation Firewall', 'Next Generation Firewall', 'id', '2021-05-21 11:25:24', '2021-07-22 06:11:21'),
(23, 12, 'Load Balancer', 'load-balancer', 'What is <br>Load Balancer', 'Keep your web application available.', 'product/BY2jmKYJBCtOzdGVoKGvqbJojvIEfZZXoiYqdT3u.png', 'product/avcTYFOpfQp8TqbDWkX84548tULcAdcYTUCEQ6tj.svg', 'product/avcTYFOpfQp8TqbDWkX84548tULcAdcYTUCEQ6tj.svg', '<p>Lintasarta Load Balancer is a web security feature that can only be used by Lintasarta Cloudeka and Lintasarta Colocation customers in managing data traffic and is able to split the work of a group of web servers evenly. This way, your web application will still be available in any situation.</p>', '<p>Load Balancer</p>', 'Load Balancer', 'Load Balancer', 'Load Balancer', 'en', '2021-05-21 11:32:57', '2021-06-05 05:28:03'),
(24, 12, 'Load Balancer', 'load-balancer', 'Apa itu <br>Load Balancer', 'Memastikan web aplikasi Anda tetap tersedia dalam kondisi apapun.', 'product/BY2jmKYJBCtOzdGVoKGvqbJojvIEfZZXoiYqdT3u.png', 'product/avcTYFOpfQp8TqbDWkX84548tULcAdcYTUCEQ6tj.svg', 'product/avcTYFOpfQp8TqbDWkX84548tULcAdcYTUCEQ6tj.svg', '<p>Lintasarta Load Balancer merupakan fitur keamanan web yang hanya dapat digunakan pelanggan Lintasarta Cloudeka dan Lintasarta Colocation dalam mengatur lalu lintas data dan mampu membagi pekerjaan sekelompok server web secara merata. Dengan demikian, aplikasi web Anda akan tetap tersedia dalam situasi apapun.</p>', '<p>Load Balancer</p>', 'Load Balancer', 'Load Balancer', 'Load Balancer', 'id', '2021-05-21 11:32:57', '2021-06-29 13:27:43'),
(25, 13, 'Deka Web Application Firewall', 'deka-web-application-firewall', 'What is Web Application <br>Firewall', 'Protect your web application from hacking.', 'product/jNgM3DiQ388pZwc9FhHYdhPEHYHjZTV2pizLx1nf.png', 'product/5ltlw18TF1hLGRWIvp4VUaDq1CuhA6QNbCikPRaT.svg', 'product/5ltlw18TF1hLGRWIvp4VUaDq1CuhA6QNbCikPRaT.svg', '<p>Lintasarta Web Application Firewall (WAF) is a web security feature only for Lintasarta Cloudeka and Data Center customers. To complete your security system, Lintasarta WAF is able to filter the content of specific web applications while Lintasarta NGFW serves as a safety gate between servers. Lintasarta WAF helps you to maximize business through a web application (HTTP) by securing the traffic from cyber attacks.</p>', '<p>Web Application Firewall</p>', 'Web Application Firewall', 'Web Application Firewall', 'Web Application Firewall', 'en', '2021-05-21 11:38:24', '2021-09-30 09:06:55'),
(26, 13, 'Deka  Web Application Firewall', 'deka-web-application-firewall', 'Apa itu Web Application <br>Firewall', 'Lindungi aplikasi web Anda dari serangan siber.', 'product/jNgM3DiQ388pZwc9FhHYdhPEHYHjZTV2pizLx1nf.png', 'product/5ltlw18TF1hLGRWIvp4VUaDq1CuhA6QNbCikPRaT.svg', 'product/5ltlw18TF1hLGRWIvp4VUaDq1CuhA6QNbCikPRaT.svg', '<p>Lintasarta Web Application Firewall (WAF) merupakan fitur keamanan web khusus untuk pelanggan Lintasarta Cloudeka dan Data Center. Untuk melengkapi sistem keamanan Anda, Lintasarta WAF mampu memfilter konten aplikasi web tertentu, sedangkan Lintasarta NGFW berfungsi sebagai gerbang pengaman antar server. Lintasarta WAF dapat membantu Anda memaksimalkan bisnis melalui aplikasi web (HTTP) dengan mengamankan trafik dari serangan cyber.</p>', '<p>Web Application Firewall</p>', 'Web Application Firewall', 'Web Application Firewall', 'Web Application Firewall', 'id', '2021-05-21 11:38:25', '2021-09-30 09:07:45');
