(1, 1, 'en', '1 MONTH FREE BILL PROMO!', 'Free of charge to subscribe in the following month.', '<p>Subscribe to Deka Flexi and get a FREE BILL of up to IDR25 million for your first month!</p>\r\n\r\n<p>*Terms &amp; conditions apply.</p>', 'https://www.cloudeka.id/faq#1-month-free-bill-promotion', 'uploads/17d1db04ca3d023ffd4bb8fde0892fec773969.jpg'),
(2, 1, 'id', 'PROMO BEBAS TAGIHAN!', 'Berlangganan bebas biaya di bulan berikutnya', '<p>Nikmati Deka Flexi sekarang dan gratis hingga 25 juta rupiah di tagihan bulan pertama!<br />\r\n<br />\r\n*Syarat &amp; ketentuan berlaku.</p>', 'https://www.cloudeka.id/id/faq#promosi-1-bulan-bebas-biaya', 'uploads/17d1db04ca3d023ffd4bb8fde0892fec304295.jpg'),
(3, 2, 'en', 'Test - Title', 'Test - Excerpt', '<p>Test - Description</p>', 'http://cloudeka-rc2.labelideas.co/', 'uploads/e8c6bcca260662e9f2de3c32752eeb6f402307.jpg'),
(4, 2, 'id', 'Percobaan - Judul', 'Percobaan - Kutipan', '<p>Percobaan - Pemaparan</p>', 'http://cloudeka-rc2.labelideas.co/id', 'uploads/e8c6bcca260662e9f2de3c32752eeb6f402307.jpg'),
(5, 3, 'en', 'SEPTEMBER CERIA PROMO!', 'Free of charge to subscribe in the following month.', '<p>Pick your own promo and enjoy your Cloud!</p>\r\n\r\n<p>*Terms &amp; conditions apply.</p>', 'https://www.cloudeka.id/faq#', 'uploads/0f41fb1e083b296be15a552d092fbff9462815.jpg'),
(6, 3, 'id', 'SEPTEMBER CERIA PROMO!', 'Berlangganan bebas biaya di bulan berikutnya', '<p>Pilih promo yang&nbsp;sesuai dengan kebutuhan Anda!<br />\r\n<br />\r\n*Syarat &amp; ketentuan berlaku.</p>', 'https://www.cloudeka.id/faq#1-month-free-bill-promotion', 'uploads/395978ffa74767b88dc55536c63d12cb760957.jpg'),
(7, 4, 'en', 'CLOUD UNTUK SEMUA (CUS) PROMOTION', 'Start your business journey with the best #Cloud solution in town.', '<p>It&#39;s your lucky months! We have 3 different promotions that you can choose based on your own needs. See the details now!</p>', 'https://www.cloudeka.id/faq#start-with-cloudeka-partner-promotion', 'uploads/6244dbc8d79d694ec1dc7ed18995d8f5667457.jpg'),
(8, 4, 'id', 'CLOUD UNTUK SEMUA (CUS) PROMOTION', 'Saatnya memulai bisnis Anda dengan solusi Cloud terbaik.', '<p>Keberuntungan sedang di depan Anda! Lintasarta Cloudeka menawarkan 3 program promosi berbeda yang bisa Anda pilih sesuai dengan kebutuhan Anda. Cek infonya sekarang!</p>', 'https://www.cloudeka.id/faq#cloudeka-promo', 'uploads/e6dfcb1c130c9898a49b12f2eafdd217531329.jpg');
