(7, 3, 'Mengapa Memilih<br>Lintasarta Cloudeka', NULL, '<p>Semakin besar&nbsp;bisnis perusahaan berkembang, semakin kompleks infrastruktur Teknologi Informasi yang dibutuhkan nantinya. Pelayanan Lintasarta Cloudeka menawarkan solusi untuk web/aplikasi hosting sehingga Data Center Anda dapat terkonsolidasi dengan aman, mudah, dan terjangkau tanpa harus membangun infrastruktur IT Anda sendiri. Pelajari lebih lanjut tentang solusi yang ditawarkan oleh pelayanan Lintasarta Cloudeka. <a href=\"http://cloudeka-rc.labelideas.co/why-us\">Keterangan lebih lanjut..</a></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', NULL, '2021-07-15 07:40:51'),
(8, 3, 'Why Choose <br>Lintasarta Cloudeka', 'Why Choose Lintasarta Cloudeka', '<p>The more a company&rsquo;s business develops, the more complex its IT infrastructure required eventually becomes. Lintasarta Cloud Services offers solutions for web/application hosting so that your data center can be securely, easily and affordably consolidated without having to build your own IT infrastructure. Learn more about the solutions offered by Lintasarta Cloud Services.&nbsp;<a href=\"/why-us\">More details..</a></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-07-15 07:40:59'),
