(20, 9, 'Why Us', 'Why us', 'Why us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-06-08 10:08:19'),
(21, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'uploads/19c424a61ded1cf692549f727aae65c2911848.jpeg', NULL, NULL, NULL, NULL, NULL, NULL, 'id', NULL, '2021-06-30 10:12:14'),
(22, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'uploads/994f98b05f663c46b7ae9cd045632cfa689855.jpg', NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-06-18 07:42:24'),
(23, 11, 'Siapa Kami', NULL, '<p>Cloudeka adalah penyedia layanan Cloud yang berdiri sejak tahun 2010. Lahir dari perusahaan ICT ternama di tanah air,&nbsp;Lintasarta, menyediakan layanan Cloud baik untuk perusahaan besar maupun kecil-menengah. Dikenal sebagai penyedia Cloud dari dan untuk Indonesia yang memiliki pemahaman yang kuat akan kebutuhan pasar, khususnya di Indonesia. Cloudeka terus berdedikasi untuk membangun dan memelihara kemitraan yang kuat untuk meningkatkan bisnis lokal melalui penyediaan layanan Cloud <em>end-to-end</em>.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', NULL, '2021-09-27 04:48:49'),
(24, 11, 'Who <br>We Are', NULL, '<p>Cloudeka is a Cloud service provider that has been established since 2010. Born by a well-known ICT company in the country, Lintasarta, provides Cloud services for both large and small-medium enterprises. Known as a Cloud provider from and for Indonesia which has a strong understanding of market needs, especially in Indonesia. Cloudeka will&nbsp;continuously put efforts and dedications&nbsp;to build and maintain strong partnerships to enhance local businesses through the provision of end-to-end Cloud services.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-09-27 04:49:53'),
(25, 12, 'Mengapa <br>Lintasarta Cloudeka?', NULL, '<p><strong>Keahlian Lokal</strong></p>\r\n\r\n<p>Keahlian kami dalam menjadi penyedia Cloud di Indonesia memberi kami pemahaman yang lebih baik tentang kebutuhan pasar lokal untuk memberikan solusi terbaik untuk meningkatkan dan membantu perusahaan di Indonesia.</p>\r\n\r\n<p><strong>Komunikatif</strong></p>\r\n\r\n<p>Kami selalu menjaga kepercayaan pelanggan terhadap Cloudeka. Komunikasi yang transparan dan jujur ​​terus dilakukan sehingga pelanggan tidak perlu khawatir dengan layanan yang tidak transparan atau biaya yang ditagih secara tiba-tiba.</p>\r\n\r\n<p><strong>Untuk Semua Model Bisnis</strong></p>\r\n\r\n<p>Cloudeka membuka peluang bagi perusahaan besar dan kecil-menengah untuk menggunakan layanan cloud untuk meningkatkan bisnis mereka.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', NULL, '2021-07-13 09:17:44'),
(26, 12, 'Why <br>Lintasarta Cloudeka?', NULL, '<p><strong>Local Expertise</strong><br />\r\nOur expertise in being a Cloud provider in Indonesia gives us a better understanding of the local market needs to provide the best solutions in&nbsp;scaling&nbsp;up and helping companies in Indonesia.</p>\r\n\r\n<p><strong>Communicative</strong><br />\r\nWe always maintain customer trust in Cloudeka. Transparent and honest communication are&nbsp;continuously carried out, so that customers do not have to worry about the hidden services or fees being billed suddenly.</p>\r\n\r\n<p><strong>For All Business Model</strong><br />\r\nCloudeka opens opportunities for large and small-medium enterprises to use Cloud services to enhance their business.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-07-13 09:05:43'),
