(31, 15, 'Bagian dari <br>Lintasarta', NULL, '<p>Lintasarta merupakan perusahaan Business-to-Business (B2B) yang bergerak di bidang<em> Information and Communication Technology</em> (ICT). Sejak tahun 1988, Lintasarta telah menyediakan jasa Komunikasi Data, Internet dan IT Services untuk berbagai sektor industri. Saat ini Lintasarta telah melayani lebih dari 2.400 pelanggan korporasi dengan lebih 45.000 jaringan yang meliputi layanan komunikasi data fiber optik, jaringan satelit, Managed Security &amp; Collaboration, Data Center dan DRC, Cloud computing, Managed Services, Telemedicine, SIMRS, e-KYC, Third Party Card Management, IT Operation &amp; Outsourcing, dan solusi total komunikasi data.</p>\r\n\r\n<p>Lintasarta memberikan layanan profesional mulai dari layanan pra-jual melalui konsultan bisnis, network engineer untuk penilaian dan desain solusi pelanggan, hingga layanan purna jual yang memadai seperti Customer Assistant Representative (CAR). Layanan professional kami didukung oleh lebih dari 1.000 staff berpengalaman di antaranya memiliki sertifikasi Internasional &nbsp;yang tersebar di lebih dari 44 kota di Indonesia.</p>\r\n\r\n<p>Lintasarta memberikan jaminan ketersediaan koneksi jaringan (SLA) sebesar 99%, 99,9% dan 99,99% sesuai kebutuhan para pelanggannya, dengan dukungan multimedia akses yaitu Fiber Optik, Broadband Wireless Access dan Satelit, serta multi-Backbone yang sepenuhnya didukung&nbsp;dan terkontrol melalui Network Monitoring System.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', NULL, '2021-07-13 09:19:24'),
(32, 15, 'Part of <br>Lintasarta', NULL, '<p>Lintasarta is a Business-to-Business (B2B) company engaged in Information and Communication Technology (ICT). Since 1988, Lintasarta serves as Data Communication, Internet and IT Services for diversified industries. To this day, Lintasarta has been serving more than 2.400 corporate customers with greater than 45.000 networks including Fiber Optic Data Communication Service, Satellite Network, Managed Security &amp; Collaboration, Data Center dan DRC, Cloud computing, Managed Services, Telemedicine, SIMRS, e-KYC, Third-Party Card Management, IT Operation &amp; Outsourcing, and data communication total solutions.</p>\r\n\r\n<p>Lintasarta gives professional services start from pre-sales services through a business consultant, network engineers for assessment, and customer design solution to capable after- sales services such as Customer Assistant Representative (CAR). Our professional services are supported by more than 1.000 experienced staffs with international certifications spread in more than 44 cities of Indonesia.</p>\r\n\r\n<p>Lintasarta guarantees network connection availability (SLA) up to 99%, 99,9%, and 99,99% based on customer needs, with full support of multimedia accesses, namely Fiber Optic, Broadband Wireless Access and Satellite, and Multi-backbone that has been fully backed up and controlled by Network Monitoring System.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-06-05 03:53:21'),
