(37, 19, 'Produk', 'Produk', 'Produk Lintasarta Cloudeka dikembangkan dengan partner ternama untuk web/aplikasi hosting untuk mengkonsolidasikan Data Center Anda dengan aman, mudah, dan hemat biaya tanpa harus membangun infrastruktur TI Anda sendiri.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', NULL, '2021-07-15 12:25:49'),
(38, 19, 'Products', 'Cloud Product, Lintasarta Cloud, Cloud', 'Lintasarta Cloudeka products developed with well-known partners for web/application hosting to consolidate your Data Center safely, easily, and cost-effectively without having to build your own IT infrastructure.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', NULL, '2021-07-12 08:42:05'),
