(128, 68, 'Overview', NULL, '<p>What is the Join Cloudeka Partner Program ?<br />\r\nPartners who leverage Cloudeka to build solutions and services for customers.&nbsp;&nbsp;helps Partners build, market, and sell cloudeka services offering. Cloudeka Partners are positioned as Reseller and Wholesales.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', '2021-12-10 05:12:24', '2021-12-10 00:49:53'),
(129, 69, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', '2021-12-10 05:12:24', '2021-12-10 05:12:24'),
(130, 69, 'Partner Program', NULL, '<p>Cloudeka offers programs to help succeed any stage of partner cloud adoption journey. Unlock more benefits and programs as you progress through your Cloudeka Partner journey.<br />\r\nCloudeka Partner Programs provide with benefits and promotional support including increased visibility, opportunities, access to benefits and go-to-market resources, and more</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'en', '2021-12-10 05:12:24', '2021-12-10 00:50:15'),
(131, 70, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'id', '2021-12-10 05:12:24', '2021-12-10 05:12:24'),
