INSERT INTO `solution_translations` (`id`, `solution_id`, `title`, `slug`, `subtitle`, `images`, `logo_1`, `logo_2`, `excerpt`, `description`, `lang`, `created_at`, `updated_at`) VALUES
(1, 1, 'Banking', 'banking', 'Why Choose Us For<br>Banking Solutions?', 'imgs/solutions/solution-detail.jpg', 'imgs/solutions/svg/solutions/banking.svg', 'imgs/solutions/svg/solutions/banking-blue.svg', 'Indonesia\'s locally-developed Cloud for banking sector to enhance customer services.', '<p>The financial industry plays a strategic role in the economy of Indonesia, especially in the digital era. With increasingly fierce competition in the industry, Lintasarta Cloudeka is here to provide Indonesia&#39;s locally-developed technological innovations to give the best secure, fast, accessible, and good quality services to all customers, wherever they happen to be.</p>', 'en', '2021-05-12 20:08:17', '2021-06-14 02:37:11'),
(2, 1, 'Perbankan', 'perbankan', 'Mengapa Memilih Kami Untuk<br>Solusi Perbankan?', 'imgs/solutions/solution-detail.jpg', 'imgs/solutions/svg/solutions/banking.svg', 'imgs/solutions/svg/solutions/banking-blue.svg', 'Cloud untuk sektor perbankan yang dikembangkan secara lokal di Indonesia untuk meningkatkan layanan pelanggan.', '<p>Lintasarta menawarkan rangkaian solusi yang komprehensif untuk menjawab berbagai kebutuhan dalam hal penyampaian informasi dan komunikasi yang memungkinkan antara pemerintah dan masyarakat luas. Solusi komunikasi Lintasarta meningkatkan efisiensi dan efektivitas penyampaian informasi dan komunikasi yang memungkinkan, sehingga memungkinkan institusi pemerintah untuk merespon dengan cepat, tepat, efektif dan akurat terhadap isu-isu yang berkembang di masyarakat.</p>', 'id', '2021-05-12 20:08:17', '2021-06-29 13:36:57'),
(3, 2, 'Finance Non-Bank', 'finance-non-bank', 'Why Choose Us For<br>Finance Non-Bank Solutions?', 'imgs/solutions/solution-detail.jpg', 'imgs/solutions/svg/solutions/banking.svg', 'imgs/solutions/svg/solutions/banking-blue.svg', 'Locally developed Cloud solutions for insurance, fintech, investment, etc.', '<p>The rapid economic growth in Indonesia is also marked by the occurrence of Finance Non-Bank companies such as Insurance, Fintech, Investment, and others in Indonesia. The need for a fast and secure digital Cloud for the Finance Non-Bank industry can be met by using Lintasarta Cloudeka. Supported by an extensive network, high security, and developed locally by Indonesians Lintasarta Cloudeka is ready to help the Finance Non-Bank industry to strive forward.&nbsp;&nbsp; &nbsp;&nbsp;</p>', 'en', '2021-05-12 20:09:35', '2021-06-14 03:18:18'),
(4, 2, 'Keuangan Non-Bank', 'keuangan-non-bank', 'Mengapa Memilih Kami Untuk Solusi Keuangan Non-Bank?', 'imgs/solutions/solution-detail.jpg', 'imgs/solutions/svg/solutions/banking.svg', 'imgs/solutions/svg/solutions/banking-blue.svg', 'Solusi Cloud yang dikembangkan secara lokal untuk asuransi, fintech, investasi, dll.', '<p>Pesatnya pertumbuhan ekonomi di Indonesia juga ditandai dengan munculnya perusahaan Pembiayaan Non Bank seperti Asuransi, Fintech, Investasi, dan lain-lain di Indonesia. Kebutuhan Cloud digital yang cepat dan aman untuk industri Keuangan Non-Bank dapat dipenuhi dengan menggunakan Lintasarta Cloudeka. Didukung oleh jaringan yang luas, keamanan yang tinggi, dan dikembangkan secara lokal oleh masyarakat Indonesia Lintasarta Cloudeka siap membantu industri Keuangan Non Bank untuk maju.</p>', 'id', '2021-05-12 20:09:35', '2021-07-15 12:28:34'),
(5, 3, 'Government', 'government', 'Why Choose Us For <br>Government Solutions?', 'solution/FvB2FSazNfQThttP9jDxu99ggtRBKPS8qy3HruXZ.jpg', 'solution/LpvenvHDMM7wCGkJ6EOiY4Vkj4Et1IoDTMfW3AfE.svg', 'solution/vLLORVVcqGt4GlJzxrlOVFSJK45Eka9LEWfSKrfD.svg', 'From storage to IOT technology, optimize your plan with Cloud for government.', '<p>As public entities or government institutions, you are required to provide accurate and transparent information. Due to the rapid proliferation of technology, the public begins to demand unfettered access and the freedom to interact with others to express their aspirations, feedback, suggestions, and even convey complaints directly to the government. To this end, Lintasarta Cloudeka is here to cater to the needs of Cloud for government to enabling communication between the government and the wider public.</p>', 'en', '2021-05-21 08:38:35', '2021-06-15 04:42:53'),
(6, 3, 'Pemerintahan', 'pemerintahan', 'Mengapa Memilih Kami Untuk <br>Solusi Pemerintah?', 'solution/FvB2FSazNfQThttP9jDxu99ggtRBKPS8qy3HruXZ.jpg', 'solution/LpvenvHDMM7wCGkJ6EOiY4Vkj4Et1IoDTMfW3AfE.svg', 'solution/vLLORVVcqGt4GlJzxrlOVFSJK45Eka9LEWfSKrfD.svg', 'Dari penyimpanan hingga teknologi IOT, optimalkan paket Anda dengan Cloud for government.', '<p>Sebagai entitas publik atau lembaga pemerintah, Anda wajib memberikan informasi yang akurat dan transparan. Akibat pesatnya perkembangan teknologi, masyarakat mulai menuntut akses yang tidak terbatas dan kebebasan berinteraksi dengan orang lain untuk menyampaikan aspirasi, masukan, saran, bahkan menyampaikan keluhan secara langsung kepada pemerintah. Untuk itu, Lintasarta Cloudeka hadir untuk memenuhi kebutuhan Cloud bagi pemerintah untuk memungkinkan komunikasi antara pemerintah dan masyarakat luas.</p>', 'id', '2021-05-21 08:38:35', '2021-06-29 13:35:09'),
(7, 4, 'Resources', 'resources', 'Why Choose Us For <br>Resources Solutions?', 'solution/xrPmBcuTYJxZkCJ55CDSAu4pixIWwLqf6s5DxUtR.jpg', 'solution/5dP7MsTzNkXantwWxWP3SVYYOO7W27QpmoBaJLec.svg', 'solution/X0DFJiQsiH3cu9U4FiiCoZ0bnnYLxBimWbwFAEKN.svg', 'Find out the best Cloud solutions for mining, oil and gas companies.', '<p>Oil and gas, EPC (Engineering, Procurement, Construction), mining, and plantation companies have experienced growing energy needs and transforming complex operational systems into digital and fast agile. With Lintasarta Cloudeka, digital transformation for the resources industry will be easier to implement because it is supported by a wide-range network, safe, easy to use, and, of course, locally-developed by Indonesians.</p>', 'en', '2021-05-21 08:48:51', '2021-06-15 04:43:58'),
(8, 4, 'Sumber Daya', 'sumber-daya', 'Mengapa Memilih Kami Untuk <br>Solusi Perbankan?', 'solution/xrPmBcuTYJxZkCJ55CDSAu4pixIWwLqf6s5DxUtR.jpg', 'solution/5dP7MsTzNkXantwWxWP3SVYYOO7W27QpmoBaJLec.svg', 'solution/X0DFJiQsiH3cu9U4FiiCoZ0bnnYLxBimWbwFAEKN.svg', 'Temukan solusi Cloud terbaik untuk perusahaan pertambangan, minyak dan gas.', '<p>Perusahaan minyak dan gas, EPC (Engineering, Procurement, Construction), pertambangan, dan perkebunan telah mengalami pertumbuhan kebutuhan energi dan mengubah sistem operasional yang kompleks menjadi digital dan cepat gesit. Dengan Lintasarta Cloudeka, transformasi digital untuk industri sumber daya akan lebih mudah diterapkan karena didukung oleh jaringan yang luas, aman, mudah digunakan, dan tentunya dikembangkan secara lokal oleh masyarakat Indonesia.</p>\r\n\r\n<p>&nbsp;</p>', 'id', '2021-05-21 08:48:51', '2021-06-29 13:32:23'),
(9, 5, 'Agriculture', 'agriculture', 'Why Choose Us For <br>Agriculture Solutions?', 'solution/pSugufPV06zgQivfqaujmfge7DumHVRNSN7h1U6n.jpg', 'solution/eANexliyFvikDhHfzVjvrGGMWeTAdVGn2ee8nWwV.svg', 'solution/DJP5jfTylHAzmqeku3sVwy4SDHFYiQoiQ96Ue9Z8.svg', 'Support local farmers’ welfare with Cloud solutions from Lintasarta Cloudeka.', '<p>The plantation industry is now required to transform and harness the value of technology for the welfare of farmers. The use of Cloud for the agricultural industry can be done easily with Lintasarta Cloudeka, which provides Indonesia&#39;s locally-developed Cloud technology solutions that are agile, safe, accessible, and supported by various comprehensive supporting features.</p>', 'en', '2021-05-21 08:58:44', '2021-06-15 04:45:42'),
(10, 5, 'Plantation', 'plantation', 'Mengapa Memilih Kami Untuk <br>Solusi Perkebunan?', 'solution/pSugufPV06zgQivfqaujmfge7DumHVRNSN7h1U6n.jpg', 'solution/eANexliyFvikDhHfzVjvrGGMWeTAdVGn2ee8nWwV.svg', 'solution/DJP5jfTylHAzmqeku3sVwy4SDHFYiQoiQ96Ue9Z8.svg', 'Dukung kesejahteraan petani lokal dengan solusi Cloud dari Lintasarta Cloudeka.', '<p>Industri perkebunan kini dituntut untuk mentransformasikan dan memanfaatkan nilai teknologi untuk kesejahteraan petani. Penggunaan Cloud untuk industri pertanian dapat dilakukan dengan mudah dengan Lintasarta Cloudeka yang menyediakan solusi teknologi Cloud pengembangan lokal Indonesia yang lincah, aman, mudah diakses, dan didukung oleh berbagai fitur pendukung yang lengkap.</p>', 'id', '2021-05-21 08:58:44', '2021-06-29 13:37:30'),
(11, 6, 'Manufacture', 'manufacture', 'Why Choose Us For <br>Manufacturing Solutions?', 'solution/ezEGEi6ZyWr1hZ5tAFVB7qIp5gbv6D7Oi3mgHbOW.jpg', 'solution/Pzyuvsayas6DQyjdhVDc5Ejvx699yaOd7HwORrfV.svg', 'solution/rLeYLRwtZjI0ZrgmynwHmTYUPlWpy4qZIKwZisSo.svg', 'Accelerate digital transformation manufacture industry with Lintasarta Cloudeka.', '<p>The manufacturing industry has had to address numerous changes in the demands of the market, such as modifying its business patterns and operations, including its product marketing methods. Inevitable advances in technology and innovations, meanwhile, have driven ever greater investment in technology. Lintasarta Cloudeka offers Cloud solutions for the manufacturing industry to emerge victorious in today&rsquo;s fiercely competitive business environment.</p>', 'en', '2021-05-21 09:01:56', '2021-06-29 13:33:18'),
(12, 6, 'Industri Manufaktur', 'industri-manufaktur', 'Mengapa Memilih Kami Untuk <br>Solusi Manufaktur?', 'solution/ezEGEi6ZyWr1hZ5tAFVB7qIp5gbv6D7Oi3mgHbOW.jpg', 'solution/Pzyuvsayas6DQyjdhVDc5Ejvx699yaOd7HwORrfV.svg', 'solution/rLeYLRwtZjI0ZrgmynwHmTYUPlWpy4qZIKwZisSo.svg', 'Percepat transformasi digital industri manufaktur dengan Lintasarta Cloudeka.', '<p>Industri manufaktur harus mengatasi banyak perubahan dalam tuntutan pasar, seperti memodifikasi pola bisnis dan operasinya, termasuk metode pemasaran produknya. Kemajuan teknologi dan inovasi yang tak terhindarkan, sementara itu, telah mendorong investasi yang semakin besar dalam teknologi. Lintasarta Cloudeka menawarkan solusi Cloud bagi industri manufaktur untuk menjadi pemenang dalam lingkungan bisnis yang sangat kompetitif saat ini.</p>', 'id', '2021-05-21 09:01:56', '2021-06-29 13:33:05'),
(13, 7, 'Higher Education', 'higher-education', 'Why Choose Us For <br>Higher Education <br>Solutions?', 'solution/7kC9aG95kg91OWpveqo9OBbum8UVs7k5vgN9uiaS.jpg', 'solution/oHJERHSJ7Y4wH4N5XFce4bfQyvTuxzMjsNLwV5My.svg', 'solution/EaDmgxe8KAHwwg6iWW3IaxhnTZ4tospGZKJwQUkA.svg', 'Optimize Education 4.0 for universities in Indonesia with Lintasarta Cloudeka.', '<p>Digitalization in the higher education industry is increasingly driven by the development of technology use in Indonesia. Lintasarta Cloudeka comes with Cloud solutions for the education industry to facilitate the teaching and learning process to the modernization of IT operations at universities. Supported by a wide-range network, secure, accessible, and, of course, locally-developed by Indonesians, Lintasarta Cloudeka is ready to assist universities to face the evolution of the education 4.0 trend.</p>', 'en', '2021-05-21 09:03:20', '2021-06-15 04:48:21'),
(14, 7, 'Pendidikan', 'pendidikan', 'Mengapa Memilih Kami Sebagai Solusi <br>Pendidikan Tinggi?', 'solution/7kC9aG95kg91OWpveqo9OBbum8UVs7k5vgN9uiaS.jpg', 'solution/oHJERHSJ7Y4wH4N5XFce4bfQyvTuxzMjsNLwV5My.svg', 'solution/EaDmgxe8KAHwwg6iWW3IaxhnTZ4tospGZKJwQUkA.svg', 'Optimalkan Pendidikan 4.0 untuk Perguruan Tinggi di Indonesia dengan Lintasarta Cloudeka.', '<p>Digitalisasi di industri pendidikan tinggi semakin didorong oleh perkembangan penggunaan teknologi di Indonesia. Lintasarta Cloudeka hadir dengan solusi Cloud untuk industri pendidikan untuk memfasilitasi proses belajar mengajar hingga modernisasi operasional TI di perguruan tinggi. Didukung jaringan yang luas, aman, mudah diakses, dan tentunya dikembangkan secara lokal oleh masyarakat Indonesia, Lintasarta Cloudeka siap membantu perguruan tinggi menghadapi evolusi tren pendidikan 4.0.</p>', 'id', '2021-05-21 09:03:20', '2021-06-29 13:34:38'),
(15, 8, 'Hospital', 'hospital', 'Why Choose Us For <br>Hospital Solutions?', 'solution/ihiF5yqcuXxLayE1bZriGf41htwKJU5QWwlJBzxC.jpg', 'solution/ZWVP2iUGF2tVZgTuzZHl0CHSb5Qf8Pz4aUC4G2PA.svg', 'solution/QG1oLepczaUT1HsXAIdDnL7hNAdmvO7mXw3FoWkT.svg', 'Enhance the patient services with Cloud selections for hospitals and clinics.', '<p>Hospital Information Systems (HIS) and Telemedicine are now being developed by various hospitals in Indonesia. Equipped with the Cloud technology that is secure and accessible, Lintasarta Cloudeka, Indonesia&#39;s locally-developed Cloud solution provider, is able to help hospitals in Indonesia to transform and improve health services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'en', '2021-05-21 09:05:51', '2021-06-15 04:49:13'),
(16, 8, 'Rumah Sakit', 'rumah-sakit', 'Mengapa Memilih Kami Untuk <br>Solusi Rumah Sakit?', 'solution/ihiF5yqcuXxLayE1bZriGf41htwKJU5QWwlJBzxC.jpg', 'solution/ZWVP2iUGF2tVZgTuzZHl0CHSb5Qf8Pz4aUC4G2PA.svg', 'solution/QG1oLepczaUT1HsXAIdDnL7hNAdmvO7mXw3FoWkT.svg', 'Tingkatkan layanan pasien dengan pilihan Cloud untuk rumah sakit dan klinik.', '<p>Sistem Informasi Rumah Sakit (HIS) dan Telemedicine saat ini sedang dikembangkan oleh berbagai rumah sakit di Indonesia. Dilengkapi dengan teknologi Cloud yang aman dan mudah diakses, Lintasarta Cloudeka, penyedia solusi Cloud yang dikembangkan secara lokal di Indonesia, mampu membantu rumah sakit di Indonesia untuk bertransformasi dan meningkatkan layanan kesehatan.</p>', 'id', '2021-05-21 09:05:51', '2021-06-29 13:33:39'),
(17, 9, 'Telecommunication', 'telecommunication', 'Why choose us for <br>Telecommunication Solutions?', 'solution/qpTUmkMNn9YCYy2CPGf3YSunS0g8e5GX5s43sQDe.jpg', 'solution/Ops50Gxf37NGxbLcXbifTxi5hewhPqBDDl0eTGQY.svg', 'solution/U3MsO0LDk00p5lNJPPLcqFlZQtq1a060ws8cPHNa.svg', 'Agile, secure, and flexible Cloud solutions for telecommunications industry.', '<p>As one of the world&#39;s most dynamic ecosystems, the telecommunications industry is constantly evolving. Fueled by an ever greater number of technological advances and innovations in the service sector in this age of digitalization, Cloud solution for the telecommunication industry from Lintasarta Cloudeka to relentlessly pursue innovations and remain vigilant to developments in supporting technology.</p>', 'en', '2021-05-21 09:07:47', '2021-06-15 04:51:00'),
(18, 9, 'Telco', 'telco', 'Mengapa memilih kami untuk <br>Telco Solutions?', 'solution/qpTUmkMNn9YCYy2CPGf3YSunS0g8e5GX5s43sQDe.jpg', 'solution/Ops50Gxf37NGxbLcXbifTxi5hewhPqBDDl0eTGQY.svg', 'solution/U3MsO0LDk00p5lNJPPLcqFlZQtq1a060ws8cPHNa.svg', 'Solusi Cloud yang gesit, aman, dan fleksibel untuk industri telekomunikasi.', '<p>Sebagai salah satu ekosistem paling dinamis di dunia, industri telekomunikasi terus berkembang. Didorong oleh semakin banyaknya kemajuan teknologi dan inovasi di bidang jasa di era digitalisasi ini, solusi Cloud untuk industri telekomunikasi dari Lintasarta Cloudeka untuk terus berinovasi dan tetap waspada terhadap perkembangan teknologi pendukung.</p>\r\n\r\n<p>&nbsp;</p>', 'id', '2021-05-21 09:07:47', '2021-06-29 13:31:58'),
(19, 10, 'Digital Company', 'digital-company', 'Why choose us for <br>Digital Company <br>Solutions?', 'solution/dSbMBdVSHHARC3qU7CrBGJL3HzP2rVZd0j5B7803.jpg', 'solution/DmnCdOdGAWYksaAPTsy8rtuwFAySLBhKkNuyKOrf.svg', 'solution/t3aSupf1rdJNUbWin9sln4VstYasKpgadCwYaCVz.svg', 'Be a market leader with reliable digital solutions supported by Lintasarta Cloudeka.', '<p>The digitalization age has changed the market demand pattern of the media industry, especially digital media. Furthermore, with the increasingly widespread use of smartphones, the phenomenon of social media, and a whole host of affordable Internet package deals, the media industry is faced with adapting to the changing lifestyles of customers with a voracious appetite for information. Lintasarta Cloudeka, Indonesia&#39;s locally-developed Cloud provider, is able to enhance the digital company to meet their needs and keep moving forward.</p>', 'en', '2021-05-21 09:09:37', '2021-06-15 04:51:49'),
(20, 10, 'Perusahaan DIgital', 'perusahaan-digital', 'Mengapa memilih kami untuk <br>Solusi <br>Perusahaan Digital?', 'solution/dSbMBdVSHHARC3qU7CrBGJL3HzP2rVZd0j5B7803.jpg', 'solution/DmnCdOdGAWYksaAPTsy8rtuwFAySLBhKkNuyKOrf.svg', 'solution/t3aSupf1rdJNUbWin9sln4VstYasKpgadCwYaCVz.svg', 'Menjadi pemimpin pasar dengan solusi digital andal yang didukung oleh Lintasarta Cloudeka.', '<p>Era digitalisasi telah mengubah pola permintaan pasar industri media, khususnya media digital. Selain itu, dengan semakin meluasnya penggunaan smartphone, fenomena media sosial, dan berbagai penawaran paket Internet yang terjangkau, industri media dihadapkan pada adaptasi dengan perubahan gaya hidup pelanggan dengan selera informasi yang rakus. Lintasarta Cloudeka, penyedia Cloud yang dikembangkan secara lokal di Indonesia, mampu meningkatkan perusahaan digital untuk memenuhi kebutuhan mereka dan terus bergerak maju.</p>', 'id', '2021-05-21 09:09:37', '2021-07-15 13:36:53'),
(21, 11, 'Reseller & Wholesale', 'reseller-wholesale', 'Why Choose Us For<br>Reseller & Wholesale Solutions?', 'solution/3513a67d4d078c335676405e7bcff766900223.jpg', 'solution/bd91b5489e6a013ae1e44c42faf14c0b160446.svg', 'solution/e2622d0123e2f4cd7cbe08d927a23a3e188625.svg', 'In Digitalization era has multiple technology, One of the technologies that are currently on trend and advanced as solutions is the cloud computing. Lintasarta Cloudeka comes with Cloud solutions that offering reseller and wholesales program to the partner. Supported by an extensive network, high security, and developed locally by Indonesians Lintasarta Cloudeka is ready to help the partner to strive forward.', '<p>In Digitalization era has multiple technology, One of the technologies that are currently on trend and advanced as solutions is the cloud computing. Lintasarta Cloudeka comes with Cloud solutions that offering reseller and wholesales program to the partner. Supported by an extensive network, high security, and developed locally by Indonesians Lintasarta Cloudeka is ready to help the partner to strive forward.</p>', 'en', '2021-10-26 06:34:24', '2021-10-26 07:41:08'),
(22, 11, 'Reseller & Wholesale', 'reseller-wholesale', 'Mengapa Memilih Kami Untuk Solusi <br>Reseller & Wholesale?', 'solution/3513a67d4d078c335676405e7bcff766103313.jpg', 'solution/bd91b5489e6a013ae1e44c42faf14c0b819516.svg', 'solution/e2622d0123e2f4cd7cbe08d927a23a3e508468.svg', 'In Digitalization era has multiple technology, One of the technologies that are currently on trend and advanced as solutions is the cloud computing. Lintasarta Cloudeka comes with Cloud solutions that offering reseller and wholesales program to the partner. Supported by an extensive network, high security, and developed locally by Indonesians Lintasarta Cloudeka is ready to help the partner to strive forward.', '<p>In Digitalization era has multiple technology, One of the technologies that are currently on trend and advanced as solutions is the cloud computing. Lintasarta Cloudeka comes with Cloud solutions that offering reseller and wholesales program to the partner. Supported by an extensive network, high security, and developed locally by Indonesians Lintasarta Cloudeka is ready to help the partner to strive forward.</p>', 'id', '2021-10-26 06:34:24', '2021-10-26 07:41:36');
