INSERT INTO `use_case_translations` (`id`, `use_case_id`, `description`, `lang`, `created_at`, `updated_at`) VALUES
(1, 1, '<p>Askrindo uses Deka Prime (PX1)&nbsp;by Lintasarta Cloudeka to serve the needs of their customers. They have also successfully used the Resource Pool service, integrate to Cloud Backup, Disaster Recovery services, and is connected directly to the customer&#39;s location.</p>', 'en', '2021-05-10 22:42:00', '2021-06-23 15:31:34'),
(2, 1, '<p>Askrindo menggunakan Deka Prime (PX1) dari Lintasarta Cloudeka untuk memenuhi kebutuhan bisnis pelanggan. Selain itu, Askrindo juga telah berhasil menggunakan layanan Resource Pool serta terintegrasi dengan layan Cloud Backup, Disaster Recovery, dan terhubung langsung ke lokasi pelanggan.</p>', 'id', '2021-05-10 22:42:00', '2021-06-23 15:31:29'),
(3, 2, '<p>Dirjen APTIKA built a Disaster Recovery Center cluster on Cloud which is linked to Kominfo Data Center for web filtering.</p>', 'en', '2021-05-21 08:26:04', '2021-06-04 07:27:36'),
(4, 2, '<p>Dirjen APTIKA membangun Disaster Recovery Center cluster on Cloud yang terhubung secara langsung ke Data Center milik Kominfo untuk melakukan web filtering.<br />\r\n&nbsp;</p>', 'id', '2021-05-21 08:26:04', '2021-06-04 10:32:52'),
(7, 4, '<p>Lintasarta Cloudeka&#39;s Deka Prime (PX1) Service is used for the back-office application of PDAM Bandarmasih.</p>', 'en', '2021-05-21 08:26:04', '2021-06-05 09:29:04'),
(8, 4, '<p>Layanan Deka Prime (PX1) milik Lintasarta Cloudeka digunakan untuk keperluan aplikasi back-office PDAM Bandarmasih.</p>', 'id', '2021-05-21 08:26:04', '2021-06-05 09:29:21'),
(27, 14, '<p>BAKTI utilises the Deka Prime (PX1) service from Lintasarta Cloudeka which has successfully been implemented to monitor the VSAT connection all around Indonesia. The data storage is deployed in the Lintasarta Disaster Recovery Center at Jatiluhur that is directly connected to Lintasarta VSAT.</p>', 'en', '2021-06-04 07:26:40', '2021-06-05 09:32:12'),
(28, 14, '<p>BAKTI memanfaatkan Layanan Deka Prime (PX1) milik Lintasarta Cloudeka yang telah behasil mengawasi jaringan VSAT se-Indonesia. Penyimpanan data diimplementasikan di Lintasarta Disaster Recovery Center Jatiluhur yang langsung terhubung ke VSAT milik Lintasarta.</p>', 'id', '2021-06-04 07:26:40', '2021-06-04 10:29:30'),
(29, 15, '<p>KSO Sucofindo uses Deka Vault by duplicating the data in their on-premise Data Center to the Cloud Disaster Recovery Center. So that all data is stored safely in the event of a disaster and other catastrophes.</p>', 'en', '2021-06-04 11:20:18', '2021-06-04 11:20:43'),
(30, 15, '<p>KSO Sucofindo menggunakan Deka Vault dengan menggandakan data di Data Center on-premise mereka ke Cloud Disaster Recovery Center. Sehingga seluruh data tersimpan aman jika terjadi bencana dan hal buruk lainnya.</p>', 'id', '2021-06-04 11:20:18', '2021-06-04 11:20:18'),
(31, 16, '<p>PHSS built end-to-end (private) Cloud Priority clusters for Data Center and Disaster Recovery Center. Also, PHSS combines Baremetal and Virtual Machine at more than two different sites, including at their customers&#39; location.<br />\r\n&nbsp;</p>', 'en', '2021-06-04 12:34:42', '2021-06-04 12:34:42'),
(32, 16, '<p>PHSS membangun end-to-end (private) Cloud Priority cluster untuk Data Center dan Disaster Recovery Center. Tidak hanya itu, PHSS mengombinasikan Baremetal dan Virtual Machine untuk di lebih dari dua lokasi, termasuk di lokasi pelanggan mereka.<br />\r\n&nbsp;</p>', 'id', '2021-06-04 12:34:42', '2021-06-04 12:35:13'),
(33, 17, '<p>Lintasarta Cloudeka has successfully assisted SAKA in migrating and building an end-to-end (private) Cloud Priority cluster for the Data Center and Disaster Recovery Center.<br />\r\n&nbsp;</p>', 'en', '2021-06-04 12:37:30', '2021-06-04 12:38:44'),
(34, 17, '<p><br />\r\nLintasarta Cloudeka berhasil membantu SAKA dalam bermigrasi dan membangun end-to-end (private) Cloud Priority cluster untuk Data Center dan Disaster Recovery Center</p>', 'id', '2021-06-04 12:37:30', '2021-06-04 12:37:54'),
(35, 18, '<p>Not only they built an end-to-end (private) Cloud Priority cluster for Data Centers and Disaster Recovery Centers, CRIF also uses Managed Replication services and combines Baremetal and Virtual Machines with Lintasarta Cloudeka.<br />\r\n&nbsp;</p>', 'en', '2021-06-04 12:39:09', '2021-06-04 12:39:41'),
(36, 18, '<p>Selain membangun end-to-end (private) Deka Priority cluster untuk Data Center dan Disaster Recovery Center, CRIF juga menggunakan layanan Managed Replication dan mengombinasikan Baremetal dan Virtual Machine.<br />\r\n&nbsp;</p>', 'id', '2021-06-04 12:39:09', '2021-06-04 12:39:09'),
(37, 19, '<p>TBC</p>', 'en', '2021-06-04 12:40:15', '2021-06-04 12:40:15'),
(38, 19, '<p>TBC</p>', 'id', '2021-06-04 12:40:15', '2021-06-04 12:40:15'),
(39, 20, '<p>BKKBN has successfully used Deka Harbor by Lintasarta Cloudeka service for the deployment of a family information system web application and as an Indonesian family database.</p>', 'en', '2021-06-04 12:59:34', '2021-06-04 12:59:59'),
(40, 20, '<p>BKKBN telah menikmati layanan Deka Harbor milik Lintasarta Cloudeka untuk deployment aplikasi web sistem informasi keluarga dan sebagai database keluarga masyarakat Indonesia.</p>', 'id', '2021-06-04 12:59:34', '2021-06-04 12:59:34'),
(41, 21, '<p>Kominfo Pusbang uses Deka Harbor from Lintasarta Cloudeka for the development of a digital scholarship website that can be accessed by more than 1,000 users.<br />\r\n&nbsp;</p>', 'en', '2021-06-04 13:06:45', '2021-06-04 13:06:45'),
(42, 21, '<p><br />\r\nKominfo Pusbang menggunakan Deka Harbor dari Lintasarta Cloudeka untuk pengembangan website digital scholarship yang dapat diakses lebih dari 1.000 pengguna.</p>', 'id', '2021-06-04 13:06:45', '2021-06-04 13:08:01'),
