(65, 33, '<p>One of our respectful clients on fintech have been using Deka Prime (PX1)&nbsp;by Lintasarta Cloudeka to serve the needs of their customers. They successfully used the Resource Pool service, integrated Cloud Backup, Disaster Recovery services, and connected directly to the customer&#39;s location.</p>', 'en', '2021-06-16 13:21:57', '2021-07-21 09:25:52'),
(66, 33, '<p>Salah satu klien terhormat kami di fintech telah menggunakan Deka Prime (PX1)&nbsp;oleh Lintasarta Cloudeka untuk melayani kebutuhan pelanggan mereka. Mereka berhasil menggunakan layanan Resource Pool, Cloud Backup terintegrasi, layanan Disaster Recovery, dan terhubung langsung ke lokasi pelanggan.</p>', 'id', '2021-06-16 13:21:57', '2021-07-21 09:26:00'),
(67, 34, '<p>Deka Prime (PX1)&nbsp;service from Lintasarta Cloudeka has been successfully used by one of the providers of ICT infrastructure and ecosystem for society which they implemented to monitor the VSAT connection all around Indonesia. The data storage is deployed in the Lintasarta Disaster Recovery Center at Jatiluhur that is directly connected to Lintasarta VSAT.</p>', 'en', '2021-06-16 13:24:01', '2021-07-21 09:26:27'),
(68, 34, '<p>Layanan Deka Prime (PX1)&nbsp;dari Lintasarta Cloudeka telah berhasil digunakan oleh salah satu penyedia infrastruktur dan ekosistem ICT untuk masyarakat yang mereka terapkan untuk memantau koneksi VSAT di seluruh Indonesia. Penyimpanan data tersebut ditempatkan di Lintasarta Disaster Recovery Center di Jatiluhur yang terhubung langsung dengan VSAT Lintasarta.</p>', 'id', '2021-06-16 13:24:01', '2021-07-21 09:26:34'),
(69, 35, '<p>One of the Ministry of Indonesia has built a Disaster Recovery Center cluster on Cloud which is linked to their Data Center for web filtering.</p>', 'en', '2021-06-16 13:26:04', '2021-07-13 11:56:45'),
(70, 35, '<p>Salah satu Kementerian RI telah membangun cluster Disaster Recovery Center di Cloud yang terhubung dengan Data Center mereka untuk web filtering</p>', 'id', '2021-06-16 13:26:04', '2021-07-13 11:59:46'),
(71, 36, '<p>Regional company in the city of Banjarmasin which is engaged as a provider of clean water facilities has used the product for the back-office application.</p>', 'en', '2021-06-16 13:27:10', '2021-07-13 11:58:02'),
(72, 36, '<p>Perusahaan Daerah di kota Banjarmasin yang bergerak sebagai penyedia fasilitas air bersih telah menggunakan untuk aplikasi back-office.</p>', 'id', '2021-06-16 13:27:10', '2021-07-13 12:00:56'),
(73, 37, '<p>One of the State-Owned Enterprises (BUMN) which functions for verification or technical investigation of imports and activities within the scope of Industry and Trade facilities has used Cloud Safe for duplicating the data in their on-premise Data Center to the Cloud Disaster Recovery Center. So that all data is stored safely in the event of a disaster and other catastrophes.</p>', 'en', '2021-06-16 13:27:39', '2021-06-16 13:27:39'),
(74, 37, '<p>Salah satu Badan Usaha Milik Negara (BUMN) yang berfungsi untuk verifikasi atau penelusuran teknis impor dan kegiatan dalam lingkup fasilitas Perindustrian dan Perdagangan telah menggunakan Cloud Safe untuk menduplikasi data dari Pusat Data di lokasi mereka ke Pusat Pemulihan Bencana Cloud. Sehingga semua data tersimpan&nbsp;dengan aman jika terjadi bencana dan malapetaka lainnya.</p>', 'id', '2021-06-16 13:27:39', '2021-07-13 12:01:50'),
(75, 38, '<p>Our clients who are engaged in international oil and gas operations have built end-to-end (private) Deka Premium&nbsp;clusters for Data Center and Disaster Recovery Center. They also combines Baremetal and Virtual Machine at more than two different sites, including at their customer&rsquo;s location.</p>', 'en', '2021-06-16 13:28:35', '2021-07-21 09:56:07'),
(76, 38, '<p>Klien kami yang terlibat dalam operasi minyak dan gas internasional telah membangun cluster Deka Premium <em>end-to-end (private)</em> untuk <em>Data Center</em> dan <em>Disaster Recovery Center</em>. Selain itu, mereka juga menggabungkan <em>Baremetal</em> dan <em>Virtual Machine</em> di lebih dari dua lokasi berbeda, termasuk di lokasi pelanggan mereka.</p>', 'id', '2021-06-16 13:28:35', '2021-07-21 09:57:38'),
(77, 39, '<p>Lintasarta Cloudeka has successfully assisted the Independent company in the field of oil &amp; gas exploration and production in Indonesia which assisted them in migrating and building an end-to-end (private) Deka Premium&nbsp;cluster for the Data Center and Disaster Recovery Center.</p>', 'en', '2021-06-16 13:28:59', '2021-07-21 09:58:12'),
(78, 39, '<p>Lintasarta Cloudeka telah berhasil membantu perusahaan Independen di bidang eksplorasi dan produksi minyak &amp; gas di Indonesia yang membantu mereka dalam migrasi dan membangun cluster Deka Premium <em>end-to-end (private)</em> untuk <em>Data Center</em> dan <em>Disaster Recovery Center</em>.</p>', 'id', '2021-06-16 13:28:59', '2021-07-21 09:58:39'),
(79, 40, '<p>Not only they built an end-to-end (private) Deka Premium cluster for Data Centers and Disaster Recovery Centers, Europe&#39;s leading global group in the field of banking credit information also uses Managed Replication services and combines Baremetal and Virtual Machines with Lintasarta Cloudeka.</p>', 'en', '2021-06-16 13:29:29', '2021-07-21 09:59:01'),
(80, 40, '<p>Tidak hanya membangun cluster Deka Premium <em>end-to-end (private)</em> untuk <em>Data Center</em> dan <em>Disaster Recovery Center</em>, grup global terkemuka Eropa di bidang informasi kredit perbankan juga menggunakan layanan <em>Managed Replication</em> dan menggabungkan <em>Baremetal </em>dan <em>Virtual Machine</em> dengan Lintasarta Cloudeka.</p>', 'id', '2021-06-16 13:29:29', '2021-07-21 09:59:29'),
(81, 41, '<p>One of the subsidiaries in the ministry that manages for Profession and Certification in Indonesia uses Deka Box from Lintasarta Cloudeka for data storage in the backend that can be accessed by more than 1.000 users.</p>', 'en', '2021-06-16 13:32:41', '2021-07-21 09:02:55'),
(82, 41, '<p>Salah satu anak perusahaan di kementerian yang mengelola Profesi dan Sertifikasi di Indonesia ini menggunakan Deka Box dari Lintasarta Cloudeka untuk penyimpanan data di backend yang dapat diakses lebih dari 1.000 pengguna.</p>', 'id', '2021-06-16 13:32:41', '2021-07-21 09:02:41'),
(83, 42, '<p>Deka Harbor from Lintasarta Cloudeka has assisted one of the subsidiaries in the ministry that manages for Profession and Certification in Indonesia for the development of a digital scholarship website that can be accessed by more than 1,000 users.</p>', 'en', '2021-06-16 13:33:29', '2021-07-15 13:47:02'),
(84, 42, '<p>Deka Harbor dari Lintasarta Cloudeka telah membantu salah satu anak perusahaan di kementerian yang mengelola Profesi dan Sertifikasi di Indonesia untuk pengembangan situs web beasiswa digital yang dapat diakses oleh lebih dari 1.000 pengguna.</p>', 'id', '2021-06-16 13:33:29', '2021-07-15 13:47:22'),
(85, 43, '<p>A government company engaged in population control and family planning has successfully used Deka Harbor&nbsp;by Lintasarta Cloudeka service for the deployment of a family information system web application and as an Indonesian family database.</p>', 'en', '2021-06-16 13:33:56', '2021-07-15 13:40:55'),
(86, 43, '<p>Sebuah perusahaan pemerintah yang bergerak di bidang pengendalian kependudukan dan keluarga berencana telah berhasil menggunakan layanan Deka Harbor by Lintasarta Cloudeka untuk penyebaran aplikasi web sistem informasi keluarga dan sebagai database keluarga Indonesia.</p>', 'id', '2021-06-16 13:33:56', '2021-07-15 13:41:22'),
